	('20240001_C020240303', 1, 3, 1, 1, '2024', 'C020240303', '70,09', 2.1027, 70.09, 15, 0.03, NULL, 1, '2024-10-31 01:58:59', 8, 0, '', '<ol><li><span lang="EN-ID" style="font-size:12.0pt;line-height:\n107%;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\nminor-latin;mso-ansi-language:EN-ID;mso-fareast-language:EN-US;mso-bidi-language:\nAR-SA">Dalam melakukan penyajian arsip aktif dan inaktif bagi kepentingan\ninternal dan eksternal Belum berdasarkan system klasifikasi keamanan dan akses\narsip dinamis</span></li><li><span lang="EN-ID" style="font-size:12.0pt;line-height:\n107%;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\nminor-latin;mso-ansi-language:EN-ID;mso-fareast-language:EN-US;mso-bidi-language:\nAR-SA"><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;">Belum melakukan&nbsp; penyerahan arsip statis.&nbsp;</span></span></li><li><span lang="EN-ID" style="font-size:12.0pt;line-height:\n107%;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\nminor-latin;mso-ansi-language:EN-ID;mso-fareast-language:EN-US;mso-bidi-language:\nAR-SA"><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;"><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;">Belum memiliki tenaga fungsional arsiparis&nbsp; Namun Sudah memiliki\npetugas pengelola arsip di setiap unit kerja.</span></span></span></li></ol>', '<ol><li><p class="MsoNormal" style="text-align:justify"><span lang="EN-ID" style="font-size:12.0pt;line-height:107%;font-family:&quot;Arial&quot;,sans-serif;\nmso-ansi-language:EN-ID">Dalam melakukan penyajian arsip aktif dan inaktif bagi\nkepentingan internal dan eksternal Agar berdasarkan system klasifikasi keamanan\ndan akses arsip dinamis<o:p></o:p></span></p></li><li><p class="MsoNormal" style="text-align:justify"><span lang="EN-ID" style="font-size:12.0pt;line-height:107%;font-family:&quot;Arial&quot;,sans-serif;\nmso-ansi-language:EN-ID"><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;">Agar melakukan penataan arsip Inaktif </span><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;">berdasarkan asas asal\nusul </span><span style="font-size: 12pt; line-height: 107%;">(menjaga arsip tetap\nterkelola dalam satu kesatuan pencipta arsip/provenance tidak dicampur dengan\narsip yang berasal dari pencipta arsip lain sehingga arsip dapat melekat pada\nkonteks penciptaannya), dan asas aturan asli (menjaga arsip tetap ditata sesuai\ndengan pengaturan aslinya/original order atau sesuai dengan pengaturan ketika\narsip masih digunakan untuk pelaksanaan kegiatan pencipta arsip).</span></span></p></li><li><p class="MsoNormal" style="text-align:justify"><span lang="EN-ID" style="font-size:12.0pt;line-height:107%;font-family:&quot;Arial&quot;,sans-serif;\nmso-ansi-language:EN-ID"><span style="font-size: 12pt; line-height: 107%;"></span></span></p><p class="MsoNormal" style="text-align:justify"><span lang="EN-ID" style="font-size:12.0pt;line-height:107%;font-family:&quot;Arial&quot;,sans-serif;\nmso-ansi-language:EN-ID">Agar melakukan kegiatan Penyusutan arsip melalui\nkegiatan pemusnahan arsip serta melakukan penyerahan arsip.<o:p></o:p></span></p></li><li><p class="MsoNormal" style="text-align:justify"><span lang="EN-ID" style="font-size:12.0pt;line-height:107%;font-family:&quot;Arial&quot;,sans-serif;\nmso-ansi-language:EN-ID"><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;">Agar memiliki tenaga fungsional arsiparis</span></span></p></li></ol>', '0000-00-00 00:00:00', 0),
