	('20240001_C020240501', 1, 3, 1, 1, '2024', 'C020240501', '60', 3, 60, 26, 0.05, NULL, 1, '2024-10-30 19:31:28', 3, 0, '', 'Unit Kerja Diusulkan ke TPN', '<span style="font-size: 13.3333px;">Pembangunan Zona Integritas telah masuk pada penilaian Tim Penilai Nasional, hal ini menunjukkan bahwa Pembangunan Zona Integritas yang dilakukan telah berjalan dengan baik, agar terus meningkatkan kualitas pembangunan Zona Integitas serta memperluas ke seluruh Unit kerja yang ada, selain itu agar mengoptimalkan sistem pengawasan integritas melalui penerapan manajemen risiko terutama risiko terjadinya pelanggaran integritas yang dapat menimbulkan kemungkinan terjadinya fraud (KKN)</span>', '0000-00-00 00:00:00', 0),
