	('20240003_C020240303', 3, 3, 1, 1, '2024', 'C020240303', '56,38', 1.6914, 56.38, 15, 0.03, NULL, 1, '2024-10-31 02:25:00', 8, 0, '', '<ol><li><p class="MsoNormal" style="text-align:justify"><span lang="EN-ID" style="font-size:12.0pt;line-height:107%;font-family:&quot;Arial&quot;,sans-serif;\nmso-ansi-language:EN-ID">Dalam melakukan penyajian arsip aktif dan inaktif bagi\nkepentingan internal dan eksternal Belum berdasarkan system klasifikasi\nkeamanan dan akses arsip dinamis<o:p></o:p></span></p></li><li><p class="MsoNormal" style="text-align:justify"><span lang="EN-ID" style="font-size:12.0pt;line-height:107%;font-family:&quot;Arial&quot;,sans-serif;\nmso-ansi-language:EN-ID"><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;">Badan Penanggulangan Bencana Daerah Provinsi Jawa Timur Sudah melakukan\nkegiatan pemberkasan arsip aktif dan penataan arsip inaktif di records centre\nNamun </span><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;">Penataan Arsip Inaktif pada Bagian Umum </span><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;">Badan Penanggulangan\nBencana Daerah</span><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;"> Provinsi Jawa Timur </span><b><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;">BELUM</span></b><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;"> dilakukan berdasarkan\nasas asal usul </span><span style="font-size: 12pt; line-height: 107%;">(menjaga arsip tetap terkelola dalam satu kesatuan pencipta\narsip/provenance tidak dicampur dengan arsip yang berasal dari pencipta arsip\nlain sehingga arsip dapat melekat pada konteks penciptaannya), dan asas aturan\nasli (menjaga arsip tetap ditata sesuai dengan pengaturan aslinya/original\norder atau sesuai dengan pengaturan ketika arsip masih digunakan untuk\npelaksanaan kegiatan pencipta arsip).</span></span></p></li><li><p class="MsoNormal" style="text-align:justify"><span lang="EN-ID" style="font-size:12.0pt;line-height:1