a/original order atau sesuai dengan pengaturan ketika\narsip masih digunakan untuk pelaksanaan kegiatan pencipta arsip).</span></span></li><li><span lang="EN-ID" style="font-size:12.0pt;line-height:\n107%;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\nminor-latin;mso-ansi-language:EN-ID;mso-fareast-language:EN-US;mso-bidi-language:\nAR-SA"><span style="font-size: 12pt; line-height: 107%;"><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;">Agar melakukan kegiatan penyusutan arsip</span></span></span></li><li><span lang="EN-ID" style="font-size:12.0pt;line-height:\n107%;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\nminor-latin;mso-ansi-language:EN-ID;mso-fareast-language:EN-US;mso-bidi-language:\nAR-SA"><span style="font-size: 12pt; line-height: 107%;"><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;"><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;">Agar memiliki tenaga fungsional arsiparis</span></span></span></span></li></ol>', '0000-00-00 00:00:00', 0),
