	('20240004_C020240402', 4, 3, 1, 1, '2024', 'C020240402', '98,05', 1.961, 98.05, 10, 0.02, NULL, 1, '2024-07-15 00:01:59', 11, 0, '', 'Sedikit lagi! Mohon skor ditingkatkan agar menuju angka sempurna di tahun depan.', '<span style="font-size: 13.333333px;">Jangan lupa unggah SPT Tahunan di aplikasi Si-Master sebelum tanggal 1 April.</span>', '0000-00-00 00:00:00', 0),
	('20240004_C020240403', 4, 3, 1, 1, '2024', 'C020240403', '60.46', 1.2092, 60.46, 10, 0.02, NULL, 1, '2024-11-20 01:15:05', 10, 0, '', 'Tahap I :<ul><li><span style="font-size: 13.3333px;">Dataset yang diampu masih kurang</span></li><li><span style="font-size: 13.3333px;">Pemenuhan keterisian data masih belum optimal</span></li><li><span style="font-size: 13.3333px;">Jumlah variabel masih belum merepresentasikan informasi yang disampaikan</span></li></ul><div>Tahap II :</div><div><ul><li><span lang="EN-US">Perencanaan data sudah dilakukan dengan\nbaik, namun perlu peningkatan koordinasi antar unit agar perencanaan lebih\nterintegrasi dan responsif terhadap perubahan kebutuhan.</span></li><li>Terdapat beberapa inkonsistensi dalam\npelaksanaan yang perlu diatasi melalui pelatihan dan pemantauan lebih intensif.</li><li>Peningkatan integrasi sistem perlu\ndilakukan untuk menghindari kesalahan dan mempercepat proses.</li><li>Perlu ada upaya untuk memperluas jangkauan\naudiens, khususnya di platform digital, dan evaluasi lebih lanjut terhadap\nefektivitas distribusinya.</li></ul></div>', 'Tahap I :<ul><li><span style="font-size: 13.3333px;">Perlu penambahan jumlah dataset</span></li><li><span style="font-size: 13.3333px;">Pemenuhan keterisian data perlu diinput sesuai periode data</span></li><li><span style="font-size: 13.3333px;">Jumlah variabel perlu dikaji ulang dan ditingkatkan&nbsp;</span></li></ul><div>Tahap II :</div><div><ul><li><span lang="EN-US">Perlu meningkatkan koordinasi antar unit\ndan evaluasi berkala untuk memastikan rencana yang lebih terintegrasi dan\nresponsif terhadap perubahan kebutuhan.</span></li><li>Perlu sistem pemantauan untuk memastikan\nkonsistensi dan ketepatan waktu pengumpulan data.</li><li>Perlu dilakukan audit atau pengecekan ulang\nsecara rutin terhadap data yang telah diproses untuk menjaga akurasi hasil.</li><li>Manfaatkan lebih banyak platform digital\ndan sosial media untuk memperluas jangkauan audiens terhadap media yang\ndigunakan serta pastikan informasi menjangkau audiens yang lebih luas dan\nrelevan.</li></ul></div>', '0000-00-00 00:00:00', 0),
	('20240004_C020240404', 4, 3, 1, 1, '2024', 'C020240404', '73,11', 1.4622, 73.11, 10, 0.02, NULL, 1, '2024-10-12 19:14:06', 10, 0, '', '<span style="font-size: 13.3333px;">Hasil Monev Tahun 2023 dan&nbsp;</span><span style="font-size: 13.3333px; font-weight: initial;">Hasil Karya Laman Web dan Media Sosial kurang maksimal</span>', '<div><span style="font-size: 13.3333px;">Monev Ki Jatim selanjutnya agar mengirimkan SAQ sesuai dengan instrumen yang ditetapkan</span></div><div><span style="font-size: 13.3333px;">Agar hasil karya laman web dan media sosial yang dikirim ke JPRA selanjutnya lebih baik lagi&nbsp;</span></div>', '0000-00-00 00:00:00', 0),
	('20240004_C020240501', 4, 3, 1, 1, '2024', 'C020240501', '80', 4, 80, 26, 0.05, NULL, 1, '2024-10-30 23:58:24', 3, 0, '', '<span style="font-family: Arial; font-size: 16px; white-space-collapse: preserve;">Unit kerja dibawahnya berpredikat WBK</span>', '<span style="font-size: 13.3333px;">Pembangunan Zona Integritas telah berjalan dengan baik, telah memperoleh predikat Wilayah Bebas dari Korupsi (WBK) dan sedang menuju Wilayah Birokrasi Bersih dan Melayani (WBBM). Agar membangun kedekatan dengan pengguna layanan dengan menyampaikan berbagai upaya perbaikan yang telah dilakukan dalam meningkatkan kualitas layanan dan integritas organisasi, serta meningkatkan kerja sama dengan stakeholders untuk pencapaian kinerja yang lebih baik serta mendorong unit kerja terus berinovasi yang berfokus pada layanan utama, terutama layanan yang terkait langsung dengan masyarakat.</span>', '0000-00-00 00:00:00', 0),
