	('20240005_C020240403', 5, 3, 1, 1, '2024', 'C020240403', '62.06', 1.2412, 62.06, 10, 0.02, NULL, 1, '2024-11-20 02:29:04', 10, 0, '', 'Tahap I :<div><span style="font-size: 13.3333px;">Interval waktu periode data masih panjang</span></div><div><span style="font-size: 13.3333px;">Tahap II :</span></div><div><ul><li><span lang="EN-US">Terdapat beberapa inkonsistensi dalam\npelaksanaan yang perlu diatasi melalui pelatihan dan pemantauan lebih intensif.</span></li><li>Peningkatan integrasi sistem perlu\ndilakukan untuk menghindari kesalahan dan mempercepat proses.</li><li>Perlu ada upaya untuk memperluas jangkauan\naudiens, khususnya di platform digital, dan evaluasi lebih lanjut terhadap\nefektivitas distribusinya.</li></ul></div>', 'Tahap I :<div><span style="font-size: 13.3333px;">Interval waktu periode data perlu dikaji ulang</span></div><div><span style="font-size: 13.3333px;">Tahap II :</span></div><div><ul><li><span lang="EN-US">Perlu sistem pemantauan untuk memastikan\nkonsistensi dan ketepatan waktu pengumpulan data.</span></li><li>Perlu dilakukan audit atau pengecekan ulang\nsecara rutin terhadap data yang telah diproses untuk menjaga akurasi hasil.</li><li>Manfaatkan lebih banyak platform digital\ndan sosial media untuk memperluas jangkauan audiens terhadap media yang\ndigunakan serta pastikan informasi menjangkau audiens yang lebih luas dan\nrelevan.</li></ul></div>', '0000-00-00 00:00:00', 0),
