	('20240006_C020240403', 6, 3, 1, 1, '2024', 'C020240403', '50.42', 1.0084, 50.42, 10, 0.02, NULL, 1, '2024-11-20 01:36:36', 10, 0, '', '<div>Tahap I:</div><ul><li>&nbsp;Dataset yang diampu masih kurang <br></li><li>&nbsp;Pemenuhan data tahun 2020-2022 kurang&nbsp; <br></li><li>&nbsp;Interval waktu periode data masih panjang&nbsp;</li></ul><p>Tahap II: <br></p><p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n</p><ul><li>Perencanaan data sudah dilakukan dengan baik, namun perlu\npeningkatan koordinasi antar unit agar perencanaan lebih terintegrasi dan\nresponsif terhadap perubahan kebutuhan.</li></ul>\n\n<ul><li>Terdapat beberapa inkonsistensi dalam pelaksanaan yang perlu\ndiatasi melalui pelatihan dan pemantauan lebih intensif.</li></ul>\n\n<ul><li>Peningkatan integrasi sistem perlu dilakukan untuk\nmenghindari kesalahan dan mempercepat proses.</li></ul>\n\n<ul><li>Perlu ada upaya untuk memperluas jangkauan audiens,\nkhususnya di platform digital, dan evaluasi lebih lanjut terhadap efektivitas\ndistribusinya.</li></ul>\n\n\n\n\n\n<p><style>@font-face\n	{font-family:"Cambria Math";\n	panose-1:2 4 5 3 5 4 6 3 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:roman;\n	mso-font-pitch:variable;\n	mso-font-signature:-536870145 1107305727 0 0 415 0;}@font-face\n	{font-family:Calibri;\n	panose-1:2 15 5 2 2 2 4 3 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:swiss;\n	mso-font-pitch:variable;\n	mso-font-signature:-536858881 -1073732485 9 0 511 0;}p.MsoNormal, li.MsoNormal, div.MsoNormal\n	{mso-style-unhide:no;\n	mso-style-qformat:yes;\n	mso-style-parent:"";\n	margin:0cm;\n	mso-pagination:widow-orphan;\n	font-size:12.0pt;\n	font-family:"Calibri",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:Calibri;\n	mso-fareast-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:"Times New Roman";\n	mso-bidi-theme-font:minor-bidi;\n	mso-font-kerning:1.0pt;\n	mso-liga