	('20240007_C020240401', 7, 3, 1, 1, '2024', 'C020240401', '100', 4, 100, 10, 0.04, NULL, 1, '2024-11-01 00:03:21', 12, 0, '', '<span style="font-size: 13.3333px;">capaian pencatatan RUP sudah sangat baik, dipertahankan untuk penilaian tahun 2025</span>', '<span style="font-size: 13.3333px;">capaian pencatatan RUP sudah sangat baik, dipertahankan untuk penilaian tahun 2025</span>', '0000-00-00 00:00:00', 0),
	('20240007_C020240402', 7, 3, 1, 1, '2024', 'C020240402', '93,75', 1.875, 93.75, 10, 0.02, NULL, 1, '2024-07-15 00:03:22', 11, 0, '', 'Mohon untuk ditingkatkan.', '<span style="font-size: 13.333333px;">Jangan lupa unggah SPT Tahunan di aplikasi Si-Master sebelum tanggal 1 April.</span>', '0000-00-00 00:00:00', 0),
	('20240007_C020240403', 7, 3, 1, 1, '2024', 'C020240403', '43.06', 0.8612, 43.06, 10, 0.02, NULL, 1, '2024-11-20 01:41:54', 10, 0, '', '<div>Tahap I:</div><ul><li>&nbsp;Dataset yang diampu masih kurang <br></li><li>&nbsp;Interval waktu periode data masih panjang <br></li></ul><p>Tahap II: <br></p><p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n</p><ul><li>Perencanaan data sudah dilakukan dengan baik, namun perlu\npeningkatan koordinasi antar unit agar perencanaan lebih terintegrasi dan\nresponsif terhadap perubahan kebutuhan.</li></ul>\n\n<ul><li>Terdapat beberapa inkonsistensi dalam pelaksanaan yang perlu\ndiatasi melalui pelatihan dan pemantauan lebih intensif.</li></ul>\n\n<ul><li>Peningkatan integrasi sistem perlu dilakukan untuk\nmenghindari kesalahan dan mempercepat proses.</li></ul>\n\n<ul><li>Perlu ada upaya untuk memperluas jangkauan audiens,\nkhususnya di platform digital, dan evaluasi lebih lanjut terhadap efektivitas\ndistribusinya.</li></ul>', '<div>Tahap I:&nbsp;</div><ul><li>Perlu penambahan jumlah dataset <br></li><li>Interval waktu periode data perlu dikaji ulang <br></li></ul><p>Tahap II:</p><p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n</p><ul><li>Perlu meningkatkan koordinasi antar unit dan evaluasi\nberkala untuk memastikan rencana yang lebih terintegrasi dan responsif terhadap\nperubahan kebutuhan.</li></ul>\n\n<ul><li>Perlu sistem pemantauan untuk memastikan konsistensi dan\nketepatan waktu pengumpulan data.</li></ul>\n\n<ul><li>Perlu dilakukan audit atau pengecekan ulang secara rutin\nterhadap data yang telah diproses untuk menjaga akurasi hasil.</li></ul>\n\n<ul><li>Manfaatkan lebih banyak platform digital dan sosial media\nuntuk memperluas jangkauan audiens terhadap media yang digunakan serta pastikan\ninformasi menjangkau audiens yang lebih luas dan relevan.</li></ul>', '0000-00-00 00:00:00', 0),
