	('20240008_C020240303', 8, 3, 1, 1, '2024', 'C020240303', '52,65', 1.5795, 52.65, 15, 0.03, NULL, 1, '2024-10-31 02:25:08', 8, 0, '', '<ol><li><p class="MsoNormal" style="text-align:justify"><span lang="EN-ID" style="font-size:12.0pt;line-height:107%;font-family:&quot;Arial&quot;,sans-serif;\nmso-ansi-language:EN-ID">Badan Penghubung Provinsi Jawa Timur dalam melakukan\npenyajian arsip aktif dan inaktif bagi kepentingan internal dan eksternal Belum\nberdasarkan system klasifikasi keamanan dan akses arsip dinamis<o:p></o:p></span></p></li><li><p class="MsoNormal" style="text-align:justify"><span lang="EN-ID" style="font-size:12.0pt;line-height:107%;font-family:&quot;Arial&quot;,sans-serif;\nmso-ansi-language:EN-ID"><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;">Badan Penghubung Provinsi Jawa Timur Sudah melakukan kegiatan\npemberkasan arsip aktif dan penataan arsip inaktif di records centre Namun </span><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;">Penataan Arsip Inaktif\npada Bagian Umum </span><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;">Badan Penghubung</span><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;"> Provinsi Jawa Timur&nbsp;</span></span><b style="font-size: 0.875rem; text-align: left;"><span lang="EN-ID" style="font-size:12.0pt;line-height:107%;font-family:&quot;Arial&quot;,sans-serif;\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:EN-ID;mso-fareast-language:\nEN-US;mso-bidi-language:AR-SA">BELUM</span></b><span lang="EN-ID" style="font-weight: initial; text-align: left; font-size: 12pt; line-height: 107%; font-family: Arial, sans-serif;"> dilakukan berdasarkan\nasas asal usul </span><span style="font-weight: initial; text-align: left; font-size: 12pt; line-height: 107%; font-family: Arial, sans-serif;">(menjaga arsip tetap terkelola dalam satu kesatuan pencipta\narsip/provenance tidak dicampur dengan arsip yang berasal dari pencipta arsip\nlain sehingga arsip dapat melekat pada konteks penciptaannya), dan asas aturan\nasli (menjaga arsip tetap ditata sesuai dengan pengaturan aslinya/original\norder atau sesuai dengan pengaturan ketika arsip masih digunakan untuk\npelaksanaan kegiatan pencipta arsip).</span></p></li><li><p class="MsoNormal" style="text-align:justify"><span style="font-weight: initial; text-align: left; font-size: 12pt; line-height: 107%; font-family: Arial, sans-serif;"></span></p><p class="MsoNormal" style="text-align:justify"><span lang="EN-ID" style="font-size:12.0pt;line-height:107%;font-family:&quot;Arial&quot;,sans-serif;\nmso-ansi-language:EN-ID">Badan Penghubung Provinsi Jawa Timur Belum melakukan\nkegiatan Penyusutan arsip</span></p></li><li><p class="MsoNormal" style="text-align:justify"><span style="font-family: Arial, sans-serif; font-size: 12pt; font-weight: initial; text-align: left;">Belum memiliki tenaga fungsional arsiparis Namun sudah memiliki petugas\npengelola arsip di setiap unit kerja.</span></p></li></ol>', '<ol><li><span lang="EN-ID" style="font-size:12.0pt;line-height:\n107%;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\nminor-latin;mso-ansi-language:EN-ID;mso-fareast-language:EN-US;mso-bidi-language:\nAR-SA">Badan Penghubung Provinsi Jawa Timur dalam melakukan penyajian arsip\naktif dan inaktif bagi kepentingan internal dan eksternal agar berdasarkan\nsystem klasifikasi keamanan dan akses arsip dinamis</span></li><li><span lang="EN-ID" style="font-size:12.0pt;line-height:\n107%;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\nminor-latin;mso-ansi-language:EN-ID;mso-fareast-language:EN-US;mso-bidi-language:\nAR-SA"><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;">Badan Penghubung Provinsi Jawa Timur Agar melakukan penataan arsip\nInaktif </span><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;">berdasarkan asas asal usul </span><span style="font-size: 12pt; line-height: 107%;">(menjaga arsip tetap\nterkelola dalam satu kesatuan pencipta arsip/provenance tidak dicampur dengan\narsip yang berasal dari pencipta arsip lain sehingga arsip dapat melekat pada\nkonteks penciptaannya), dan asas aturan asli (menjaga arsip tetap ditata sesuai\ndengan pengaturan aslinya/original order atau sesuai dengan pengaturan ketika\narsip masih digunakan untuk pelaksanaan kegiatan pencipta arsip).</span></span></li><li><span lang="EN-ID" style="font-size:12.0pt;line-height:\n107%;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\nminor-latin;mso-ansi-language:EN-ID;mso-fareast-language:EN-US;mso-bidi-language:\nAR-SA"><span style="font-size: 12pt; line-height: 107%;"><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;">Agar melakukan kegiatan penyusutan arsip.</span></span></span></li><li><span lang="EN-ID" style="font-size:12.0pt;line-height:\n107%;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\nminor-latin;mso-ansi-language:EN-ID;mso-fareast-language:EN-US;mso-bidi-language:\nAR-SA"><span style="font-size: 12pt; line-height: 107%;"><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;"><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;">Agar memiliki tenaga fungsional arsiparis</span></span></span></span></li></ol>', '0000-00-00 00:00:00', 0),
