	('20240012_C020240403', 12, 3, 1, 1, '2024', 'C020240403', '61.63', 1.2326, 61.63, 10, 0.02, NULL, 1, '2024-11-20 00:55:38', 10, 0, '', '<span style="font-size: 13.3333px;">Tahap I :</span><div><ul><li><span style="font-size: 13.3333px;">Dataset yang diampu masih kurang</span></li><li><span style="font-size: 13.3333px;">Interval waktu periode data masih panjang</span></li><li><span style="font-size: 13.3333px;">Jumlah variabel masih belum merepresentasikan informasi yang disampaikan</span></li></ul><div>Tahap II :</div></div><ul><li><span style="font-size: 13.3333px;">Terdapat beberapa inkonsistensi dalam pelaksanaan yang perlu diatasi melalui pelatihan dan pemantauan lebih intensif.</span></li><li><span style="font-size: 13.3333px;">Peningkatan integrasi sistem perlu dilakukan untuk menghindari kesalahan dan mempercepat proses.</span></li><li><span style="font-size: 13.3333px;">Perlu ada upaya untuk memperluas jangkauan audiens, khususnya di platform digital, dan evaluasi lebih lanjut terhadap efektivitas distribusinya.</span></li></ul>', '<span style="font-size: 13.3333px;">Tahap I :</span><ul><li><span style="font-size: 13.3333px;">Perlu penambahan jumlah dataset</span></li><li><span style="font-size: 13.3333px;">Interval waktu periode data perlu dikaji ulang</span></li><li><span style="font-size: 13.3333px;">Jumlah variabel perlu dikaji ulang dan ditingkatkan&nbsp;</span></li></ul><div>Tahap II :</div><ul><li><span style="font-size: 13.3333px; font-weight: initial;">Perlu sistem pemantauan untuk memastikan konsistensi dan ketepatan waktu pengumpulan data.</span></li><li><span style="font-size: 13.3333px;">Perlu dilakukan audit atau pengecekan ulang secara rutin terhadap data yang telah diproses untuk menjaga akurasi hasil.</span></li><li><span style="font-size: 13.3333px;">Manfaatkan lebih banyak platform digital dan sosial media untuk memperluas jangkauan audiens terhadap media yang digunakan serta pastikan informasi menjangkau audiens yang lebih luas dan relevan.</span></li></ul>', '0000-00-00 00:00:00', 0),
	('20240012_C020240404', 12, 3, 1, 1, '2024', 'C020240404', '76,46', 1.5292, 76.46, 10, 0.02, NULL, 1, '2024-10-12 19:10:44', 10, 0, '', '<div><span style="font-size: 13.3333px;">Hasil Monev Tahun 2023 dan&nbsp;</span><span style="font-size: 13.3333px; font-weight: initial;">Hasil Karya Laman Web dan Media Sosial kurang maksimal</span></div><div><br></div>', '<div><span style="font-size: 13.3333px;">Monev Ki Jatim selanjutnya agar mengirimkan SAQ sesuai dengan instrumen yang ditetapkan</span></div><div><span style="font-size: 13.3333px;">Agar hasil karya laman web dan media sosial yang dikirim ke JPRA selanjutnya lebih baik lagi</span></div>', '0000-00-00 00:00:00', 0),
