	('20240013_C020240403', 13, 3, 1, 1, '2024', 'C020240403', '41.99', 0.8398, 41.99, 10, 0.02, NULL, 1, '2024-11-20 01:01:59', 10, 0, '', 'Tahap I :<ul><li><span style="font-size: 13.3333px;">Pemenuhan data tahun 2020-2022 kurang&nbsp;</span></li><li><span style="font-size: 13.3333px;">Interval waktu periode data masih panjang</span></li><li><span style="font-size: 13.3333px;">Jumlah variabel masih belum merepresentasikan informasi yang disampaikan</span></li></ul><div>Tahap II :&nbsp;</div><ul><li><span style="font-size: 13.3333px;">Perencanaan data sudah dilakukan dengan baik, namun perlu peningkatan koordinasi antar unit agar perencanaan lebih terintegrasi dan responsif terhadap perubahan kebutuhan.</span></li><li><span style="font-size: 13.3333px;">Terdapat beberapa inkonsistensi dalam pelaksanaan yang perlu diatasi melalui pelatihan dan pemantauan lebih intensif.</span></li><li><span style="font-size: 13.3333px;">Peningkatan integrasi sistem perlu dilakukan untuk menghindari kesalahan dan mempercepat proses.</span></li><li><span style="font-size: 13.3333px;">Perlu ada upaya untuk memperluas jangkauan audiens, khususnya di platform digital, dan evaluasi lebih lanjut terhadap efektivitas distribusinya.</span></li></ul>', 'Tahap I :<ul><li><span style="font-size: 13.3333px;">Agar dilakukan pemenuhan data tahun 2020-2022</span></li><li><span style="font-size: 13.3333px;">Interval waktu periode data perlu dikaji ulang</span></li><li><span style="font-size: 13.3333px;">Jumlah variabel perlu dikaji ulang dan ditingkatkan&nbsp;</span></li></ul><div>Tahap II :</div><ul><li><span style="font-size: 13.3333px;">Perlu meningkatkan koordinasi antar unit dan evaluasi berkala untuk memastikan rencana yang lebih terintegrasi dan responsif terhadap perubahan kebutuhan.</span></li><li><span style="font-size: 13.3333px;">Perlu sistem pemantauan untuk memastikan konsistensi dan ketepatan waktu pengumpulan data.</span></li><li><span style="font-size: 13.3333px;">Perlu dilakukan audit atau pengecekan ulang secara rutin terhadap data yang telah diproses untuk menjaga akurasi hasil.</span></li><li><span style="font-size: 13.3333px;">Manfaatkan lebih banyak platform digital dan sosial media untuk memperluas jangkauan audiens terhadap media yang digunakan serta pastikan informasi menjangkau audiens yang lebih luas dan relevan.</span></li></ul>', '0000-00-00 00:00:00', 0),
	('20240013_C020240404', 13, 3, 1, 1, '2024', 'C020240404', '76,08', 1.5216, 76.08, 10, 0.02, NULL, 1, '2024-10-12 19:11:47', 10, 0, '', '<span style="font-size: 13.3333px;">Hasil Monev Tahun 2023 dan&nbsp;</span><span style="font-size: 13.3333px; font-weight: initial;">Hasil Karya Laman Web dan Media Sosial kurang maksimal</span>', '<div><span style="font-size: 13.3333px;">Monev Ki Jatim selanjutnya agar mengirimkan SAQ sesuai dengan instrumen yang ditetapkan</span></div><div><span style="font-size: 13.3333px;">Agar hasil karya laman web dan media sosial yang dikirim ke JPRA selanjutnya lebih baik lagi</span></div>', '0000-00-00 00:00:00', 0),
