mur dalam melakukan\npenyajian arsip aktif dan inaktif bagi kepentingan internal dan eksternal Agar\nberdasarkan system klasifikasi keamanan dan akses arsip dinamis<o:p></o:p></span></p></li><li><p class="MsoNormal" style="text-align:justify"><span lang="EN-ID" style="font-size:12.0pt;line-height:107%;font-family:&quot;Arial&quot;,sans-serif;\nmso-ansi-language:EN-ID"><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;">Dinas Kehutanan Provinsi Jawa Timur Agar melakukan penataan arsip\nInaktif </span><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;">berdasarkan asas asal usul </span><span style="font-size: 12pt; line-height: 107%;">(menjaga arsip tetap\nterkelola dalam satu kesatuan pencipta arsip/provenance tidak dicampur dengan\narsip yang berasal dari pencipta arsip lain sehingga arsip dapat melekat pada\nkonteks penciptaannya), dan asas aturan asli (menjaga arsip tetap ditata sesuai\ndengan pengaturan aslinya/original order atau sesuai dengan pengaturan ketika\narsip masih digunakan untuk pelaksanaan kegiatan pencipta arsip).</span></span></p></li><li><p class="MsoNormal" style="text-align:justify"><span lang="EN-ID" style="font-size:12.0pt;line-height:107%;font-family:&quot;Arial&quot;,sans-serif;\nmso-ansi-language:EN-ID"><span style="font-size: 12pt; line-height: 107%;"></span></span></p><p class="MsoNormal" style="text-align:justify"><span lang="EN-ID" style="font-size:12.0pt;line-height:107%;font-family:&quot;Arial&quot;,sans-serif;\nmso-ansi-language:EN-ID">Dinas Kehutanan Provinsi Jawa Timur Agar melakukan\nkegiatan Penyusutan arsip melalui kegiatan pemusnahan arsip dan Unit Pengolah\ndi Lingkungan Dinas Kehutanan Provinsi Jawa Timur Agar melakukan pemindahan\narsip-arsip Inaktif secara rutin ke ruang penyimpanan arsip/records center.<o:p></o:p></span></p></li></ol>', '0000-00-00 00:00:00', 0),
