	('20240025_C020240403', 25, 3, 1, 1, '2024', 'C020240403', '53.76', 1.0752, 53.76, 10, 0.02, NULL, 1, '2024-11-20 04:56:55', 10, 0, '', 'Tahap I :<ul><li><span style="font-size: 13.3333px;">Dataset yang diampu masih kurang</span></li><li><span style="font-size: 13.3333px;">Pemenuhan data tahun 2020-2022 kurang&nbsp;</span></li><li><span style="font-size: 13.3333px;">Pemenuhan keterisian data masih belum optimal</span></li><li><span style="font-size: 13.3333px;">Interval waktu periode data masih panjang</span></li><li><span style="font-size: 13.3333px;">Jumlah variabel masih belum merepresentasikan informasi yang disampaikan</span></li></ul><div>Tahap II :</div><div><ul><li><span lang="EN-US">Perencanaan data sudah dilakukan dengan\nbaik, namun perlu peningkatan koordinasi antar unit agar perencanaan lebih\nterintegrasi dan responsif terhadap perubahan kebutuhan.</span></li><li>Terdapat beberapa inkonsistensi dalam\npelaksanaan yang perlu diatasi melalui pelatihan dan pemantauan lebih intensif.</li><li>Peningkatan integrasi sistem perlu\ndilakukan untuk menghindari kesalahan dan mempercepat proses.</li><li>Perlu ada upaya untuk memperluas jangkauan\naudiens, khususnya di platform digital, dan evaluasi lebih lanjut terhadap\nefektivitas distribusinya.</li></ul></div>', 'Tahap I :<ul><li><span style="font-size: 13.3333px;">Perlu penambahan jumlah dataset</span></li><li><span style="font-size: 13.3333px;">Agar dilakukan pemenuhan data tahun 2020-2022</span></li><li><span style="font-size: 13.3333px;">Pemenuhan keterisian data perlu diinput sesuai periode data</span></li><li><span style="font-size: 13.3333px;">Interval waktu periode data perlu dikaji ulang</span></li><li><span style="font-size: 13.3333px;">Jumlah variabel perlu dikaji ulang dan ditingkatkan&nbsp;</span></li></ul><div>Tahap II :</div><div><ul><li><span lang="EN-US">Perlu meningkatkan koordinasi antar unit\ndan evaluasi berkala untuk memastikan rencana yang lebih terintegrasi dan\nresponsif terhadap perubahan kebutuhan.</span></li><li>Perlu sistem pemantauan untuk memastikan\nkonsistensi dan ketepatan waktu pengumpulan data.</li><li>Perlu dilakukan audit atau pengecekan ulang\nsecara rutin terhadap data yang telah diproses untuk menjaga akurasi hasil.</li><li>Manfaatkan lebih banyak platform digital\ndan sosial media untuk memperluas jangkauan audiens terhadap media yang\ndigunakan serta pastikan informasi menjangkau audiens yang lebih luas dan\nrelevan.</li></ul></div>', '0000-00-00 00:00:00', 0),
