	('20240028_C020240303', 28, 3, 1, 1, '2024', 'C020240303', '76,74', 2.3022, 76.74, 15, 0.03, NULL, 1, '2024-10-31 02:25:53', 8, 0, '', '<ol><li><p class="MsoNormal" style="text-align:justify"><span lang="EN-ID" style="font-size:12.0pt;line-height:107%;font-family:&quot;Arial&quot;,sans-serif;\nmso-ansi-language:EN-ID">Dinas Perhubungan Provinsi Jawa Timur Sudah melakukan\nkegiatan pemberkasan arsip aktif Namun didalam melakukan kegiatan pemberkasan\narsip aktif hanya Sebagian arsip aktif yang dibuatkan daftar arsipnya Sedangkan\npenataan arsip inaktif di records centre Namun </span><span lang="EN-ID" style="font-size:12.0pt;line-height:107%;font-family:&quot;Arial&quot;,sans-serif;\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:EN-ID;mso-bidi-font-weight:\nbold">Penataan Arsip Inaktif pada Bagian Umum </span><span lang="EN-ID" style="font-size:12.0pt;line-height:107%;font-family:&quot;Arial&quot;,sans-serif;\nmso-ansi-language:EN-ID">Dinas Perhubungan</span><span lang="EN-ID" style="font-size:12.0pt;line-height:107%;font-family:&quot;Arial&quot;,sans-serif;\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:EN-ID;mso-bidi-font-weight:\nbold"> Provinsi Jawa Timur Sudah dilakukan berdasarkan asas asal usul </span><span style="font-size:12.0pt;line-height:107%;font-family:&quot;Arial&quot;,sans-serif">(menjaga\narsip tetap terkelola dalam satu kesatuan pencipta arsip/provenance tidak\ndicampur dengan arsip yang berasal dari pencipta arsip lain sehingga arsip\ndapat melekat pada konteks penciptaannya), dan asas aturan asli (menjaga arsip\ntetap ditata sesuai dengan pengaturan aslinya/original order atau sesuai dengan\npengaturan ketika arsip masih digunakan untuk pelaksanaan kegiatan pencipta\narsip).<o:p></o:p></span></p></li><li><p class="MsoNormal" style="text-align:justify"><span style="font-size:12.0pt;line-height:107%;font-family:&quot;Arial&quot;,sans-serif"><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;