	('20240029_C020240403', 29, 3, 1, 1, '2024', 'C020240403', '72.31', 1.4462, 72.31, 10, 0.02, NULL, 1, '2024-11-20 03:58:51', 10, 0, '', '<div>Tahap I :</div><ul><li>Dataset yang diampu masih kurang</li><li>Pemenuhan data tahun 2020-2022 kurang&nbsp;</li><li>Pemenuhan keterisian data masih belum optimal</li><li>Interval waktu periode data masih panjang</li><li>Jumlah variabel masih belum merepresentasikan informasi yang disampaikan</li></ul><p>Tahap II :</p><p>Terdapat beberapa inkonsistensi dalam pelaksanaan yang perlu diatasi melalui pelatihan dan pemantauan lebih intensif.<br><br></p>', '<div>Tahap I :</div><ul><li>Perlu penambahan jumlah dataset</li><li>Agar dilakukan pemenuhan data tahun 2020-2022</li><li>Pemenuhan keterisian data perlu diinput sesuai periode data</li><li>Interval waktu periode data perlu dikaji ulang</li><li>Jumlah variabel perlu dikaji ulang dan ditingkatkan </li></ul><p>Tahap II :</p><p>Perlu sistem pemantauan untuk memastikan konsistensi dan ketepatan waktu pengumpulan data.<br><br></p><p><br><br></p>', '0000-00-00 00:00:00', 0),
