	('20240029_C020240501', 29, 3, 1, 1, '2024', 'C020240501', '80', 4, 80, 26, 0.05, NULL, 1, '2024-10-30 23:56:18', 3, 0, '', '<span style="font-size: 13.3333px;">Unit Kerja Diusulkan ke TPN</span>', '<span style="font-size: 13.3333px;">Pembangunan Zona Integritas telah masuk pada penilaian Tim Penilai Nasional, hal ini menunjukkan bahwa Pembangunan Zona Integritas yang dilakukan telah berjalan dengan baik, agar terus meningkatkan kualitas pembangunan Zona Integitas serta memperluas ke seluruh Unit kerja yang ada, selain itu agar mengoptimalkan sistem pengawasan integritas melalui penerapan manajemen risiko terutama risiko terjadinya pelanggaran integritas yang dapat menimbulkan kemungkinan terjadinya fraud (KKN).</span>', '0000-00-00 00:00:00', 0),
