	('20240032_C020240403', 32, 3, 1, 1, '2024', 'C020240403', '68.89', 1.3778, 68.89, 10, 0.02, NULL, 1, '2024-11-20 03:44:41', 10, 0, '', '<div>Tahap I :</div><ul><li>&nbsp;Pemenuhan data tahun 2020-2022 kurang &nbsp;</li><li>&nbsp;Pemenuhan keterisian data masih belum optimal&nbsp;</li><li>&nbsp;Interval waktu periode data masih panjang <br></li></ul><p>Tahap II :</p><ul><li>Perencanaan data sudah dilakukan dengan baik, namun perlu peningkatan koordinasi antar unit agar perencanaan lebih terintegrasi dan responsif terhadap perubahan kebutuhan.</li><li>Terdapat beberapa inkonsistensi dalam pelaksanaan yang perlu diatasi melalui pelatihan dan pemantauan lebih intensif.</li><li>Peningkatan integrasi sistem perlu dilakukan untuk menghindari kesalahan dan mempercepat proses.</li><li>Perlu ada upaya untuk memperluas jangkauan audiens, khususnya di platform digital, dan evaluasi lebih lanjut terhadap efektivitas distribusinya.<br><br></li></ul><p><br><br></p>', '<div>Tahap I :</div><ul><li>&nbsp;Agar dilakukan pemenuhan data tahun 2020-2022&nbsp;</li><li>Pemenuhan keterisian data perlu diinput sesuai periode data&nbsp;</li><li>Interval waktu periode data perlu dikaji ulang <br></li></ul><p>Tahap II :</p><ul><li>Perlu meningkatkan koordinasi antar unit dan evaluasi berkala untuk memastikan rencana yang lebih terintegrasi dan responsif terhadap perubahan kebutuhan.</li><li>Perlu sistem pemantauan untuk memastikan konsistensi dan ketepatan waktu pengumpulan data.</li><li>Perlu dilakukan audit atau pengecekan ulang secara rutin terhadap data yang telah diproses untuk menjaga akurasi hasil.</li><li>Manfaatkan lebih banyak platform digital dan sosial media untuk memperluas jangkauan audiens terhadap media yang digunakan serta pastikan informasi menjangkau audiens yang lebih luas dan relevan.<br><br></li></ul>', '0000-00-00 00:00:00', 0),
	('20240032_C020240404', 32, 3, 1, 1, '2024', 'C020240404', '50,32', 1.0064, 50.32, 10, 0.02, NULL, 1, '2024-10-13 00:06:26', 10, 0, '', '<div><span style="font-size: 13.3333px;">Tidak mengikuti Monev Tahun 2023</span></div><div><span style="font-size: 13.3333px;">Hasil Karya Laman Web dan Media Sosial belum maksimal</span></div><div><span style="font-size: 13.3333px;">Laman Web PPID belum sesuai dengan PerKI 1/2021</span></div>', '<div><span style="font-size: 13.3333px;">Monev Ki Jatim selanjutnya agar mengirimkan SAQ sesuai dengan instrumen yang ditetapkan</span></div><div><span style="font-size: 13.3333px;">Agar hasil karya laman web dan media sosial yang dikirim ke JPRA selanjutnya lebih baik lagi&nbsp;</span></div><div><span style="font-size: 13.3333px;">Laman Web PPID agar disesuaikan dengan PerKI 1/2021</span></div>', '0000-00-00 00:00:00', 0),
	('20240032_C020240501', 32, 3, 1, 1, '2024', 'C020240501', '80', 4, 80, 26, 0.05, NULL, 1, '2024-10-31 19:50:51', 3, 0, '', 'Unit kerja dibawahnya berpredikat WBK', 'Pembangunan Zona Integritas telah berjalan dengan baik, telah memperoleh predikat Wilayah Bebas dari Korupsi (WBK) dan sedang menuju Wilayah Birokrasi Bersih dan Melayani (WBBM). Agar membangun kedekatan dengan pengguna layanan dengan menyampaikan berbagai upaya perbaikan yang telah dilakukan dalam meningkatkan kualitas layanan dan integritas organisasi, serta meningkatkan kerja sama dengan stakeholders untuk pencapaian kinerja yang lebih baik serta mendorong unit kerja terus berinovasi yang berfokus pada layanan utama, terutama layanan yang terkait langsung dengan masyarakat.', '0000-00-00 00:00:00', 0),
