	('20240033_C020240403', 33, 3, 1, 1, '2024', 'C020240403', '49.67', 0.9934, 49.67, 10, 0.02, NULL, 1, '2024-11-20 03:39:29', 10, 0, '', '<div>Tahap I :</div><ul><li>&nbsp;Dataset yang diampu masih kurang&nbsp;</li><li>Definisi operasional masih belum menjelaskan judul data&nbsp;</li><li>&nbsp;Pemenuhan data tahun 2020-2022 kurang&nbsp;&nbsp;</li><li>Pemenuhan keterisian data masih belum optimal&nbsp;</li><li>Interval waktu periode data masih panjang&nbsp;</li><li>Jumlah variabel masih belum merepresentasikan informasi yang disampaikan <br></li></ul><p>Tahap II :</p><ul><li>Peningkatan integrasi sistem perlu dilakukan untuk menghindari kesalahan dan mempercepat proses.</li><li>Perlu ada upaya untuk memperluas jangkauan audiens, khususnya di platform digital, dan evaluasi lebih lanjut terhadap efektivitas distribusinya.<br><br></li></ul>', '<div>Tahap I :</div><ul><li>&nbsp;Perlu penambahan jumlah dataset&nbsp;</li><li>&nbsp;Definisi operasional/ metadata perlu dilengkapi pada kamus data di dalam portal sata&nbsp;</li><li>&nbsp;Agar dilakukan pemenuhan data tahun 2020-2022&nbsp;</li><li>&nbsp;Pemenuhan keterisian data perlu diinput sesuai periode data&nbsp;</li><li>&nbsp;Interval waktu periode data perlu dikaji ulang&nbsp;</li><li>&nbsp;Jumlah variabel perlu dikaji ulang dan ditingkatkan&nbsp; <br></li></ul><p>Tahap II :</p><ul><li>Perlu dilakukan audit atau pengecekan ulang secara rutin terhadap data yang telah diproses untuk menjaga akurasi hasil.</li><li>Manfaatkan lebih banyak platform digital dan sosial media untuk memperluas jangkauan audiens terhadap media yang digunakan serta pastikan informasi menjangkau audiens yang lebih luas dan relevan.<br><br></li></ul>', '0000-00-00 00:00:00', 0),
	('20240033_C020240404', 33, 3, 1, 1, '2024', 'C020240404', '41,48', 0.8296, 41.48, 10, 0.02, NULL, 1, '2024-10-13 00:07:19', 10, 0, '', '<div><span style="font-size: 13.3333px;">Hasil Monev Tahun 2023 dan&nbsp;</span><span style="font-size: 13.3333px; font-weight: initial;">Hasil Karya Laman Web dan Media Sosial belum maksimal</span></div><div><span style="font-size: 13.3333px;">Laman Web PPID belum sesuai dengan PerKI 1/2021</span></div>', '<div><span style="font-size: 13.3333px;">Monev Ki Jatim selanjutnya agar mengirimkan SAQ sesuai dengan instrumen yang ditetapkan</span></div><div><span style="font-size: 13.3333px;">Agar hasil karya laman web dan media sosial yang dikirim ke JPRA selanjutnya lebih baik lagi&nbsp;</span></div><div><span style="font-size: 13.3333px;">Laman Web PPID agar disesuaikan dengan PerKI 1/2021</span></div>', '0000-00-00 00:00:00', 0),
