	('20240035_C020240403', 35, 3, 1, 1, '2024', 'C020240403', '72.46', 1.4492, 72.46, 10, 0.02, NULL, 1, '2024-11-20 03:27:58', 10, 0, '', '<div>Tahap I :</div><ul><li>Dataset yang diampu masih kurang</li><li>Pemenuhan data tahun 2020-2022 kurang&nbsp;</li><li>Interval waktu periode data masih panjang</li><li>Jumlah variabel masih belum merepresentasikan informasi yang disampaikan</li></ul><p>Tahap II :</p><p>Perlu ada upaya untuk memperluas jangkauan audiens, khususnya di platform digital, dan evaluasi lebih lanjut terhadap efektivitas distribusinya.<br><br></p>', '<div>Tahap I :</div><ul><li>Perlu penambahan jumlah dataset</li><li>Agar dilakukan pemenuhan data tahun 2020-2022</li><li>Interval waktu periode data perlu dikaji ulang</li><li>Jumlah variabel perlu dikaji ulang dan ditingkatkan <br></li></ul><p>Tahap II :</p><p>Manfaatkan lebih banyak platform digital dan sosial media untuk memperluas jangkauan audiens terhadap media yang digunakan serta pastikan informasi menjangkau audiens yang lebih luas dan relevan.<br><br></p>', '0000-00-00 00:00:00', 0),
