	('20240036_C020240402', 36, 3, 1, 1, '2024', 'C020240402', '20', 0.4, 20, 10, 0.02, NULL, 1, '2024-10-29 19:02:07', 11, 0, '', 'Tingkatkan.', '<span style="font-size: 13.333333px;">Jangan lupa unggah SPT Tahunan di aplikasi Si-Master sebelum tanggal 1 April.</span>', '0000-00-00 00:00:00', 0),
	('20240036_C020240403', 36, 3, 1, 1, '2024', 'C020240403', '64.42', 1.2884, 64.42, 10, 0.02, NULL, 1, '2024-11-20 03:20:22', 10, 0, '', '<div>Tahap I :</div><ul><li>Dataset yang diampu masih kurang</li><li>Interval waktu periode data masih panjang</li><li>Jumlah variabel masih belum merepresentasikan informasi yang disampaikan</li></ul><p>Tahap II :</p><ul><li>Perencanaan data sudah dilakukan dengan baik, namun perlu peningkatan koordinasi antar unit agar perencanaan lebih terintegrasi dan responsif terhadap perubahan kebutuhan.</li><li>Terdapat beberapa inkonsistensi dalam pelaksanaan yang perlu diatasi melalui pelatihan dan pemantauan lebih intensif.</li><li>Peningkatan integrasi sistem perlu dilakukan untuk menghindari kesalahan dan mempercepat proses.</li><li>Perlu ada upaya untuk memperluas jangkauan audiens, khususnya di platform digital, dan evaluasi lebih lanjut terhadap efektivitas distribusinya.<br><br></li></ul>', '<div>Tahap I :</div><ul><li>Perlu penambahan jumlah dataset</li><li>Interval waktu periode data perlu dikaji ulang</li><li>Jumlah variabel perlu dikaji ulang dan ditingkatkan <br></li></ul><p>Tahap II:</p><ul><li>Perlu meningkatkan koordinasi antar unit dan evaluasi berkala untuk memastikan rencana yang lebih terintegrasi dan responsif terhadap perubahan kebutuhan.</li><li>Perlu sistem pemantauan untuk memastikan konsistensi dan ketepatan waktu pengumpulan data.</li><li>Perlu dilakukan audit atau pengecekan ulang secara rutin terhadap data yang telah diproses untuk menjaga akurasi hasil.</li><li>Manfaatkan lebih banyak platform digital dan sosial media untuk memperluas jangkauan audiens terhadap media yang digunakan serta pastikan informasi menjangkau audiens yang lebih luas dan relevan.<br><br></li></ul>', '0000-00-00 00:00:00', 0),
	('20240036_C020240404', 36, 3, 1, 1, '2024', 'C020240404', '79,19', 1.5838, 79.19, 10, 0.02, NULL, 1, '2024-10-13 00:09:22', 10, 0, '', '<span style="font-size: 13.3333px;">Hasil Monev Tahun 2023 dan&nbsp;</span><span style="font-size: 13.3333px; font-weight: initial;">Hasil Karya Laman Web dan Media Sosial belum maksimal</span>', '<div><span style="font-size: 13.3333px;">Monev Ki Jatim selanjutnya agar mengirimkan SAQ sesuai dengan instrumen yang ditetapkan</span></div><div><span style="font-size: 13.3333px;">Agar hasil karya laman web dan media sosial yang dikirim ke JPRA selanjutnya lebih baik lagi&nbsp;</span></div><div><br></div>', '0000-00-00 00:00:00', 0),
