	('20240037_C020240402', 37, 3, 1, 1, '2024', 'C020240402', '100', 2, 100, 10, 0.02, NULL, 1, '2024-07-15 01:46:55', 11, 0, '', 'Pertahankan.', '<span style="font-size: 13.333333px;">Jangan lupa unggah SPT Tahunan di aplikasi Si-Master sebelum tanggal 1 April.</span>', '0000-00-00 00:00:00', 0),
	('20240037_C020240403', 37, 3, 1, 1, '2024', 'C020240403', '60.09', 1.2018, 60.09, 10, 0.02, NULL, 1, '2024-11-20 03:16:14', 10, 0, '', '<div>Tahap I :</div><ul><li>&nbsp;Dataset yang diampu masih kurang&nbsp;</li><li>&nbsp;Definisi operasional masih belum menjelaskan judul data&nbsp;</li><li>&nbsp;Pemenuhan data tahun 2020-2022 kurang&nbsp;&nbsp;</li><li>Pemenuhan keterisian data masih belum optimal&nbsp;</li><li>Interval waktu periode data masih panjang&nbsp;</li><li>Jumlah variabel masih belum merepresentasikan informasi yang disampaikan <br></li></ul><p>Tahap II :</p><ul><li>Perencanaan data sudah dilakukan dengan baik, namun perlu peningkatan koordinasi antar unit agar perencanaan lebih terintegrasi dan responsif terhadap perubahan kebutuhan.</li><li>Terdapat beberapa inkonsistensi dalam pelaksanaan yang perlu diatasi melalui pelatihan dan pemantauan lebih intensif.</li><li>Peningkatan integrasi sistem perlu dilakukan untuk menghindari kesalahan dan mempercepat proses.</li><li>Perlu ada upaya untuk memperluas jangkauan audiens, khususnya di platform digital, dan evaluasi lebih lanjut terhadap efektivitas distribusinya.<br><br></li></ul>', '<div>Tahap I :</div><ul><li>&nbsp;Perlu penambahan jumlah dataset&nbsp;</li><li>Definisi operasional/ metadata perlu dilengkapi pada kamus data di dalam portal sata&nbsp;</li><li>Agar dilakukan pemenuhan data tahun 2020-2022&nbsp;</li><li>Pemenuhan keterisian data perlu diinput sesuai periode data&nbsp;</li><li>&nbsp;Interval waktu periode data perlu dikaji ulang&nbsp;</li><li>&nbsp;Jumlah variabel perlu dikaji ulang dan ditingkatkan&nbsp; <br></li></ul><p>Tahap II :</p><ul><li>Perlu meningkatkan koordinasi antar unit dan evaluasi berkala untuk memastikan rencana yang lebih terintegrasi dan responsif terhadap perubahan kebutuhan.</li><li>Perlu sistem pemantauan untuk memastikan konsistensi dan ketepatan waktu pengumpulan data.</li><li>Perlu dilakukan audit atau pengecekan ulang secara rutin terhadap data yang telah diproses untuk menjaga akurasi hasil.</li><li>Manfaatkan lebih banyak platform digital dan sosial media untuk memperluas jangkauan audiens terhadap media yang digunakan serta pastikan informasi menjangkau audiens yang lebih luas dan relevan.<br><br></li></ul>', '0000-00-00 00:00:00', 0),
