	('20240038_C020240403', 38, 3, 1, 1, '2024', 'C020240403', '58.23', 1.1646, 58.23, 10, 0.02, NULL, 1, '2024-11-20 03:12:24', 10, 0, '', '<div>Tahap I :</div><ul><li>&nbsp;Pemenuhan keterisian data masih belum optimal&nbsp;</li><li>&nbsp;Interval waktu periode data masih panjang&nbsp;</li><li>&nbsp;Jumlah variabel masih belum merepresentasikan informasi yang disampaikan <br></li></ul><p>Tahap II :</p><ul><li>Perencanaan data sudah dilakukan dengan baik, namun perlu peningkatan koordinasi antar unit agar perencanaan lebih terintegrasi dan responsif terhadap perubahan kebutuhan.</li><li>Terdapat beberapa inkonsistensi dalam pelaksanaan yang perlu diatasi melalui pelatihan dan pemantauan lebih intensif.</li><li>Peningkatan integrasi sistem perlu dilakukan untuk menghindari kesalahan dan mempercepat proses.</li><li>Perlu ada upaya untuk memperluas jangkauan audiens, khususnya di platform digital, dan evaluasi lebih lanjut terhadap efektivitas distribusinya.<br><br></li></ul>', '<div>Tahap I :</div><ul><li>&nbsp;Pemenuhan keterisian data perlu diinput sesuai periode data&nbsp;</li><li>Interval waktu periode data perlu dikaji ulang <br></li><li>Jumlah variabel perlu dikaji ulang dan ditingkatkan&nbsp; <br></li></ul><p>Tahap II :</p><ul><li>Perlu meningkatkan koordinasi antar unit dan evaluasi berkala untuk memastikan rencana yang lebih terintegrasi dan responsif terhadap perubahan kebutuhan.</li><li>Perlu sistem pemantauan untuk memastikan konsistensi dan ketepatan waktu pengumpulan data.</li><li>Perlu dilakukan audit atau pengecekan ulang secara rutin terhadap data yang telah diproses untuk menjaga akurasi hasil.</li><li>Manfaatkan lebih banyak platform digital dan sosial media untuk memperluas jangkauan audiens terhadap media yang digunakan serta pastikan informasi menjangkau audiens yang lebih luas dan relevan.<br><br></li></ul><p><br></p>', '0000-00-00 00:00:00', 0),
	('20240038_C020240404', 38, 3, 1, 1, '2024', 'C020240404', '77,15', 1.543, 77.15, 10, 0.02, NULL, 1, '2024-10-13 00:11:50', 10, 0, '', '<div><span style="font-size: 13.3333px;">Hasil Monev Tahun 2023&nbsp;</span><span style="font-size: 13.3333px; font-weight: initial;">belum maksimal</span></div><div><span style="font-size: 13.3333px;">Laman Web PPID belum sesuai dengan PerKI 1/2021</span></div>', '<div><span style="font-size: 13.3333px;">Monev Ki Jatim selanjutnya agar mengirimkan SAQ sesuai dengan instrumen yang ditetapkan</span></div><div><span style="font-size: 13.3333px; font-weight: initial;">Laman Web PPID agar disesuaikan dengan PerKI 1/2021</span><br></div><div><br></div>', '0000-00-00 00:00:00', 0),
	('20240038_C020240501', 38, 3, 1, 1, '2024', 'C020240501', '80', 4, 80, 26, 0.05, NULL, 1, '2024-10-30 23:58:39', 3, 0, '', '<span style="font-family: Arial; font-size: 13.3333px; white-space-collapse: preserve;">Unit kerja dibawahnya berpredikat WBK</span>', '<span style="font-size: 13.3333px;">Pembangunan Zona Integritas telah berjalan dengan baik, telah memperoleh predikat Wilayah Bebas dari Korupsi (WBK) dan sedang menuju Wilayah Birokrasi Bersih dan Melayani (WBBM). Agar membangun kedekatan dengan pengguna layanan dengan menyampaikan berbagai upaya perbaikan yang telah dilakukan dalam meningkatkan kualitas layanan dan integritas organisasi, serta meningkatkan kerja sama dengan stakeholders untuk pencapaian kinerja yang lebih baik serta mendorong unit kerja terus berinovasi yang berfokus pada layanan utama, terutama layanan yang terkait langsung dengan masyarakat.</span>', '0000-00-00 00:00:00', 0),
