	('20240039_C020240303', 39, 3, 1, 1, '2024', 'C020240303', '72,02', 2.1606, 72.02, 15, 0.03, NULL, 1, '2024-10-31 02:26:13', 8, 0, '', '<ol><li><p class="MsoNormal" style="text-align:justify"><span lang="EN-ID" style="font-size:12.0pt;line-height:107%;font-family:&quot;Arial&quot;,sans-serif;\nmso-ansi-language:EN-ID">Inspektorat Provinsi Jawa Timur dalam melakukan\npenyajian arsip aktif dan inaktif bagi kepentingan internal dan eksternal Belum\nberdasarkan system klasifikasi keamanan dan akses arsip dinamis<o:p></o:p></span></p></li><li><p class="MsoNormal" style="text-align:justify"><span lang="EN-ID" style="font-size:12.0pt;line-height:107%;font-family:&quot;Arial&quot;,sans-serif;\nmso-ansi-language:EN-ID"><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;">Inspektorat Provinsi Jawa Timur Sudah melakukan kegiatan pemberkasan\narsip aktif dan penataan arsip inaktif di records centre Namun </span><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;">Penataan Arsip Inaktif\npada Bagian Umum </span><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;">Inspektorat</span><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;"> Provinsi Jawa Timur </span><b><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;">BELUM</span></b><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;"> dilakukan berdasarkan\nasas asal usul </span><span style="font-size: 12pt; line-height: 107%;">(menjaga arsip tetap terkelola dalam satu kesatuan pencipta\narsip/provenance tidak dicampur dengan arsip yang berasal dari pencipta arsip\nlain sehingga arsip dapat melekat pada konteks penciptaannya), dan asas aturan\nasli (menjaga arsip tetap ditata sesuai dengan pengaturan aslinya/original\norder atau sesuai dengan pengaturan ketika arsip masih digunakan untuk\npelaksanaan kegiatan pencipta arsip).</span></span></p></li><li><p class="MsoNormal" style="text-align:justify"><span lang="EN-ID" style="font-size:12.0pt;line-height:107%;font-family:&quot;Arial&quot;,sans-serif;\nmso-ansi-language:EN-ID"><span style="font-size: 12pt; line-height: 107%;"><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;">Inspektorat Provinsi Jawa Timur Sudah melakukan kegiatan Penyusutan\narsip</span></span></span></p></li><li><p class="MsoNormal" style="text-align:justify"><span lang="EN-ID" style="font-size:12.0pt;line-height:107%;font-family:&quot;Arial&quot;,sans-serif;\nmso-ansi-language:EN-ID"><span style="font-size: 12pt; line-height: 107%;"><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;">&nbsp;</span></span></span><span style="font-family: Arial, sans-serif; font-size: 12pt; font-weight: initial; text-align: left;">Inspektorat Provinsi Jawa Timur Belum memiliki tenaga fungsional\narsiparis Namun Sudah memiliki petugas pengelola arsip di setiap unit kerja</span></p></li></ol>', '<ol><li><p class="MsoNormal" style="text-align:justify"><span lang="EN-ID" style="font-size:12.0pt;line-height:107%;font-family:&quot;Arial&quot;,sans-serif;\nmso-ansi-language:EN-ID">Inspektorat Provinsi Jawa Timur dalam melakukan\npenyajian arsip aktif dan inaktif bagi kepentingan internal dan eksternal Agar\nberdasarkan system klasifikasi keamanan dan akses arsip dinamis<o:p></o:p></span></p></li><li><p class="MsoNormal" style="text-align:justify"><span lang="EN-ID" style="font-size:12.0pt;line-height:107%;font-family:&quot;Arial&quot;,sans-serif;\nmso-ansi-language:EN-ID"><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;">Inspektorat Provinsi Jawa Timur Agar melakukan penataan arsip Inaktif </span><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;">berdasarkan asas asal\nusul </span><span style="font-size: 12pt; line-height: 107%;">(menjaga arsip tetap\nterkelola dalam satu kesatuan pencipta arsip/provenance tidak dicampur dengan\narsip yang berasal dari pencipta arsip lain sehingga arsip dapat melekat pada\nkonteks penciptaannya), dan asas aturan asli (menjaga arsip tetap ditata sesuai\ndengan pengaturan aslinya/original order atau sesuai dengan pengaturan ketika\narsip masih digunakan untuk pelaksanaan kegiatan pencipta arsip).</span></span></p></li><li><p class="MsoNormal" style="text-align:justify"><span lang="EN-ID" style="font-size:12.0pt;line-height:107%;font-family:&quot;Arial&quot;,sans-serif;\nmso-ansi-language:EN-ID"><span style="font-size: 12pt; line-height: 107%;"><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;">Inspektorat Provins Jawa Timur Agar Melakukan Kegiatan Penyusutan Arsip\nmelalui kegiatan Pemusnahan dan Penyerahan Arsip Statis Ke Lembaga Kearsipan\nProvinsi.</span></span></span></p></li><li><p class="MsoNormal" style="text-align:justify"><span lang="EN-ID" style="font-size:12.0pt;line-height:107%;font-family:&quot;Arial&quot;,sans-serif;\nmso-ansi-language:EN-ID"><span style="font-size: 12pt; line-height: 107%;"><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;"><span lang="EN-ID" style="font-size: 12pt; line-height: 107%;">Dalam rangka mewujudkan tertib penyelenggaraan kearsipan di Lingkungan\nInspektorat Prov. Jatim Agar Inspektorat Provinsi Jawa Timur Belum memiliki\ntenaga fungsional arsiparis.</span></span></span></span></p></li></ol>', '0000-00-00 00:00:00', 0),
