	('20240039_C020240404', 39, 3, 1, 1, '2024', 'C020240404', '72,36', 1.4472, 72.36, 10, 0.02, NULL, 1, '2024-10-13 00:13:32', 10, 0, '', '<div><span style="font-size: 13.3333px;">Tidak mengikuti Monev Tahun 2023</span></div><div><span style="font-size: 13.3333px;">Hasil Karya Laman Web dan Media Sosial belum maksimal</span></div><div><br></div>', '<div><span style="font-size: 13.3333px;">Monev Ki Jatim selanjutnya agar mengirimkan SAQ sesuai dengan instrumen yang ditetapkan</span></div><div><span style="font-size: 13.3333px;">Agar hasil karya laman web dan media sosial yang dikirim ke JPRA selanjutnya lebih baik lagi&nbsp;</span></div>', '0000-00-00 00:00:00', 0),
