	('20240044_C020240501', 44, 3, 1, 1, '2024', 'C020240501', '80', 4, 80, 26, 0.05, NULL, 1, '2024-10-30 23:59:01', 3, 0, '', '<span style="font-family: Arial; font-size: 13.3333px; white-space-collapse: preserve;">Unit kerja telah berpredikat WBK</span>', '<span style="font-size: 13.3333px;">Pembangunan Zona Integritas telah berjalan dengan baik, telah memperoleh predikat Wilayah Bebas dari Korupsi (WBK) dan sedang menuju Wilayah Birokrasi Bersih dan Melayani (WBBM). Agar membangun kedekatan dengan pengguna layanan dengan menyampaikan berbagai upaya perbaikan yang telah dilakukan dalam meningkatkan kualitas layanan dan integritas organisasi, serta meningkatkan kerja sama dengan stakeholders untuk pencapaian kinerja yang lebih baik serta mendorong unit kerja terus berinovasi yang berfokus pada layanan utama, terutama layanan yang terkait langsung dengan masyarakat.</span>', '0000-00-00 00:00:00', 0),
