	('20240046_C020240403', 46, 3, 1, 1, '2024', 'C020240403', '27.32', 0.5464, 27.32, 10, 0.02, NULL, 1, '2024-11-20 02:29:37', 10, 0, '', '<div>Tahap I:</div><div>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<ul><li>Dataset yang diampu masih kurang </li><li>Pemenuhan data tahun\n2020-2022 kurang<span style="mso-spacerun:yes"> <br></span></li><li><span style="mso-spacerun:yes"></span>Pemenuhan keterisian\ndata masih belum optimal</li><li>Interval waktu\nperiode data masih panjang</li><li>Jumlah variabel masih\nbelum merepresentasikan informasi yang disampaikan</li></ul><p>Tahap II:</p><p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n</p><ul><li>Perlu meningkatkan koordinasi antar unit dan evaluasi\nberkala untuk memastikan rencana yang lebih terintegrasi dan responsif terhadap\nperubahan kebutuhan.</li></ul>\n\n<ul><li>Perlu sistem pemantauan untuk memastikan konsistensi dan\nketepatan waktu pengumpulan data.</li></ul>\n\n<ul><li>Perlu dilakukan audit atau pengecekan ulang secara rutin\nterhadap data yang telah diproses untuk menjaga akurasi hasil.</li></ul>\n\n<ul><li>Manfaatkan lebih banyak platform digital dan sosial media\nuntuk memperluas jangkauan audiens terhadap media yang digunakan serta pastikan\ninformasi menjangkau audiens yang lebih luas dan relevan.</li></ul><p></p>\n\n\n\n\n\n<style>@font-face\n	{font-family:"Cambria Math";\n	panose-1:2 4 5 3 5 4 6 3 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:roman;\n	mso-font-pitch:variable;\n	mso-font-signature:-536870145 1107305727 0 0 415 0;}@font-face\n	{font-family:Calibri;\n	panose-1:2 15 5 2 2 2 4 3 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:swiss;\n	mso-font-pitch:variable;\n	mso-font-signature:-536858881 -1073732485 9 0 511 0;}p.MsoNormal, li.MsoNormal, div.MsoNormal\n	{mso-style-unhide:no;\n	mso-style-qformat:yes;\n	mso-style-parent:"";\n	margin:0cm;\n	mso-pagination:widow-orphan;\n	font-size:12.0pt;\n	font-family:"Calibri",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:Calibri;\n	mso-fareast-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:"Times New Roman";\n	mso-bidi-theme-font:minor-bidi;\n	mso-font-kerning:1.0pt;\n	mso-ligatures:standardcontextual;}.MsoChpDefault\n	{mso-style-type:export-only;\n	mso-default-props:yes;\n	font-family:"Calibri",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:Calibri;\n	mso-fareast-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:"Times New Roman";\n	mso-bidi-theme-font:minor-bidi;}div.WordSection1\n	{page:WordSection1;}</style></div>', '<div>Tahap I:</div><div>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<ul><li>Perlu penambahan jumlah dataset</li><li>Agar dilakukan\npemenuhan data tahun 2020-2022</li><li>Pemenuhan keterisian\ndata perlu diinput sesuai periode data</li><li>Interval waktu\nperiode data perlu dikaji ulang</li><li>Jumlah variabel perlu\ndikaji ulang dan ditingkatkan<span style="mso-spacerun:yes"> <br></span></li></ul><p><span style="mso-spacerun:yes">Tahap II:</span></p><p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n</p><p class="MsoNormal"><span style="mso-spacerun:yes"> </span></p>\n\n<ul><li>Perlu meningkatkan koordinasi antar unit dan evaluasi\nberkala untuk memastikan rencana yang lebih terintegrasi dan responsif terhadap\nperubahan kebutuhan.</li><li>Perlu sistem pemantauan untuk memastikan konsistensi dan\nketepatan waktu pengumpulan data.</li><li>Perlu dilakukan audit atau pengecekan ulang secara rutin\nterhadap data yang telah diproses untuk menjaga akurasi hasil.</li><li>Manfaatkan lebih banyak platform digital dan sosial media\nuntuk memperluas jangkauan audiens terhadap media yang digunakan serta pastikan\ninformasi menjangkau audiens yang lebih luas dan relevan. </li></ul>\n\n\n\n\n\n<p><style>@font-face\n	{font-family:"Cambria Math";\n	panose-1:2 4 5 3 5 4 6 3 2 4;\n