	('20240047_C020240402', 47, 3, 1, 1, '2024', 'C020240402', '96,88', 1.9376, 96.88, 10, 0.02, NULL, 1, '2024-07-15 00:21:32', 11, 0, '', 'Sedikit lagi. Tingkatkan skor.', '<span style="font-size: 13.333333px;">Jangan lupa unggah SPT Tahunan di aplikasi Si-Master sebelum tanggal 1 April.</span>', '0000-00-00 00:00:00', 0),
	('20240047_C020240403', 47, 3, 1, 1, '2024', 'C020240403', '36.45', 0.729, 36.45, 10, 0.02, NULL, 1, '2024-11-20 02:58:58', 10, 0, '', 'Tahap I :<ul><li><span style="font-size: 13.3333px;">Dataset yang diampu masih kurang</span></li><li><span style="font-size: 13.3333px;">Definisi operasional masih belum menjelaskan judul data</span></li><li><span style="font-size: 13.3333px;">Pemenuhan data tahun 2020-2022 kurang&nbsp;</span></li><li><span style="font-size: 13.3333px;">Pemenuhan keterisian data masih belum optimal</span></li><li><span style="font-size: 13.3333px;">Interval waktu periode data masih panjang</span></li></ul><div>Tahap II :</div><div><ul><li><span lang="EN-US">Perencanaan data sudah dilakukan dengan\nbaik, namun perlu peningkatan koordinasi antar unit agar perencanaan lebih\nterintegrasi dan responsif terhadap perubahan kebutuhan.</span></li><li>Terdapat beberapa inkonsistensi dalam\npelaksanaan yang perlu diatasi melalui pelatihan dan pemantauan lebih intensif.</li><li>Peningkatan integrasi sistem perlu\ndilakukan untuk menghindari kesalahan dan mempercepat proses.</li><li>Perlu ada upaya untuk memperluas jangkauan\naudiens, khususnya di platform digital, dan evaluasi lebih lanjut terhadap\nefektivitas distribusinya.</li></ul></div>', 'Tahap I :<ul><li><span style="font-size: 13.3333px;">Perlu penambahan jumlah dataset</span></li><li><span style="font-size: 13.3333px;">Definisi operasional/ metadata perlu dilengkapi pada kamus data di dalam portal sata</span></li><li><span style="font-size: 13.3333px;">Agar dilakukan pemenuhan data tahun 2020-2022</span></li><li><span style="font-size: 13.3333px;">Pemenuhan keterisian data perlu diinput sesuai periode data</span></li><li><span style="font-size: 13.3333px;">Interval waktu periode data perlu dikaji ulang</span></li></ul><div>Tahap II :</div><div><ul><li><span lang="EN-US">Perlu meningkatkan koordinasi antar unit\ndan evaluasi berkala untuk memastikan rencana yang lebih terintegrasi dan\nresponsif terhadap perubahan kebutuhan.</span></li><li>Perlu sistem pemantauan untuk memastikan\nkonsistensi dan ketepatan waktu pengumpulan data.</li><li>Perlu dilakukan audit atau pengecekan ulang\nsecara rutin terhadap data yang telah diproses untuk menjaga akurasi hasil.</li><li>Manfaatkan lebih banyak platform digital\ndan sosial media untuk memperluas jangkauan audiens terhadap media yang\ndigunakan serta pastikan informasi menjangkau audiens yang lebih luas dan\nrelevan.</li></ul></div>', '0000-00-00 00:00:00', 0),
	('20240047_C020240404', 47, 3, 1, 1, '2024', 'C020240404', '65,25', 1.305, 65.25, 10, 0.02, NULL, 1, '2024-10-12 23:34:08', 10, 0, '', '<div><span style="font-size: 13.3333px;">Hasil Monev Tahun 2023 dan&nbsp;</span><span style="font-size: 13.3333px; font-weight: initial;">Hasil Karya Laman Web dan Media Sosial kurang maksimal</span></div><div><span style="font-size: 13.3333px;">Laman Web PPID kurang sesuai dengan PerKI 1/2021</span></div>', '<div><span style="font-size: 13.3333px;">Monev Ki Jatim selanjutnya agar mengirimkan SAQ sesuai dengan instrumen yang ditetapkan</span></div><div><span style="font-size: 13.3333px;">Agar hasil karya laman web dan media sosial yang dikirim ke JPRA selanjutnya lebih baik lagi&nbsp;</span></div><div><span style="font-size: 13.3333px;">Laman Web PPID agar disesuaikan dengan PerKI 1/2021</span></div>', '0000-00-00 00:00:00', 0),
