	('20240050_C020240403', 50, 3, 1, 1, '2024', 'C020240403', '53.90', 1.078, 53.9, 10, 0.02, NULL, 1, '2024-11-20 02:43:11', 10, 0, '', 'Tahap I :<ul><li><span style="font-size: 13.3333px;">Pemenuhan keterisian data masih belum optimal</span></li><li><span style="font-size: 13.3333px;">Interval waktu periode data masih panjang</span></li><li><span style="font-size: 13.3333px;">Jumlah variabel masih belum merepresentasikan informasi yang disampaikan</span></li></ul><div>Tahap II :</div><div><ul><li><span lang="EN-US">Perencanaan data sudah dilakukan dengan\nbaik, namun perlu peningkatan koordinasi antar unit agar perencanaan lebih\nterintegrasi dan responsif terhadap perubahan kebutuhan.</span></li><li>Terdapat beberapa inkonsistensi dalam\npelaksanaan yang perlu diatasi melalui pelatihan dan pemantauan lebih intensif.</li><li>Peningkatan integrasi sistem perlu\ndilakukan untuk menghindari kesalahan dan mempercepat proses.</li><li>Perlu ada upaya untuk memperluas jangkauan\naudiens, khususnya di platform digital, dan evaluasi lebih lanjut terhadap\nefektivitas distribusinya.</li></ul></div>', 'Tahap I :<ul><li><span style="font-size: 13.3333px;">Pemenuhan keterisian data perlu diinput sesuai periode data</span></li><li><span style="font-size: 13.3333px;">Interval waktu periode data perlu dikaji ulang</span></li><li><span style="font-size: 13.3333px;">Jumlah variabel perlu dikaji ulang dan ditingkatkan&nbsp;</span></li></ul><div>Tahap II :</div><div><ul><li><span lang="EN-US">Perlu meningkatkan koordinasi antar unit\ndan evaluasi berkala untuk memastikan rencana yang lebih terintegrasi dan\nresponsif terhadap perubahan kebutuhan.</span></li><li>Perlu sistem pemantauan untuk memastikan\nkonsistensi dan ketepatan waktu pengumpulan data.</li><li>Perlu dilakukan audit atau pengecekan ulang\nsecara rutin terhadap data yang telah diproses untuk menjaga akurasi hasil.</li><li>Manfaatkan lebih banyak platform digital\ndan sosial media untuk memperluas jangkauan audiens terhadap media yang\ndigunakan serta pastikan informasi menjangkau audiens yang lebih luas dan\nrelevan.</li></ul></div>', '0000-00-00 00:00:00', 0),
	('20240050_C020240404', 50, 3, 1, 1, '2024', 'C020240404', '43,25', 0.865, 43.25, 10, 0.02, NULL, 1, '2024-10-12 23:30:32', 10, 0, '', '<div><span style="font-size: 13.3333px;">Tidak mengikuti Monev Tahun 2023</span></div><div><span style="font-size: 13.3333px;">Hasil Karya Laman Web dan Media Sosial kurang maksimal</span></div><div><span style="font-size: 13.3333px;">Laman Web PPID kurang sesuai dengan PerKI 1/2021</span></div>', '<div><span style="font-size: 13.3333px;">Monev Ki Jatim selanjutnya agar mengirimkan SAQ sesuai dengan instrumen yang ditetapkan</span></div><div><span style="font-size: 13.3333px;">Agar hasil karya laman web dan media sosial yang dikirim ke JPRA selanjutnya lebih baik lagi&nbsp;</span></div><div><span style="font-size: 13.3333px;">Laman Web PPID agar disesuaikan dengan PerKI 1/2021</span></div>', '0000-00-00 00:00:00', 0),
