	('20240055_C020240605', 55, 3, 1, 1, '2024', 'C020240605', '3', 1.5, 60, 10, 0.025, NULL, 1, '2024-10-05 14:12:59', 10, 0, '', '<div>- Jumlah aduan yang masuk pada kanal SP4N-LAPOR! masih belum optimal</div><div>- Pemberian penilaian rating bintang masih minim<br></div>- Publikasi dan sosialisasi kanal pengaduan SP4N-LAPOR! belum optimal', '<div>- Disarankan untuk dapat menginputkan aduan yang masuk ke kanal \nselain LAPOR!,&nbsp; ke dalam aplikasi LAPOR! dengan memanfaatkan fitur \nmanual pada LAPOR!</div><div>- Disarankan untuk dapat mereminder pelapor, untuk dapat memberikan penilaian rating bintang</div>- Melakukan publikasi dan sosialisasi kanal pengaduan SP4N-LAPOR!', '0000-00-00 00:00:00', 0),
