	('20240057_K020240802', 57, 3, 1, 1, '2024', 'K020240802', '100', 5, 100, 20, 0.05, NULL, 1, '2024-08-21 22:39:15', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">sangat baik dengan capaian 118,85%</span>', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Agar segera ditetapkan Perkada tentang SOTK pasca penyederhanaan struktur organisasi agar\ndapat ditindaklanjuti ke tahap penyetaraan jabatan dan penyesuaian sistem kerja.</span>', '0000-00-00 00:00:00', 0),
	('20240057_K020240803', 57, 3, 1, 1, '2024', 'K020240803', '3,34', 3.34, 66.8, 20, 0.05, NULL, 1, '2024-10-28 23:05:05', 10, 0, '', '<span style="font-size: 13.3333px;">Kolaborasi SPBE sangat penting untuk pertukaran informasi dan peningkatan kapasitas pengelola SPBE</span>', '<span style="font-size: 13.3333px;">Agar melakukan reviu dan evaluasi secara berkelanjutan pada semua domain</span>', '0000-00-00 00:00:00', 0),
	('20240057_K020240804', 57, 3, 1, 1, '2024', 'K020240804', '267', 3.256, 65.12, 20, 0.05, NULL, 1, '2024-08-01 02:00:47', 1, 0, '', '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">1) Menyusun dan menetapkan Standar\nKompetensi Jabatan berdasarkan kondisi\nsusunan organisasi dan tata kerja terbaru untuk\nseluruh jabatan; 2) Menyusun profl pegawai\nberdasarkan pemetaan kompetensi untuk\nkeseluruhan pegawai; 3) Menyempurnakan dan menyusun talent pool untuk tiap level jabatan\nsesuai dengan Permenpan RB No 3 Tahun 2020;\n4) Menyusun program pengembangan\nkompetensi pegawai berdasarkan analisis\nkesenjangan kompetensi dan kinerja untuk\njangka panjang (5 tahun); 5) Melaksanakan\npengisian Jabatan Administrator dan Jabatan\nPengawas dengan mempertimbangkan hasil\nassessment; 6) Melakukan analisis\npermasalahan kinerja terhadap pegawai yang\nmemiliki kinerja rendah tiap individu secara\nmendalam dan menyusun strategi untuk\nmengatasinya.</span>', '0000-00-00 00:00:00', 0),
	('20240057_K020240901', 57, 3, 1, 1, '2024', 'K020240901', '67,69', 1.3538, 67.69, 15, 0.02, NULL, 1, '2024-11-11 00:25:41', 8, 0, '', '', '<div>Kinerja yang perlu ditingkatkan adalah :</div><div>1. Revisi dan Draft kebijakan kearsipan agar segera ditetapkan menjadi</div><div>Peraturan, sehingga dapat segera dilakukan sosialisasi;</div><div>2.&nbsp;<span style="font-weight: initial;">Intensitas pembinaan terutama dalam rangka pengelolaan arsip terjaga&nbsp;&nbsp;</span><span style="font-weight: initial;">dan arsip aset;</span></div><div>3. Segera menyusun guide arsip statis dan inventaris arsip statis;</div><div>4. Meningkatkanan dukungan anggaran urusan kearsipan.;</div><div>5. Peningkatan Sumber Daya Kearsipan, sarana dan prasarana;</div><div>6. Melaksanakan pembinaan pengelolaan arsip desa.</div>', '0000-00-00 00:00:00', 0),
	('20240057_K020240902', 57, 3, 1, 1, '2024', 'K020240902', '66.17', 2.6468, 66.17, 15, 0.04, NULL, 1, '2024-10-21 20:43:09', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Pelaksanaan Reformasi Hukum cukup baik</span>', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Pelaksanaan Reformasi Hukum ditingkatkan</span>', '0000-00-00 00:00:00', 0),
