	('20240057_K020241002', 57, 3, 1, 1, '2024', 'K020241002', '77,06', 1.9265, 77.06, 12, 0.025, NULL, 1, '2024-10-12 18:06:36', 10, 0, '', '<div><div><span style="font-size: 13.3333px;">Hasil Karya Laman Web dan Media Sosial kurang maksimal</span></div></div><div><br></div><div><br></div>', '<span style="font-size: 13.3333px;">Agar hasil karya laman web dan media sosial yang dikirim ke JPRA selanjutnya lebih baik lagi&nbsp;</span>', '0000-00-00 00:00:00', 0),
