	('20240057_K020241102', 57, 3, 1, 1, '2024', 'K020241102', '67,75', 5.75875, 67.75, 28, 0.085, NULL, 1, '2024-10-15 03:44:27', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve;">1. Cascading kinerja belum mengacu pada PermenPANRB no. 89 tahun 2021;\n2. Keterkaitan hasil pengukuran capaian kinerja organisasi belum dikaitkan dengan penilaian atas hasil kinerja individu;\n3. Laporan kinerja pada sebagian PD belum menyampaikan informasi analisa yang memadai;\n4. Belum optimalnya upaya pemantauan dan reviu oleh Inepktorat atas TLHE intelnal yang dilakukan kepada seluruh PD yang dievaluasi</span>', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve;">1. Melakukan reviu kembali atas pohon kinerja yang sudah disusun;\n2. Mendorong pemanfaatan hasil pengukuran kinerja organisasi sebagai dasar dalam menilai kinerja individu;\n3. Memastikan laporan kinerja PD pada periode selanjutnya menyajikan informasi terkait analisis faktor pendukung dan penghambat tercapainya kinerja serta upaya/strategi yang digunakan ditahun berikutnya untuk meningkatkan kinerja;\n4. Mendoorng pelaksanaan pemantauan secara berkala rekomendasi yang diberikan kepada PD melalui LHE AKIP internal</span>', '0000-00-00 00:00:00', 0),
