	('20240058_K020241002', 58, 3, 1, 1, '2024', 'K020241002', '85,9', 2.1475, 85.9, 12, 0.025, NULL, 1, '2024-10-12 18:07:34', 10, 0, '', '<div><span style="font-size: 13.3333px;">Monev Ki Jatim (10%) : 4.87</span></div>', '<div><span style="font-size: 13.3333px;">1. Monev Ki Jatim selanjutnya agar mengirimkan SAQ sesuai dengan instrumen yang ditetapkan</span></div><div><span style="font-size: 13.3333px;"><br></span></div><div><span style="font-size: 13.3333px;">2. Agar hasil karya laman web dan media sosial yang dikirim ke JPRA selanjutnya lebih baik lagi</span></div>', '0000-00-00 00:00:00', 0),
	('20240058_K020241003', 58, 3, 1, 1, '2024', 'K020241003', '56,55', 3.9585, 56.55, 12, 0.07, NULL, 1, '2024-07-17 21:18:02', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Cukup</span>', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Perlu ada upaya untuk mendorong pemanfaatan sistem pengadaan mulai dari perencanaan hingga realisasi pengadaan (transaksional dan pencatatan) dan keterisian Formasi Jabatan\nFungsional Pengelola Pengadaan Barang/Jasa.</span>', '0000-00-00 00:00:00', 0),
