	('20240058_K020241102', 58, 3, 1, 1, '2024', 'K020241102', '70,20', 5.967, 70.2, 28, 0.085, NULL, 1, '2024-10-15 03:06:38', 1, 0, '', '<span data-sheets-root="1" style="font-size: 11pt; font-family: Calibri, Arial;">1. Masih terdapat narasi kinerja baik level Pemda/ PD yang belum spesifik menjelaskan kinerja yang ingin dicapai ;<br>2. Belum sepenuhnya sesuai dengan indikator kinerja utama yang disertai dengan definisi operasional ;<br>3. masih ditemukan infromasi kinerja yang telah dituangkan dalam laporan kinerja khususnya pada PD belum dimanfaatkan dengan baik ;<br>4. Hasil evaluasi akuntabilitas kinerja internal yang dilakukan oleh inspektorat belum memacu perbaikan akuntabilitas kinerja secara signifikan .</span><br>', '<span data-sheets-root="1" style="font-size: 11pt; font-family: Calibri, Arial;">1. Melakukan review dan perbaikan narasi kinerja pada dokumen perencanaan level Pemda maupun PD ;<br>2. Menyempurnakan dokumen IKU dengan definisi operasional oleh setiap PD ;<br>3.Mengoptimalkan pemanfaatan kinerja dengan cara memastikan penetapan target kinerja tahuh berikutnya dengan lebih baik nilainya dibandingkan dengan realisasi target kinerja tahun sebelumnya ;<br>4. Meningkatkan kapasitas evaluator dalam melaksanakan evaluasi akuntabilitas kinerja internal.</span><br>', '0000-00-00 00:00:00', 0),
