	('20240059_K020240802', 59, 3, 1, 1, '2024', 'K020240802', '100', 5, 100, 20, 0.05, NULL, 1, '2024-08-21 22:47:22', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">sangat baik</span>', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Agar segera ditetapkan Perkada tentang SOTK pasca penyederhanaan struktur organisasi agar\ndapat ditindaklanjuti ke tahap penyetaraan jabatan dan penyesuaian sistem kerja.</span>', '0000-00-00 00:00:00', 0),
	('20240059_K020240803', 59, 3, 1, 1, '2024', 'K020240803', '4,21', 4.21, 84.2, 20, 0.05, NULL, 1, '2024-10-28 23:05:40', 10, 0, '', '<span style="font-size: 13.3333px;">Kolaborasi SPBE sangat penting untuk pertukaran informasi dan peningkatan kapasitas pengelola SPBE</span>', '<span style="font-size: 13.3333px;">Agar melakukan reviu dan evaluasi secara berkelanjutan pada semua domain</span>', '0000-00-00 00:00:00', 0),
	('20240059_K020240804', 59, 3, 1, 1, '2024', 'K020240804', '283', 3.451, 69.02, 20, 0.05, NULL, 1, '2024-08-01 02:02:15', 1, 0, '', '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">1) Menyusun dan menetapkan Standar Kompetensi\nJabatan berdasarkan kondisi susunan organisasi\ndan tata kerja terbaru untuk seluruh jabatan; 2)\nMenyusun profl pegawai berdasarkan pemetaan\nkompetensi untuk keseluruhan pegawai; 3)\nMenyusun talent pool untuk tiap level jabatan\nsesuai dengan Permenpan RB No 3 Tahun 2020; 4)\nMenyusun program pengembangan kompetensi\npegawai berdasarkan analisis kesenjangan\nkompetensi dan kinerja untuk jangka panjang (5\ntahun); 5) Melaksanakan pengisian Jabatan\nAdministrator dan Jabatan Pengawas dengan\nmempertimbangkan hasil assessment; 6)\nMelakukan analisis permasalahan kinerja terhadap\npegawai yang memiliki kinerja rendah tiap individu\nsecara mendalam dan menyusun strategi untuk\nmengatasinya.</span>', '0000-00-00 00:00:00', 0),
	('20240059_K020240901', 59, 3, 1, 1, '2024', 'K020240901', '74,86', 1.4972, 74.86, 15, 0.02, NULL, 1, '2024-11-11 00:25:29', 8, 0, '', '', '<div>1. Agar dapat melengkapi kebijakan-kebijakan arsip yang belum tersedia di</div><div>lingkungan Pemerintah Kabupaten Trenggalek;</div><div>2. Melaksanakan pembinaan pengelolaan arsip desa:</div><div>3. Intensitas pembinaan terutama dalam rangka pengelolaan arsip terjaga</div><div>dan arsip aset;</div><div>4. Segera menyusun guide arsip statis dan inventaris arsip statis;</div><div>5. Pengelolaan arsip sesuai kaidah kearsipan:</div><div>6. Meningkatkanan dukungan anggaran urusan kearsipan;</div><div>7 Peningkatan Sumber Daya Kearsipan, sarana dan prasarana;</div>', '0000-00-00 00:00:00', 0),
	('20240059_K020240902', 59, 3, 1, 1, '2024', 'K020240902', '66.21', 2.6484, 66.21, 15, 0.04, NULL, 1, '2024-10-21 20:43:59', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Pelaksanaan Reformasi Hukum cukup baik</span>', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Pelaksanaan Reformasi Hukum ditingkatkan</span>', '0000-00-00 00:00:00', 0),
	('20240059_K020240903', 59, 3, 1, 1, '2024', 'K020240903', '10.00', 0.45, 10, 15, 0.045, NULL, 1, '2024-10-21 20:52:44', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">1. Self assessment penilaian kebijakan belum seluruhnya tuntas 100%. Hal ini disebabkan masih adanya pertanyaan yang tidak dijawab dan tidak engunggah data dukung,</span><div><span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">2. Kondisi jawaban yang dipilih dalam sebagian kebijakan masih kurang didukung dengan data yang relevan sesuai dengan pedoman pengukuran IKK,</span></div><div><span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">3. Representasipelibatan stakeholder dari kelompok di luar pemerintahan, khususnya masyarakat sasaran kebijakan dan kelompok rentan perlu ditingkatkan dan </span></div><div><span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">4. Kebijakan belum seluruhnya dilakukan evaluasi dampak dan kemanfaatan kebijakan atau evaluasi bertahap sebagai tindak lanjutpelaksanaan pemantauan kebijakan.</span></div>', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">1. dalam aspek substansi kebijakan perlu terus ditingkatkan adanya proses kajian dan analisis kebijakan dengan didukung oleh data, informasi dan pengetahuan yang faktual yang relevan dengan kondisi di lapangan.</span><div><span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">2. pelibatan stakeholder dalam proses kebijakan publik perlu dilakukan secara lebih representatif termasuk dengan kelompok stakeholder di luar instansi dan\nkelompok rentan di lapangan.</span></div><div><span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">3. melakukan proses dokumentasi pengelolaan kebijakan yang telah dilakukan dari proses pengelolaan wacana publik, perumusan kebijakan, pelaksanaan kebijakan, dan evaluasi dampak kebijakan. Dokumentasi dilakukan oleh masing-masing unit organisasi/satuan kerja yang menjadi leading sector kebijakannya.</span></div><div><span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">4. peningkatan dukungan sumber daya manusia yang kompeten untuk melaksanakan kegiatan kajian dan analisis kebijakan dalam seluruh proses kebijakan yang dilakukan. Sumber daya manusia yang kompeten dapat berasal dari internal ataupun dari eksternal instansi pemerintah. Salah satu sumber daya internal yang potensial misalnya optimalisasi peran Analis Kebijakan yang telah dilantik di instansi. </span></div><div><span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">5. Secara teknis, perlu memastikan penyelesaian penilaian mandiri seluruh sampel pengukuran IKK dan melengkapi seluruh bukti dukung yang relevan sesuai pedoman pengukuran IKK.</span></div>', '0000-00-00 00:00:00', 0),
	('20240059_K020240904', 59, 3, 1, 1, '2024', 'K020240904', '2', 1.8, 40, 15, 0.045, NULL, 1, '2024-07-29 01:52:47', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Segera ditetapkan menjadi peraturan</span>', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Segera ditetapkan menjadi peraturan</span>', '0000-00-00 00:00:00', 0),
	('20240059_K020241001', 59, 3, 1, 1, '2024', 'K020241001', '76,18', 1.9045, 76.18, 12, 0.025, NULL, 1, '2024-11-20 17:06:22', 10, 0, '', '\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p class="MsoNormal">TAHAP I:</p>\n\n<p class="MsoNormal">JUDUL DATA; Dari 47 data terdapat 43 data yang judulnya sudah\nsesuai kesepakatan, 1 data yang judulnya tidak sesuai kesepakatan dan 3 data\nyang belum diinput</p>\n\n<p class="MsoNormal">KESESUAIAN PERIODE; Dari 47 data terdapat 40 data yang\nperiodenya sudah sesuai kesepakatan, 4 data periodenya tidak sesuai kesepakatan\ndan 3 data yang belum diinput</p>\n\n<p class="MsoNormal">KESESUAIAN TABULASI; Dari 47 data terdapat 42 data yang\ntabulasinya sudah sesuai kesepakatan, 2 data tabulasinya tidak sesuai\nkesepakatan dan 3 data yang belum diinput</p>\n\n<p class="MsoNormal">KETERISIAN DATA</p>\n\n<p class="MsoNormal">Dari 74 keterisian data, tahun 2022 diisi sebanyak 23 data\ndan tahun 2023 diisi sebanyak 55 data</p>\n\n\n\n\n\n<style>@font-face\n	{font-family:"Cambria Math";\n	panose-1:2 4 5 3 5 4 6 3 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:roman;\n	mso-font-pitch:variable;\n	mso-font-signature:-536870145 1107305727 0 0 415 0;}@font-face\n	{font-family:Calibri;\n	panose-1:2 15 5 2 2 2 4 3 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:swiss;\n	mso-font-pitch:variable;\n	mso-font-signature:-536858881 -1073732485 9 0 511 0;}p.MsoNormal, li.MsoNormal, div.MsoNormal\n	{mso-style-unhide:no;\n	mso-style-qformat:yes;\n	mso-style-parent:"";\n	margin:0cm;\n	mso-pagination:widow-orphan;\n	font-size:12.0pt;\n	font-family:"Calibri",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:Calibri;\n	mso-fareast-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:"Times New Roman";\n	mso-bidi-theme-font:minor-bidi;\n	mso-font-kerning:1.0pt;\n	mso-ligatures:standardcontextual;}.MsoChpDefault\n	{mso-style-type:export-on