	('20240059_K020241102', 59, 3, 1, 1, '2024', 'K020241102', '73,19', 6.22115, 73.19, 28, 0.085, NULL, 1, '2024-10-15 23:05:13', 1, 0, '', '<span data-sheets-root="1" style="font-size: 11pt; font-family: Calibri, Arial;">1, Masih ditemukan indikator kinerja yang belum relevan dan cukup dalam menjawab kondisi/ sasaran strategis ;<br>2. Hasil monitoring dan evaluasi yang dilakukan belum dimanfaatkan secara optimal dalam penentuan strategis ;<br>3. Informasi dalam laporan kinerja belum sepenuhnya digunakan untuk perbaikan strategis perencanaan kinerja tahun berikutnya ;<br>4. Informasi temuan dan rekomendasi dalam LHE internal belum cukup untuk memperbaiki kualitas implementasi SAKIP pada PD yang dievaluasi .</span><br>', '<span data-sheets-root="1" style="font-size: 11pt; font-family: Calibri, Arial;">1. Meriview kembali atas pohon kienrja yang sudah disusun dengan memperhatikan isu strategos, hubungan sebab akibat, CSF yang berpotensi mendukung kinerjaya ;<br>2. Mendorong pemanfaatan hasil monev yang dilakukan untuk menjadi masukan dalam menentukan strategis ;<br>3. Memanfaatkan informasi yang tertuang dalam LPPD maupun laporan kinerja seluruh PD agar menjadi dasar dalam menetapkan perbaikan strategi perencanaan kinerja baik pada tahun berikutnya:<br>4. Mendorong hasil evaluasi akuntabilitas untuk memberikan langkah perbaikan nyata dan peningkatan capaian kinerja.</span>', '0000-00-00 00:00:00', 0),
