	('20240060_K020240901', 60, 3, 1, 1, '2024', 'K020240901', '84,05', 1.681, 84.05, 15, 0.02, NULL, 1, '2024-11-11 00:25:28', 8, 0, '', '', '<div>1. Revisi dan rancangan jadwal retensi arsip agar segera dilakukan</div><div>pengesahan, sehingga dapat segera dilakukan sosialisasi;</div><div>2. Melaksanakan pembinaan pengelolaan arsip desa.</div><div>3. Intensitas pembinaan terutama dalam rangka pengelolaan arsip terjaga</div><div>dan arsip aset;</div><div>4. Segera menyusun guide arsip statis dan inventaris arsip statis;</div><div>5. Penyusutan arsip yang telah dilaksanakan secara sistemik dan simultan</div><div>6. Meningkatkanan dukungan anggaran urusan kearsipan;</div><div>7 Peningkatan Sumber Daya Kearsipan, sarana dan prasarana;</div>', '0000-00-00 00:00:00', 0),
