	('20240060_K020241102', 60, 3, 1, 1, '2024', 'K020241102', '77,07', 6.55095, 77.07, 28, 0.085, NULL, 1, '2024-10-15 23:33:19', 1, 0, '', '<span data-sheets-root="1" style="font-size: 11pt; font-family: Calibri, Arial;">1, Penetepan target kinerja pada PK belum disesuaikan dengan realisasi capaian tahun sebelumnya;<br>2.Pemberian tunjangan kinerja masih berdasarkan aktivitas bulanan dari masing-masing pegawai;<br>3. informasi kinerja yang dituangkan dalam LPPD/ laporan kinerja PD belum dimanfaatkan dengan baik ;<br>4. Hasil evaluasi internal yang dituangkan dalam bentuk LHE tidak memiliki kualitas yang sama antar penilaian satu PD dengan PD yang lain.</span><br>', '<span data-sheets-root="1" style="font-size: 11pt; font-family: Calibri, Arial;">1. Melakukan penyesuaian target perjanjian kinerja untuk targey yang telah dicapai melebihi target ditahun berikutnya yang tertuang dalam realisasi kinerja laporan kinerja tahun sebelumnya;<br>2. Mendorong pemanfaatan kinerja organisasi sebagai bagian dari penilaian kinerja individu sehingga ketercapaian kinerja individu dan organisasi bisa selaras dan memanfaatkan hal tersebut sebagai dasar dalam pemberian tunjangan kinerja pegawai;<br>3. Memanfaatkan LPPD sebagai dasar pertimbangan dalam menentukan target, strategi, dan aktivitas kedepan ;<br>4.Mendorong adanya monitoring atas tindak lanjut rekomendasi hasil evaluasi AKIP unit kerja dilakukan secara berkala.</span><br>', '0000-00-00 00:00:00', 0),
