	('20240061_K020240804', 61, 3, 1, 1, '2024', 'K020240804', '272', 3.317, 66.34, 20, 0.05, NULL, 1, '2024-08-01 01:56:34', 1, 0, '', '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">1) Memperluas pelaksanaan penilaian\n\nkompetensi untuk seluruh pegawai dan dipetakan\nuntuk menjadi dasar penyusunan talent pool\nsesuai Peraturan Menteri PANRB No. 3 Tahun\n2020 tentang Manajemen Talenta; 2) Menyusun\ndan melaksanakan program peningkatan\nkompetensi secara terjadwal baik klasikal (Diklat\ndan/atau pelatihan) ataupun non-klasikal (Praktik\nKerja, Magang, Coaching, Mentoring) yang\n\ndisesuaikan dengan analisis kesenjangan masing-\nmasing pegawai; 3) Mengimplementasikan\n\nkebijakan internal tentang pola karir dan\npengisian jabatan (JPT, Administrator dan\nPengawas) dengan mengacu pada pada talent\npool yang telah disusun; 4) Menyusun analisis\npermasalahan kinerja pegawai serta strategi\nuntuk mengatasi permasalahan tersebut.</span>', '0000-00-00 00:00:00', 0),
