	('20240061_K020241003', 61, 3, 1, 1, '2024', 'K020241003', '83,34', 5.8338, 83.34, 12, 0.07, NULL, 1, '2024-07-17 20:52:33', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Baik</span>', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Selamat atas prestasi yang diraih. Tingkatkan pencapaian khususnya untuk keterisian Formasi Jabfung Pengelola PBJ.</span>', '0000-00-00 00:00:00', 0),
