	('20240061_K020241102', 61, 3, 1, 1, '2024', 'K020241102', '67,16', 5.7086, 67.16, 28, 0.085, NULL, 1, '2024-10-15 03:40:22', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve;">1. Masih ditemukan ketidakselarasan penetapan kinerja sasaran strategis yang diperjanjikan pada dokumen Perjanjian Kinerja (PK) Kepala Dinas dengan dokumen perencanaan kinerja jangka menengah (renstra) PD;\n2. Aplikasi Sistem Informasi Layanan Akuntabilitas Kinerja (SIYAKIN) masih belum bisa dimanfaatkan secara optimal. Pada praktiknya masih ditemukan banyak kendala sehingga pengukuran kinerja berkala setiap PD belum bisa terlaksana;\n3. Informasi yang disajikan pada laporan kinerja belum sepenuhnya digunakan untuk dasar perbaikan perencanaan kinerja tahun berikutnya baik di tingkat pemerintah daerah maupun PD;\n4. Evaluasi AKIP Internal belum sepenuhnya berdampak pada perbaikan kualitas implementasi AKIP di lingkungan Pemerintah Kabupaten Blitar.</span><br>', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve;">1. Memastikan pada proses penyusunan dokumen perencanaan kinerja selanjutnya untuk tingkat pemerintah daerah maupun pD telah merumuskan kinerja yang berorientasi hasil/outcome dan sesuai dengan tingkat jabatan yang mengampunya;\n2. Menyempurnakan kualitas perumusan target kinerja dengan memastikan target kinerja yang progresif/meningkat setiap tahunnya sebagai upaya peningkatan pencapaian kinerja yang lebih baik;\n3. Memastikan informasi pada laporan kinerja di tingkat pemda maupun PD sudah disertai dengan jasil pengukuran data kinerja yang mendukung penjelasan analisis capaian kinerja yang dilaporkan;\n4. Mendorong setiap PD menyusun rencana aksi tindak lanjut atas laporan hasil evaluasi yang telah diberikan, serta menyusun metode monitoring yang efektif untuk memastikan setiap PD menindaklanjuti seluruh rekomendasi perbaikan yang telah disampaikan</span><br>', '0000-00-00 00:00:00', 0),
