	('20240062_K020240804', 62, 3, 1, 1, '2024', 'K020240804', '284.5', 3.4695, 69.39, 20, 0.05, NULL, 1, '2024-08-01 01:59:15', 1, 0, '', '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">1) Memperluas pelaksanaan penilaian\nkompetensi untuk seluruh pegawai dan\ndipetakan untuk menjadi dasar penyusunan\ntalent pool sesuai Peraturan Menteri PANRB\nNo. 3 Tahun 2020 tentang Manajemen\nTalenta; 2) Memperdalam analisis\nkesenjangan kompetensi dan kinerja untuk\nsetiap pegawai yang diperbaharui secara\nberkala; 3) Melaksanakan strategi/program\n(PANJI CORPU dan/atau HCDP) yang telah\ndisusun untuk peningkatkan kompetensi\npegawai (diklat, praktik kerja/magang,\ncoaching, mentoring) berdasarkan analisis\nkesenjangan secara terjadwal dan dievaluasi;\n4) Mengimplementasikan kebijakan pola karir\ndan pengisian jabatan dengan mengacu pada\npada talent pool dan rencana suksesi\n(Manajemen Talenta) yang telah disusun; 5)\nMelaksanakan dan mengevaluasi atas strategi\nyang telah disusun untuk mengatasi\npermasalahan kinerja pegawai.</span>', '0000-00-00 00:00:00', 0),
