	('20240062_K020241102', 62, 3, 1, 1, '2024', 'K020241102', '67,11', 5.70435, 67.11, 28, 0.085, NULL, 1, '2024-10-15 03:42:08', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve;">1. Belum melakukan identifikasi crosscutting kinerja sebagai bentuk sharing outcome antar PD;\n2. Pengukuran kinerja belum memperlihatkan keterkaitan antara realisasi anggaran dengan realisasi kinerja yang dicapai setiap triwulan baik level Kabupaten maupun PD;\n3. Kualitas pengungkapan informasi kinerja yang dituangkan dalam laporan kinerja pada level PD masih terbatas\n4. LHE AKIP internal tahun 2024 belum seluruhnya memperlihatkan keterkaitan antara catatan/temuan dengan rekomendasi yang diberikan pada setiap komponen evaluasi</span><br>', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve;">1. Menyusun perjenjangan kinerja pada seluruh PD berdasarkan PermenPANRB nomor 89 tahun 2021;\n2. Melakukan reviu dan perbaikan pada seluruh dokumen Rencana Aksi PD agar selaras dengan PK Kepala PD;\n3. Meningkatkan kualitas laporan kinerja pada seluruh PD dengan mengeksplorasi dan menganalisis sccara mendalam faktor pendukung dan penganghambat pencapaian kinerja;\n4. Meningkatkan kualitas LHE AKIP Internal</span><br>', '0000-00-00 00:00:00', 0),
