	('20240063_K020240802', 63, 3, 1, 1, '2024', 'K020240802', '91,69', 4.5845, 91.69, 20, 0.05, NULL, 1, '2024-08-21 22:36:20', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">baik</span>', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Agar Perkada tentang SOTK mempedomani model penyederhanaan struktur organisasi untuk\npenyederhanaan birokrasi yang telah ditetapkan oleh MenpanRB sesuai surat MenpanRB Nomor B/467/KT.01/2021 tanggal 27 Mei 2021 Hal Rekomendasi Kebijakan Penyederhanaan Struktur Organisasi Perangkat Daerah di Lingkungan Pemerintah Daerah Provinsi dan Kabupaten/Kota. Tindaklanjut mekanisme penyederhanaan struktur organisasi saat ini agar berkoordinasi dengan KemenpanRB.</span>', '0000-00-00 00:00:00', 0),
	('20240063_K020240803', 63, 3, 1, 1, '2024', 'K020240803', '3,36', 3.36, 67.2, 20, 0.05, NULL, 1, '2024-10-28 23:04:46', 10, 0, '', '<span style="font-size: 13.3333px;">Kolaborasi SPBE sangat penting untuk pertukaran informasi dan peningkatan kapasitas pengelola SPBE</span>', '<span style="font-size: 13.3333px;">Agar melakukan reviu dan evaluasi secara berkelanjutan pada semua domain</span>', '0000-00-00 00:00:00', 0),
	('20240063_K020240804', 63, 3, 1, 1, '2024', 'K020240804', '329', 4.012, 80.24, 20, 0.05, NULL, 1, '2024-08-01 02:00:06', 1, 0, '', '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">1) Memperluas pelaksanaan penilaian kompetensi\nuntuk seluruh pegawai; 2) Mengembangkan\npenyusunan talent pool dan rencana suksesi secara\nterstruktur untuk seluruh pegawai sesuai Peraturan\nMenteri PANRB No. 3 Tahun 2020 tentang\nManajemen Talenta; 3) Memperdalam analisis\nkesenjangan kompetensi perindividu pegawai\nberdasarkan hasil assessment; 4) Melaksanakan\nsecara terjadwal dan mengevaluasi strategi/\nprogram yang telah disusun untuk peningkatkan\nkompetensi pegawai baik klasikal maupun non\nklasikal (diklat, praktik kerja/magang, coaching,\nmentoring); 5) Mengimplementasikan kebijakan\npola karir dan pengisian jabatan dengan mengacu\npada pada talent pool dan rencana suksesi\n(Manajemen Talenta) yang telah disusun; 6) Mengevaluasi strategi yang telah dilaksanakan\nuntuk mengatasi permasalahan kinerja pegawai.</span>', '0000-00-00 00:00:00', 0),
	('20240063_K020240901', 63, 3, 1, 1, '2024', 'K020240901', '70,27', 1.4054, 70.27, 15, 0.02, NULL, 1, '2024-11-11 00:25:45', 8, 0, '', '', '<div>1. Draft kebijakan kearsipan agar segera ditetapkan sehingga dapat&nbsp;<span style="font-weight: initial;">dijadikan pedoman.</span></div><div>2. Pembinaan terhadap Organisasi Masyarakat, Organisasi Politik,<span style="font-weight: initial;">Perusahaan Daerah, Perusahaan Swasta dan Masyarakat.</span></div><div>3. Penyusutan arsip yang terdiri dari pemindahan arsip inaktif; pemusnahan&nbsp;<span style="font-weight: initial;">arsip dan penyerahan arsip statis.</span></div><div>4. Penyusunan sarana bantu temu balik arsip statis.</div><div>5. Ketersediaan peralatan pendukung penyimpanan arsip sesuai ketentuan.</div><div>6. Ketersediaan sumber daya manusia kearsipan serta pendanaan untuk&nbsp;<span style="font-weight: initial;">kegiatan kearsipan.</span></div>', '0000-00-00 00:00:00', 0),
