	('20240063_K020241102', 63, 3, 1, 1, '2024', 'K020241102', '74,21', 6.30785, 74.21, 28, 0.085, NULL, 1, '2024-10-15 03:43:12', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve;">1. Penetapan target belum sepenuhnya memperhatikan capaian kinerja tahun sebelumnya;\n2. Dokumen IKU masih ditemukan formula perhitungan yang kurang tepat dan tidak menggambarkan substansi indikatornya;\n3. Laporan kinerja PD belum dilengkapi dengan upaya benchmarking capaian kinerja;\n4. Masih ditemukan PD belum menindaklanjuti seluruh catatan pada evaluasi AKIP yang diberikan oleh evaluator internal</span>', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve;">1. Menyempurnakan kualitas perencanaan kinerja Pemda dengan memperbaiki beberapa tujuan menjadi lebih spesifik;\n2. Memastikan setiap formula pada dokumen IKU Pemda dan seluruh PD telah relevan dengan substansi indikatornya;\n3. Mendorong PD melakukan benchmarking capaian kinerja;\n4. Menintensifkan pemantauan terhadap tindak lanjut hasil evaluasi AKIP internal</span>', '0000-00-00 00:00:00', 0),
