	('20240064_K020240802', 64, 3, 1, 1, '2024', 'K020240802', '100', 5, 100, 20, 0.05, NULL, 1, '2024-08-21 22:27:16', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">sangat baik</span>', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Agar segera ditetapkan Perkada tentang SOTK pasca penyederhanaan struktur organisasi agar dapat ditindaklanjuti ke tahap penyetaraan jabatan dan penyesuaian sistem kerja.</span>', '0000-00-00 00:00:00', 0),
	('20240064_K020240803', 64, 3, 1, 1, '2024', 'K020240803', '2,93', 2.93, 58.6, 20, 0.05, NULL, 1, '2024-10-28 23:04:33', 10, 0, '', '<span style="font-size: 13.3333px;">Kolaborasi SPBE sangat penting untuk pertukaran informasi dan peningkatan kapasitas pengelola SPBE</span>', '<span style="font-size: 13.3333px;">Agar melakukan reviu dan evaluasi secara berkelanjutan pada semua domain</span>', '0000-00-00 00:00:00', 0),
	('20240064_K020240804', 64, 3, 1, 1, '2024', 'K020240804', '288', 3.512, 70.24, 20, 0.05, NULL, 1, '2024-08-01 01:59:36', 1, 0, '', '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">1) Menyusun dan menetapkan Standar Kompetensi\nJabatan untuk tiap level jabatan yang telah diberi\npersetujuan oleh Kemenpan RB; 2) Menyusun profl\npegawai berdasarkan pemetaan kompetensi untuk\nkeseluruhan pegawai di Sistem Informasi; 3)\nMenyusun talent pool dan rencana suksesi untuk tiap\nlevel jabatan; 4) Menyusun strategi pengembangan\nkompetensi pegawai secara jangka panjang (5 tahun)\nberdasarkan data kesenjangan kompetensi pegawai;\n5) Melaksanakan pengisian Jabatan Administrator\ndan Jabatan Pengawas dengan mempertimbangkan\nhasil assessment; 6) Menyusun analisis\npermasalahan kinerja pegawai dan strategi\nmengatasinya secara spesifk.</span>', '0000-00-00 00:00:00', 0),
	('20240064_K020240901', 64, 3, 1, 1, '2024', 'K020240901', '60,19', 1.2038, 60.19, 15, 0.02, NULL, 1, '2024-11-11 00:25:48', 8, 0, '', '', '<div>1. Kegiatan perumusan/penyusunan kebijakan kearsipan hingga</div><div>penetapannya oleh Pemerintah Kabupaten Lumajang.</div><div>2. Peningkatan program kegiatan pada Lembaga Kearsipan Daerah:</div><div>a. Melakukan pengolahan arsip statis dengan hasil optimal, baik berupa</div><div>Daftar Arsip Statis, Inventaris Arsip, dan Guide Arsip;</div><div>b. Melakukan pembaharuan dan unggah data ke JIKN.</div><div>c. Penyediaan fasilitas ruang dan prasarana pendukung dalam Depot&nbsp;<span style="font-weight: initial;">Arsip (sesuai rekomendasi), melaksanakan restorasi arsip statis, serta&nbsp;</span><span style="font-weight: initial;">alih media arsip yang telah direstorasi.</span></div><div>d. Mendorong Desa melakukan pembinaan penelusuran arsip Sejarah&nbsp;<span style="font-weight: initial;">Desa.</span></div><div>e. Memprogramkan pengajuan arsip berkategori Memori Kolektif Bangsa&nbsp;<span style="font-weight: initial;">(MKB) dari Pemerintah Kabupaten Lumajang kepada ANRI.</span></div>', '0000-00-00 00:00:00', 0),
