	('20240064_K020241002', 64, 3, 1, 1, '2024', 'K020241002', '90,34', 2.2585, 90.34, 12, 0.025, NULL, 1, '2024-10-12 18:02:30', 10, 0, '', '<div><span style="font-size: 13.3333px;">Hasil karya laman web dan media sosial yang dikirim ke JPRA kurang maksimal</span><br></div><div><br></div>', '<span style="font-size: 13.3333px;">Agar hasil karya laman web dan media sosial yang dikirim ke JPRA selanjutnya lebih baik lagi&nbsp;</span>', '0000-00-00 00:00:00', 0),
	('20240064_K020241003', 64, 3, 1, 1, '2024', 'K020241003', '56,36', 3.9452, 56.36, 12, 0.07, NULL, 1, '2024-07-17 21:07:36', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Cukup</span>', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Perlu ada upaya untuk mendorong pemanfaatan sistem pengadaan mulai dari perencanaan hingga realisasi pengadaan (transaksional dan pencatatan) dan keterisian Formasi Jabatan Fungsional</span>', '0000-00-00 00:00:00', 0),
	('20240064_K020241101', 64, 3, 1, 1, '2024', 'K020241101', 'WTP', 11, 100, 28, 0.11, NULL, 1, '2024-07-18 00:40:24', 1, 0, '', '', '', '0000-00-00 00:00:00', 0),
	('20240064_K020241102', 64, 3, 1, 1, '2024', 'K020241102', '70,20', 5.967, 70.2, 28, 0.085, NULL, 1, '2024-10-15 03:42:31', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve;">1. Identifikasi crosscutting kinerja masih terlihat keterlibatan antar PD, belum dilakukan identifikasi hingga stakeholder diluar PD yang turut mendukung ketercapaian kinerja Kabupaten;\n2. Masih terdapat beberapa indikator kinerja yang belum memiliki definisi operasional yang spesifik;\n3. Informasi dalam laporan kinerja belum sepenuhnya digunakan untuk perbaikan strategi perencanaan kinerja tahun berikutnya;\n4. Hasil evaluasi akuntabilitas kinerja internal belum sepenuhnya mampu mendorong perbaikan dan peningkatan capaian kinerja pada level pusat</span><br>', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve;">1. Mereviu kembali perjenjangan kinerja yang sudah disusun, khususnya pada level PD dengan memperhatikan kembali CSF yang berpotensi mendukung kinerja diatasnya;\n2. Mereviu dan melakukan penyempurnaan penjelasan definisi operasional terhadap seluruh indikator kinerja;\n3. Mendorong pemanfaatan hasil monitoring dan evaluasi yang dilakukan;\n4. Mendorong hasil evaluasi akuntabilitas kinerja untuk dapat memberikan gambaran langkah-langkah perbaikan nyata untuk meningkatkan pencapaian seluruh target kinerja</span><br>', '0000-00-00 00:00:00', 0),
