	('20240065_K020240802', 65, 3, 1, 1, '2024', 'K020240802', '100', 5, 100, 20, 0.05, NULL, 1, '2024-08-21 22:24:03', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">sangat  baik dengan capaian 107,26%</span>', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Agar segera ditetapkan Perkada tentang SOTK pasca penyederhanaan struktur organisasi agar\ndapat ditindaklanjuti ke tahap penyetaraan jabatan dan penyesuaian sistem kerja.</span>', '0000-00-00 00:00:00', 0),
	('20240065_K020240803', 65, 3, 1, 1, '2024', 'K020240803', '2,56', 2.56, 51.2, 20, 0.05, NULL, 1, '2024-10-28 23:04:14', 10, 0, '', '<span style="font-size: 13.3333px;">Kolaborasi SPBE sangat penting untuk pertukaran informasi dan peningkatan kapasitas pengelola SPBE</span>', '<span style="font-size: 13.3333px;">Agar melakukan reviu dan evaluasi secara berkelanjutan pada semua domain</span>', '0000-00-00 00:00:00', 0),
	('20240065_K020240804', 65, 3, 1, 1, '2024', 'K020240804', '259', 3.1585, 63.17, 20, 0.05, NULL, 1, '2024-08-01 01:58:57', 1, 0, '', '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">1. Menetapkan SKJ yang telah disusun dan\nmendapatkan validasi dari Kementerian PANRB;\n2. Melakukan pemetaan kompetensi untuk\nseluruh pegawai dan diperbarui secara berkala;\n3. Melakukan pemetaan talenta untuk seluruh\npegawai; 4. Menyusun strategi pengembangan\nkompetensi dan kinerja jangka panjang (5\ntahun); 5. Menggunakan hasil assessment\nsebagai pertimbangan dalam pengisian Jabatan\nAdministrator dan Pengawas secara konsisten;\n6. Menyusun analisis permasalahan kinerja\nuntuk seluruh pegawai dan menentukan strategi\nyang tepat untuk mengatasi masalah tersebut.</span>', '0000-00-00 00:00:00', 0),
	('20240065_K020240901', 65, 3, 1, 1, '2024', 'K020240901', '68,83', 1.3766, 68.83, 15, 0.02, NULL, 1, '2024-11-11 00:25:54', 8, 0, '', '', '<div>1. Agar semua Perangkat Daerah mendapatkan sosialisasi terkait Kebijakan</div><div>Sistem Klasifikasi Keamanan dan Akses Arsip Dinamis dan menyusun</div><div>Kebijakan Pengelolaan Arsip Terjaga serta menyusun Kebijakan Alih</div><div>Media;</div><div>2. Intensitas pembinaan terutama dalam rangka pengelolaan arsip terjaga</div><div>dan arsip aset;</div><div>3. Agar segera mengajukan permohonan akun layanan, setting konfigurasi</div><div>dan bimbingan teknis penggunaan Aplikasi Umum Bidang Kearsipan</div><div>Dinamis Terintegrasi (SRIKANDI);</div><div>4. Penyusutan arsip yang telah dilaksanakan secara sistemik dan simultan</div><div>5. Meningkatkanan dukungan anggaran urusan kearsipan;</div><div>6. Peningkatan Sumber Daya Kearsipan, sarana dan prasarana.</div>', '0000-00-00 00:00:00', 0),
	('20240065_K020240902', 65, 3, 1, 1, '2024', 'K020240902', '54.22', 2.1688, 54.22, 15, 0.04, NULL, 1, '2024-07-29 01:16:21', 14, 0, '', '', '', '0000-00-00 00:00:00', 0),
