	('20240065_K020240904', 65, 3, 1, 1, '2024', 'K020240904', '4', 3.6, 80, 15, 0.045, NULL, 1, '2024-07-29 01:17:17', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Segera melakukan perbaikan dan pengembangan proses bisnis dan/atau penyesuaian Standar Operasional Prosedur (SOP)</span>', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Segera melakukan perbaikan dan pengembangan proses bisnis dan/atau penyesuaian Standar Operasional Prosedur (SOP)</span>', '0000-00-00 00:00:00', 0),
	('20240065_K020241001', 65, 3, 1, 1, '2024', 'K020241001', '59,56', 1.489, 59.56, 12, 0.025, NULL, 1, '2024-11-20 17:04:35', 10, 0, '', '\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p class="MsoNormal">TAHAP I:</p>\n\n<p class="MsoNormal">JUDUL DATA; Dari 47 data terdapat 27 data yang judulnya sudah\nsesuai kesepakatan, 3 data yang judulnya tidak sesuai kesepakatan dan 17 data\nyang belum diinput</p>\n\n<p class="MsoNormal">KESESUAIAN PERIODE; Dari 47 data terdapat 12 data yang\nperiodenya sudah sesuai kesepakatan, 18 data periodenya tidak sesuai kesepakatan\ndan 17 data yang belum diinput</p>\n\n<p class="MsoNormal">KESESUAIAN TABULASI; Dari 47 data terdapat 28 data yang\ntabulasinya sudah sesuai kesepakatan, 1 data tabulasinya tidak sesuai\nkesepakatan dan 18 data yang belum diinput</p>\n\n<p class="MsoNormal">KETERISIAN DATA</p>\n\n<p class="MsoNormal">Dari 74 keterisian data, tahun 2022 diisi sebanyak 30 data\ndan tahun 2023 diisi sebanyak 21 data</p>\n\n\n\n\n\n<style>@font-face\n	{font-family:"Cambria Math";\n	panose-1:2 4 5 3 5 4 6 3 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:roman;\n	mso-font-pitch:variable;\n	mso-font-signature:-536870145 1107305727 0 0 415 0;}@font-face\n	{font-family:Calibri;\n	panose-1:2 15 5 2 2 2 4 3 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:swiss;\n	mso-font-pitch:variable;\n	mso-font-signature:-536858881 -1073732485 9 0 511 0;}p.MsoNormal, li.MsoNormal, div.MsoNormal\n	{mso-style-unhide:no;\n	mso-style-qformat:yes;\n	mso-style-parent:"";\n	margin:0cm;\n	mso-pagination:widow-orphan;\n	font-size:12.0pt;\n	font-family:"Calibri",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:Calibri;\n	mso-fareast-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:"Times New Roman";\n	mso-bidi-theme-font:minor-bidi;\n	mso-font-kerning:1.0pt;\n	mso-ligatures:standardcontextual;}.MsoChpDefault\n	{mso-style-type:export-only;\n	mso-default-props:yes;\n	font-family:"Calibri",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:Calibri;\n	mso-fareast-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:"Times New Roman";\n	mso-bidi-theme-font:minor-bidi;}div.WordSection1\n	{page:WordSection1;}</style>', '\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p class="MsoNormal">TAHAP I:</p>\n\n<p class="MsoNormal">Agar memenuhi daftar data yang sudah disepakati </p>\n\n\n\n\n\n<style>@font-face\n	{font-family:"Cambria Math";\n	panose-1:2 4 5 3 5 4 6 3 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:roman;\n	mso-font-pitch:variable;\n	mso-font-signature:-536870145 1107305727 0 0 415 0;}@font-face\n	{font-family:Calibri;\n	panose-1:2 15 5 2 2 2 4 3 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:swiss;\n	mso-font-pitch:variable;\n	mso-font-signature:-536858881 -1073732485 9 0 511 0;}p.MsoNormal, li.MsoNormal, div.MsoNormal\n	{mso-style-unhide:no;\n	mso-style-qformat:yes;\n	mso-style-parent:"";\n	margin:0cm;\n	mso-pagination:widow-orphan;\n	font-size:12.0pt;\n	font-family:"Calibri",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:Calibri;\n	mso-fareast-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:"Times New Roman";\n	mso-bidi-theme-font:minor-bidi;\n	mso-font-kerning:1.0pt;\n	mso-ligatures:standardcontextual;}.MsoChpDefault\n	{mso-style-type:export-only;\n	mso-default-props:yes;\n	font-family:"Calibri",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:Calibri;\n	mso-fareast-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:"Times New Roman";\n	mso-bidi-theme-font:minor-bidi;}div.WordSection1\n	{page:WordSection1;}</style>', '0000-00-00 00:00:00', 0),
	('20240065_K020241002', 65, 3, 1, 1, '2024', 'K020241002', '87,26', 2.1815, 87.26, 12, 0.025, NULL, 1, '2024-10-12 17:59:51', 10, 0, '', '<span style="font-size: 13.3333px;">Hasil Karya Laman Web dan Media Sosial kurang maksimal</span><br>', 'Agar hasil karya laman web dan media sosial yang dikirim ke JPRA lebih baik lagi tahun depan', '0000-00-00 00:00:00', 0),
	('20240065_K020241003', 65, 3, 1, 1, '2024', 'K020241003', '27,6', 1.932, 27.6, 12, 0.07, NULL, 1, '2024-07-17 20:56:07', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Kurang</span>', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Perlu dilakukan langkah strategis untuk bisa mendorong peningkatan tata kelola pengadaan</span>', '0000-00-00 00:00:00', 0),
	('20240065_K020241101', 65, 3, 1, 1, '2024', 'K020241101', 'WTP', 11, 100, 28, 0.11, NULL, 1, '2024-07-18 00:40:18', 1, 0, '', '', '', '0000-00-00 00:00:00', 0),
	('20240065_K020241102', 65, 3, 1, 1, '2024', 'K020241102', '62,50', 5.3125, 62.5, 28, 0.085, NULL, 1, '2024-10-15 03:41:41', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve;">1. Perencanaan kinerja pada level pemerintah daerah dan PD belum sepenuhnya memenuhi standar yang berkualitas;\n2. Masih terdapat data kinerja yang belum sepenuhnya andal untuk mengukur capaian kinerja yang diharapkan;\n3. Informasi kinerja yang telah dituangkan dalam LPPD maupun LAKIP OPD belum dimanfaatkan dengan baik, terutama pada proses penentuan target maupun strategi serta aktivitas dalam perencanaan tahunan untuk mendukung pencapaian kinerja ke depan;\n4. Pedoman evaluasi akuntabilitas kinerja internal masih dalam bentuk draft dan masih dalam proses penetapan</span><br>', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve;">1. Melakukan penyempurnaan terhadap cascading kinerja dari level jabatan tertinggi hingga ke level operasional;\n2. Mengoptimalkan aplikasi pengukuran yang dimiliki agar bukan hanya dimanfaatkan sebagai media pengukuran suatu program, kegiatan/sub kegiatan, dan anggaran namun juga capaian kinerja yang diperjanjikan oleh kepala PD;\n3. Mengoptimalkan monitoring atas tindak lanjut hasil evaluasi AKIP internal dengan memastikan setiap PD telah menyampaikan RATL atas rekomendasi yang diberikan;\n4. Terus mengawal proses penetapan Peraturan Bupati Jember tentang pedoman evaluasi akuntabilitas kinerja internal sehingga dapat digunakan sebagai dasar pelaksanaan evaluasi AKIP Internal kepada seluruh PD</span><br>', '0000-00-00 00:00:00', 0),
	('20240065_K020241103', 65, 3, 1, 1, '2024', 'K020241103', '0', 0, 0, 28, 0.085, NULL, 1, '2024-08-01 02:36:48', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Agar melakukan pembangunan ZI kepada unit kerja strategis yang bersentuhan langsung dengan masyarakat</span><br>', '', '0000-00-00 00:00:00', 0),
