	('20240065_K020241202', 65, 3, 1, 1, '2024', 'K020241202', '67,2', 1.68, 67.2, 10, 0.025, NULL, 1, '2024-07-01 02:18:04', 1, 0, '', '<span style="line-height: 107%; font-family: Arial, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">Nilai terendah terdapat pada nilai adaptif\ndengan turunan nilai / perilaku berupa siap menghadapi ketidakpastian</span> dan\nantusias', '<span style="line-height: 107%; font-family: Arial, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">Pemerintah Kabupaten Jember dapat melakukan tujuh tahapan penguatan budaya kerja ASN BerAKHLAK yaitu : 1) Internalisasi, 2)\nPenyelarasan Sistem, 3) Pengukuran Baseline, 4) Penyusunan dan Implementasi\nAgenda Perubahan, 5) Pemantauan dan Evaluasi, 6) Penghargaan dan Apresiasi,\nserta 7) Penguatan Secara Berkelanjutan</span>', '0000-00-00 00:00:00', 0),
	('20240065_K020241203', 65, 3, 1, 1, '2024', 'K020241203', '3', 1.5, 60, 10, 0.025, NULL, 1, '2024-09-11 23:04:23', 10, 0, '', 'Waktu tindak lanjut aduan masih lama<br>', '<div>- Perlu mempercepat laju tindak lanjut aduan/ RTL aduan</div><div>- Perlu mempromosikan kanal aduan SP4N-LAPOR!<br></div>', '0000-00-00 00:00:00', 0),
