	('20240066_K020240702', 66, 3, 1, 1, '2024', 'K020240702', '96,30', 3.9123, 86.94, 15, 0.045, NULL, 1, '2024-10-31 21:08:30', 4, 0, '', '', '', '0000-00-00 00:00:00', 0),
	('20240066_K020240703', 66, 3, 1, 1, '2024', 'K020240703', '4,58', 5.496, 91.6, 15, 0.06, NULL, 1, '2024-08-21 23:23:45', 1, 0, '', 'Pelayanan Prima', '', '0000-00-00 00:00:00', 0),
	('20240066_K020240801', 66, 3, 1, 1, '2024', 'K020240801', '3,434', 3.7775, 75.55, 20, 0.05, NULL, 1, '2024-07-17 23:20:10', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">1. Sasaran Kegiatan belum ditetapkan </span><div><span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">2. Indikator tidak spesifk dan relevan </span></div><div><span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">3. Target tidak SMART </span></div><div><span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">4. Pengendalian yang ada belum diarahkan untuk memitigasi risiko/pencapaian tujuan </span></div><div><span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">5. Proses MR tidak dilakukan reviu/ evaluasi oleh APIP </span></div><div><span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">6.Risiko kecurangan belum dikelola</span></div>', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">1. Integrasi MR ke dalam proses perencanaan </span><div><span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">2. Perbaikan indikator kinerja agar memenuhi kriteria spesifk dan relevan </span></div><div><span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">3. Perbaikan target indikator agar memenuhi kriteria SMART </span></div><div><span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">4. Perbaikan metode pengukuran capaian kinerja </span></div><div><span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">5. Melaksanakan proses reviu MR </span></div><div><span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">6. Melakukan identifkasi dan analisis risiko kecurangan serta menambahkan dalam risk register yang ada</span></div>', '0000-00-00 00:00:00', 0),
	('20240066_K020240802', 66, 3, 1, 1, '2024', 'K020240802', '100', 5, 100, 20, 0.05, NULL, 1, '2024-08-21 22:21:02', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">sangat baik dengan capaian 100,44%</span>', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Agar segera ditetapkan Perkada tentang SOTK pasca penyederhanaan struktur organisasi agar\ndapat ditindaklanjuti ke tahap penyetaraan jabatan dan penyesuaian sistem kerja.</span>', '0000-00-00 00:00:00', 0),
	('20240066_K020240803', 66, 3, 1, 1, '2024', 'K020240803', '4,5', 4.5, 90, 20, 0.05, NULL, 1, '2024-10-28 23:03:54', 10, 0, '', '<span style="font-size: 13.3333px;">Kolaborasi SPBE sangat penting untuk pertukaran informasi dan peningkatan kapasitas pengelola SPBE</span>', '<span style="font-size: 13.3333px;">Agar melakukan reviu dan evaluasi secara berkelanjutan pada semua domain</span>', '0000-00-00 00:00:00', 0),
	('20240066_K020240804', 66, 3, 1, 1, '2024', 'K020240804', '305', 3.7195, 74.39, 20, 0.05, NULL, 1, '2024-08-01 01:56:20', 1, 0, '', '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">1. Menyusun SKJ secara lengkap (manajerial,\nsosial kultural, dan teknis) untuk seluruh jabatan; 2.\nMelanjutkan assessment kompetensi terhadap\npegawai yang belum pernah dilakukan\nassessment; 3. Melakukan pemetaan talenta\nberdasarkan Permenpan 3/2020; 4. Menyertakan\nstrategi pengembangan kompetensi 5 tahun dalam\nrencana strategis organisasi; 5. Melaksanakan\npengisian Administrator dan Pengawas dengan\nmetode assessment secara konsisten; 6.\nMelaksanakan strategi yang telah disusun untuk\nmengatasi permasalahan kinerja.</span>', '0000-00-00 00:00:00', 0),
	('20240066_K020240901', 66, 3, 1, 1, '2024', 'K020240901', '72,05', 1.441, 72.05, 15, 0.02, NULL, 1, '2024-11-11 00:26:00', 8, 0, '', '', '<div style="font-size: 13.3333px;">1. Revisi dan rancangan jadwal retensi arsip agar segera dilakukan</div><div style="font-size: 13.3333px;">pengesahan, sehingga dapat segera dilakukan sosialisasi;</div><div style="font-size: 13.3333px;">2. Melaksanakan pembinaan pengelolaan arsip desa.</div><div style="font-size: 13.3333px;">3. Intensitas pembinaan terutama dalam rangka pengelolaan arsip terjaga</div><div style="font-size: 13.3333px;">dan arsip aset;</div><div style="font-size: 13.3333px;">4. Segera menyusun guide arsip statis dan inventaris arsip statis;</div><div style="font-size: 13.3333px;">5. Penyusutan arsip yang telah dilaksanakan secara sistemik dan simultan</div><div style="font-size: 13.3333px;">6. Meningkatkanan dukungan anggaran urusankearsipan;</div><div style="font-size: 13.3333px;">7. Peningkatan Sumber Daya Kearsipan, sarana dan prasarana;</div><div style="font-size: 13.3333px;">8. Penambahan Arsiparis baik di LKD maupun OPD</div>', '0000-00-00 00:00:00', 0),
