	('20240066_K020241102', 66, 3, 1, 1, '2024', 'K020241102', '90,13', 7.66105, 90.13, 28, 0.085, NULL, 1, '2024-10-15 03:39:41', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve; text-decoration-skip-ink: none;">1. Pelaksanaan pengentasan kemiskinan belum sepenuhnya didasarkan pada </span><span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve; font-style: italic; text-decoration-skip-ink: none;">logframe </span><span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve; text-decoration-skip-ink: none;">kinerja pengentasan kemiskinan yang dibentuk sehingga masih ditemukan beberapa kinerja pada program/kegiatan yang dianggarkan untuk pengentasan kemiskinan berpotensi tidak efektif dan efisien diimplementasikan\n2. Hasil pengukuran kinerja berjenjag yang telah dilakukan belum sepenuhnya digunakan sebagai dasar perbaikan strategi, kebijakan, aktivitas dan anggaran guna mencapai kinerja yang telah ditetapkan;\n3. Belum maksimalnya pemanfaatan laporan kinerja, khususnya pada level perangkat daerah untuk dijadikan dasar penetapan strategi atau aktivitas dan penetapan target kinerja pada perencanaan kinerja tahun depan;\n4. Laporan hasil evaluasi akuntabilitas kinerja internal yang disusun belum sepenuhnya berkualitas</span><br>', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve; text-decoration-skip-ink: none;">1. Memastikan kembali pemanfaatan </span><span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve; font-style: italic; text-decoration-skip-ink: none;">logframe </span><span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve; text-decoration-skip-ink: none;">pengentasan kemiskinan agar diimplemetasikan pada perencanaan kinerja, khususnya dalam merumuskan kinerja program/kegiatan yang benar-benar optimal dalam mengintervensi pengentasan kemiskinan sehingga pencapaian pengentasan kemiskinan akan lebih efektif dan efisien;\n2. Mengoptimalkan pemanfaatan hasil pengukuran kinerja berjenjang untuk dijadikan sebagai dasar perbaikan strategi, kebijakan, aktivitas dan anggaran guna mencapai kinerja yang telah ditetapkan;\n3. Mengoptimalkan pemanfaatan laporan kinerja, khususnya pada level perangkat daerah untuk dijadikan dasar penetapan strategi atau aktivitas dan penetapan target kinerja pada perencanaan kinerja tahun depan;\n4. Mendorong adanya peningkatan kualitas laporan hasil evaluasi akuntabilitas kinerja internal dengan cara menyusun standar yang jelas terkait dengan muatan isi laporan hasil evaluasi akuntabilitas kinerja internal agar dapat sesuai dengan interpretasi predikat SAKIP yang dimiliki oleh Perangkat Daerah</span><br>', '0000-00-00 00:00:00', 0),
