	('20240067_K020241102', 67, 3, 1, 1, '2024', 'K020241102', '74,15', 6.30275, 74.15, 28, 0.085, NULL, 1, '2024-10-15 03:41:11', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve; text-decoration-skip-ink: none;">1. Belum melakukan identifikasi </span><span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve; font-style: italic; text-decoration-skip-ink: none;">croscutting </span><span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve; text-decoration-skip-ink: none;"> kinerja sebagai bentuk </span><span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve; font-style: italic; text-decoration-skip-ink: none;">sharing outcome </span><span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve; text-decoration-skip-ink: none;">antar PD sebagai upaya untuk mempercepat tercapainya kinerja utama PD;\n2. Pelaksanaan pengukuran dan pengumpulan data kinerja organisasi masih dilakukan secara manual sehingga pelaksanaan monitoring dan evaluasi kinerja tidak bisa dilakukan secara real time dan kapan saja;\n3. Informasi kinerja yang telah dituangkan dalam LPPD maupun Laporan Kinerja PD belum dimanfaatkan dengan baik, terutama pada proses penentuan target maupun strategi serta aktivitas dalam perencanaan tahunan untuk mendukung pencapaian kinerja ke depan;\n4. Hasil evaluasi akuntabilitas kinerja internal tang telah dilakukan oleh Inspektorat terhadap seluruh Perangkat Daerah belum memacu perbaikan akuntabilitas kinerja secara signifikan</span><br>', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve; text-decoration-skip-ink: none;">1. Melakukan reviu dan perbaikan atas rumusan kinerja individu setiap pegawai agar dapat selaras dengan tugas fungsi jabatan dan kinerja organisasi;\n2. Memanfaatkan teknologi informasi dan komunikasi dalam melakukan pengukuran dan pengumpulan data kinerja organisasi, agar dapat dilakukan monitoring dan evaluasi terhadap ketercapaian kinerja secara berkala danreal time baik di level Pemda maupun PD;\n3. Memastikan bahwa temuan dan rekomendasi yang diberikan saat evaluasi akuntabilitas kinerja internal agar menggambarkan hal yang menjadi kekurangan dan memberikan solusi yang efektif yang perlu dilakukan guna meningkatkan kualitas implementasikan SAKIP di setiap PD;\n4. Meningkatkan kapasitas evaluator dalam melaksanakan evaluasi akuntabilitas kinerja internal, sehingga mampu menggunakan instrumen evaluasi secara maksimal, menerapkan </span><span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve; font-style: italic; text-decoration-skip-ink: none;">professional judgement </span><span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve; text-decoration-skip-ink: none;">secara tepat, serta memberikan rekomendasi yang dapat memacu perbaikan akuntabilitas kinerja PD.</span><br>', '0000-00-00 00:00:00', 0),
