	('20240068_K020240901', 68, 3, 1, 1, '2024', 'K020240901', '68,66', 1.3732, 68.66, 15, 0.02, NULL, 1, '2024-11-11 00:25:33', 8, 0, '', '', '<div>1. Draft kebijakan kearsipan agar segera ditetapkan sehingga dijadikan&nbsp;<span style="font-weight: initial;">Pedoman;</span></div><div>2. Melaksanakan pembinaan pengelolaan arsip desa.</div><div>3. Pengelolaan arsip inaktif yang memiliki retensi sekurang-kurangnya 10&nbsp;<span style="font-weight: initial;">tahun dan pengelolaan arsip statis agar dilaksanakan sesuai kaidah&nbsp;</span><span style="font-weight: initial;">kearsipan;</span></div><div>4. Segera menyusun guide arsip statis dan inventaris arsip statis;</div><div>5. Penyusutan arsip yang telah dilaksanakan secara sistemik dan simultan</div><div>6. Meningkatkanan dukungan anggaran urusan kearsipan;</div><div>7 Peningkatan Sumber Daya Kearsipan, sarana dan prasarana;</div>', '0000-00-00 00:00:00', 0),
