	('20240068_K020241002', 68, 3, 1, 1, '2024', 'K020241002', '89,16', 2.229, 89.16, 12, 0.025, NULL, 1, '2024-10-12 18:49:28', 10, 0, '', '<span style="font-size: 13.3333px;">Hasil Karya Laman Web dan Media Sosial kurang maksimal</span>', '<div><span style="font-size: 13.3333px;">Agar hasil karya laman web dan media sosial yang dikirim ke JPRA selanjutnya lebih baik lagi&nbsp;</span></div><div><br></div>', '0000-00-00 00:00:00', 0),
