	('20240068_K020241102', 68, 3, 1, 1, '2024', 'K020241102', '81,65', 6.94025, 81.65, 28, 0.085, NULL, 1, '2024-10-15 03:58:50', 1, 0, '', '<span data-sheets-root="1" style="font-size: 11pt; font-family: Calibri, Arial;">1. Masih ditemukan target stagnan/ kurang menantang dalam perencanaan kinerja ;<br>2. Sistem pengukuran kinerja unit dan kinerja individu pegawai belum terintegrasi ;<br>3.Catatan atas informasi kinerja yang telah dituangkan dalam laporan kinerja belum dimanfaatkan dengan baik ;<br>4.Hasil evaluasi internal belum seluruh PD menindaklanjuti catatan dan rekomendasi evaluasi internal tahun sebelumnya.</span><br>', '<span data-sheets-root="1" style="font-size: 11pt; font-family: Calibri, Arial;">1. Memastikan penetapan target triwulan logis dan sinkron dengan penetapan target perencanaan yang dituangkan dalam PK tahunan seluruh individu pegawai ;<br>2. Mengintegrasikan seluruh sistem pengukuran kinerja baik tingkat unit kerja dan individu pegawai akan terjaga kesesuaian antara kinerja unit kerja dan kinerja individu pegawai;<br>3. Memastikan keselarasan catatan dan rekomendasi pada LHE sehingga diharapjan kesimpulan akhir atas hasil penilalain setiap PD sesuai dengan catatan sesungguhnya;<br>4. Mendoroong hasil evaluasi akuntabilitas kinerja untuk dapat memberikan gambaran langkah-langkah perbaikan nyata untuk meningkatkan pencapaian target kinerja.</span><br>', '0000-00-00 00:00:00', 0),
