	('20240069_K020240803', 69, 3, 1, 1, '2024', 'K020240803', '3,33', 3.33, 66.6, 20, 0.05, NULL, 1, '2024-10-28 23:05:19', 10, 0, '', '<span style="font-size: 13.3333px;">Kolaborasi SPBE sangat penting untuk pertukaran informasi dan peningkatan kapasitas pengelola SPBE</span>', '<span style="font-size: 13.3333px;">Agar melakukan reviu dan evaluasi secara berkelanjutan pada semua domain</span>', '0000-00-00 00:00:00', 0),
	('20240069_K020240804', 69, 3, 1, 1, '2024', 'K020240804', '311', 3.7925, 75.85, 20, 0.05, NULL, 1, '2024-08-01 02:01:21', 1, 0, '', '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">1. Menyusun dan menetapkan SKJ untuk\njabatan selain JPT, Administrator, dan\nPengawas; 2. Melakukan pemetaan\nkompetensi secara merata untuk seluruh\npegawai dan diperbarui secara berkala; 3.\nMelakukan pemetaan talenta pada seluruh\npegawai; 4. Melaksanakan program diklat\nberdasarkan analisis kesenjangan kompetensi\ndan kinerja yang dikaitkan dengan kebutuhan\norganisasi dan kebutuhan individu; 5.\nMenggunakan hasil assessment sebagai\npertimbangan dalam pengisian Jabatan\nAdministrator dan Pengawas secara konsisten;\n6. Menyusun analisis permasalahan kinerja\nsecara terstruktur dan menetapkan strategi\nyang tepat untuk mengatasi permalsahan\ntersebut.</span>', '0000-00-00 00:00:00', 0),
	('20240069_K020240901', 69, 3, 1, 1, '2024', 'K020240901', '85,53', 1.7106, 85.53, 15, 0.02, NULL, 1, '2024-11-11 00:25:36', 8, 0, '', '', '<div>1. Pembinaan terhadap Organisasi Masyarakat, Organisasi Politik,&nbsp;&nbsp;<span style="font-weight: initial;">Perusahaan Daerah, Perusahaan Swasta dan Masyarakat.</span></div><div>2. Penyusutan arsip yang terdiri dari pemindahan arsip inaktif; pemusnahan&nbsp;<span style="font-weight: initial;">arsip dan penyerahan arsip statis.</span></div><div>3. Penyusunan sarana bantu temu balik arsip statis.</div><div>4. Ketersediaan peralatan pendukung penyimpanan arsip sesuai ketentuan.</div><div>5. Ketersediaan sumber daya manusia kearsipan serta pendanaan untuk&nbsp;<span style="font-weight: initial;">kegiatan kearsipan.</span></div>', '0000-00-00 00:00:00', 0),
