	('20240069_K020241001', 69, 3, 1, 1, '2024', 'K020241001', '52,34', 1.3085, 52.34, 12, 0.025, NULL, 1, '2024-11-20 17:06:25', 10, 0, '', '', '\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p class="MsoNormal">TAHAP I:</p>\n\n<p class="MsoNormal">Agar memenuhi daftar data yang sudah disepakati </p>\n\n\n\n\n\n<style>@font-face\n	{font-family:"Cambria Math";\n	panose-1:2 4 5 3 5 4 6 3 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:roman;\n	mso-font-pitch:variable;\n	mso-font-signature:-536870145 1107305727 0 0 415 0;}@font-face\n	{font-family:Calibri;\n	panose-1:2 15 5 2 2 2 4 3 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:swiss;\n	mso-font-pitch:variable;\n	mso-font-signature:-536858881 -1073732485 9 0 511 0;}p.MsoNormal, li.MsoNormal, div.MsoNormal\n	{mso-style-unhide:no;\n	mso-style-qformat:yes;\n	mso-style-parent:"";\n	margin:0cm;\n	mso-pagination:widow-orphan;\n	font-size:12.0pt;\n	font-family:"Calibri",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:Calibri;\n	mso-fareast-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:"Times New Roman";\n	mso-bidi-theme-font:minor-bidi;\n	mso-font-kerning:1.0pt;\n	mso-ligatures:standardcontextual;}.MsoChpDefault\n	{mso-style-type:export-only;\n	mso-default-props:yes;\n	font-family:"Calibri",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:Calibri;\n	mso-fareast-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:"Times New Roman";\n	mso-bidi-theme-font:minor-bidi;}div.WordSection1\n	{page:WordSection1;}</style>', '0000-00-00 00:00:00', 0),
	('20240069_K020241002', 69, 3, 1, 1, '2024', 'K020241002', '46,09', 1.15225, 46.09, 12, 0.025, NULL, 1, '2024-10-12 18:45:27', 10, 0, '', '<div><span style="font-size: 13.3333px;">1. Tidak mengikuti Monev Tahun 2023</span></div><div><span style="font-size: 13.3333px;">2. Hasil Karya Laman Web dan Media Sosial kurang maksimal</span></div><div><span style="font-size: 13.3333px;">3. Laman Web PPID kurang</span></div>', '<div><span style="font-size: 13.3333px;">Monev Ki Jatim selanjutnya agar mengirimkan SAQ sesuai dengan instrumen yang ditetapkan</span></div><div><span style="font-size: 13.3333px;">Agar hasil karya laman web dan media sosial yang dikirim ke JPRA selanjutnya lebih baik lagi&nbsp;</span></div><div><span style="font-size: 13.3333px;">Laman Web PPID agar disesuaikan dengan PerKI 1/2021</span></div><div><br></div>', '0000-00-00 00:00:00', 0),
	('20240069_K020241003', 69, 3, 1, 1, '2024', 'K020241003', '70,57', 4.9399, 70.57, 12, 0.07, NULL, 1, '2024-07-17 21:19:26', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Baik</span>', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Selamat atas prestasi yang diraih. Tingkatkan pencapaian khususnya untuk keterisian Formasi Jabfung Pengelola PBJ</span>', '0000-00-00 00:00:00', 0),
	('20240069_K020241101', 69, 3, 1, 1, '2024', 'K020241101', 'WTP', 11, 100, 28, 0.11, NULL, 1, '2024-07-18 00:44:14', 1, 0, '', '', '', '0000-00-00 00:00:00', 0),
	('20240069_K020241102', 69, 3, 1, 1, '2024', 'K020241102', '67,11', 5.70435, 67.11, 28, 0.085, NULL, 1, '2024-10-15 03:15:17', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 11px; white-space-collapse: preserve;">1. Dokumen perencanaan kinerja yang disusun mulai dari jangka menengah hingga pendek masih ditemukan belum selesai ;\n2. Masih ditemukan definisi kinerja yang belum sesuai untuk mengukur kinerja strategis ;\n3.Laporan AK beberapa PD masih belum dipublikasikan secara umum melalui website resmi ;\n4. Hasil evaluasi internal yang dituangkan bentuk LHE belum memberikan temuan dan rekomendasi yang menyelesaikan akar permasalahan.</span><br>', '<span data-sheets-root="1" style="font-size: 11pt; font-family: Calibri, Arial;">1.Melakukan reviu pada seluruh dokumen perencanaan meliputi Restra, IKU,dan PK untuk memastikan setiap dokumen perencanaan yang ada selaras dan saling terhubung satu dengan yang lain, sehingga kinerja utama yang ingin dicapai dapat terpetakan dengan baik;<br>2. Melakukan reviu terhadap IKU setiap PD untuk memastikan setiap definisi<br>kinerja atau operasional kinerja telah sesuai untuk mengukur kinerja strategis<br>sesuai dengan tujuan dan sasaran yang ingin dicapai;<br>3. Memublikasikan LPPD Pemerintah Kabupaten Probolinggo dan laporan<br>akuntabilitas kinerja PD secara berkala melalui website pemerintah daerah dan<br>atau PPID sebagai bagian dari keterbukaan informasi publik;<br>4.Memastikan bahwa temuan dan rekomendasi yang diberikan saat evaluasi<br>akuntabilitas kinerja internal agar menggambarkan hal yang menjadi<br>kekurangan dan memberikan solusi yang efektif yang perlu dilakukan guna<br>meningkatkan kualitas implementasikan SAKIP di setiap PD;</span><br>', '0000-00-00 00:00:00', 0),
