	('20240071_K020240803', 71, 3, 1, 1, '2024', 'K020240803', '3,11', 3.11, 62.2, 20, 0.05, NULL, 1, '2024-10-28 23:05:28', 10, 0, '', '<span style="font-size: 13.3333px;">Kolaborasi SPBE sangat penting untuk pertukaran informasi dan peningkatan kapasitas pengelola SPBE</span>', '<span style="font-size: 13.3333px;">Agar melakukan reviu dan evaluasi secara berkelanjutan pada semua domain</span>', '0000-00-00 00:00:00', 0),
	('20240071_K020240804', 71, 3, 1, 1, '2024', 'K020240804', '320.5', 3.9085, 78.17, 20, 0.05, NULL, 1, '2024-08-01 02:01:39', 1, 0, '', '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">1. Memperbarui SKJ (manajerial, teknis, \nsosiokultural) sesuai dengan kebijakan dan \nnomenklatur jabatan terbaru; 2. Melaksanakan \npemetaan kompetensi secara menyeluruh dan \ndiperbarui secara berkala; 3. Melakukan \npemetaan talenta untuk seluruh pegawai; 4. \nMenyusun strategi pengembangan kompetensi \ndan kinerja jangka panjang (5 tahun); 5. \nMenggunakan hasil assessment sebagai \npertimbangan dalam pengisian Jabatan \nAdministrator dan Pengawas secara konsisten; 6. \nMelaksanakan strategi yang telah disusun untuk \nmengatasi permasalahan kinerja pegawai.</span>', '0000-00-00 00:00:00', 0),
	('20240071_K020240901', 71, 3, 1, 1, '2024', 'K020240901', '84,31', 1.6862, 84.31, 15, 0.02, NULL, 1, '2024-11-11 00:25:34', 8, 0, '', '', '<ol><li>revisi dan rancangan JRA agar segera dilakukan pengesahan, sehingga dapat segera dilakukan sosialisasi</li><li>melaksanakan pembinaan pengelolaan arsip desa</li><li>Intensitas pembinaan terutama dalam rangka pengelolaan arsip terjaga dan arsip aset</li><li>segera menyusun guide dan inventaris</li><li>penyusutan arsip yang telah dilaksanakan secara sistemik dan simultan</li><li>meningkatkan dukungan anggaran urusan kearsipan</li><li>peningkatan sumber daya kearsipan, sarana dan prasarana</li></ol>', '0000-00-00 00:00:00', 0),
