	('20240071_K020241102', 71, 3, 1, 1, '2024', 'K020241102', '75,64', 6.4294, 75.64, 28, 0.085, NULL, 1, '2024-10-15 03:45:53', 1, 0, '', '<span data-sheets-root="1" style="font-size: 11pt; font-family: Calibri, Arial;">1. Belum seluruhnya PD melakukan monitoring dan evaluasi terhadapa pelaksanaan rencana aksi ;<br>2.Dokumen IKU pada level PD belum seluruhnya dilengkapi dengan definisi operasional pada masing-masing indikator kinerja;<br>3.Belum semua PD menyajikan capaian kinerja pada laporan kinerja tahun 2023 sesuai dengan dokume PK tahun 2023;<br>4. Belum terlihatnya mekanisme dalam melakukan monev tindaklanjut atas rekomendasi yang diberikan pada LHE AKIP internal seluruh PD.<br><br></span>', '<span data-sheets-root="1" style="font-size: 11pt; font-family: Calibri, Arial;">1. Melalukan review pada dokumen rencana aksi seluruh PD khususnya padi PD yang capaian targetnya pada tahun 2023 tidak seluruhnya 100%;<br>2.Melakukan review dan penyempurnaan pada dokume IKU PD dengan memastikan keterisian setiap indikator kinerja dengan definisi operasional;<br>3.Melakukan review laporan kinerja tahun 2023 pada seluruh PD untuk memastikan capaian kinerja yang disajikan sudah sesuai ;<br>4. Menyusun mekanisme yang dapat digunakan oleh inspektorat Kab. Sidoarjo dalam monitoring dan evaluasi tindak lanjut atas rekomendasi.</span>', '0000-00-00 00:00:00', 0),
