	('20240072_K020240801', 72, 3, 1, 1, '2024', 'K020240801', '3,16', 3.476, 69.52, 20, 0.05, NULL, 1, '2024-07-17 23:32:14', 1, 0, '', '', '', '0000-00-00 00:00:00', 0),
	('20240072_K020240802', 72, 3, 1, 1, '2024', 'K020240802', '100', 5, 100, 20, 0.05, NULL, 1, '2024-08-21 22:36:44', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">sangat baik dengan capaian 103,59%</span>', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Agar segera ditetapkan Perkada tentang SOTK pasca penyederhanaan struktur organisasi agar\ndapat ditindaklanjuti ke tahap penyetaraan jabatan dan penyesuaian sistem kerja.</span>', '0000-00-00 00:00:00', 0),
	('20240072_K020240803', 72, 3, 1, 1, '2024', 'K020240803', '3,52', 3.52, 70.4, 20, 0.05, NULL, 1, '2024-10-28 23:04:50', 10, 0, '', '<span style="font-size: 13.3333px;">Kolaborasi SPBE sangat penting untuk pertukaran informasi dan peningkatan kapasitas pengelola SPBE</span>', '<span style="font-size: 13.3333px;">Agar melakukan reviu dan evaluasi secara berkelanjutan pada semua domain</span>', '0000-00-00 00:00:00', 0),
	('20240072_K020240804', 72, 3, 1, 1, '2024', 'K020240804', '315', 3.8415, 76.83, 20, 0.05, NULL, 1, '2024-08-01 02:00:15', 1, 0, '', '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">1. Menyusun SKJ (Manajerial, Sosial Kultural,\ndan Teknis) untuk jabatan selain JPT dan\nJabatan Administrator; 2. Melakukan pemetaan kompetensi secara menyeluruh berkala; 3.\nMelakukan pemetaan talenta pada seluruh\npegawai; 4. Menyusun strategi pengembangan\nkompetensi dan kinerja jangka panjang (5\ntahun); 5. Menggunakan hasil assessment\nsebagai pertimbangan dalam pengisian Jabatan\nAdministrator dan Pengawas secara konsisten;\n6. Melakukan penajaman analisis permasalahan\nkinerja dan menyusun strategi yang tepat untuk\nmengatasi permasalahan tersebut.</span>', '0000-00-00 00:00:00', 0),
	('20240072_K020240901', 72, 3, 1, 1, '2024', 'K020240901', '82,67', 1.6534, 82.67, 15, 0.02, NULL, 1, '2024-11-11 00:25:44', 8, 0, '', '', '<div>1. LKD Kabupaten Mojokerto segera menindaklanjuti Kebijakan terkait&nbsp;<span style="font-weight: initial;">SKKAD, Srikandi dan Arsip Terjaga</span></div><div>2. Menambah koleksi arsip statis termasuk menyusun daftar Inventaris dan&nbsp;<span style="font-weight: initial;">Guide Arsip</span></div><div>3. LKD Kabupaten Mojokerto agar melaksanakan pengolahan arsip statis&nbsp;<span style="font-weight: initial;">yang menghasilkan daftar arsip statis yang siap diunggah pada&nbsp;</span><span style="font-weight: initial;">SIKN/JIKN</span></div><div><div style="">4. LKD Kabupaten Mojokerto agar melaksanakan pembinaan tertib arsip&nbsp;<span style="font-weight: initial;">dan penyelamatan arsip sejarah Desa</span></div><div style="">5. Penyusutan arsip agar dilaksanakan secara sistematik dan simultan</div><div style="">6. LKD Kabupaten Mojokerto agar mencanangkan dan menyusun rencana&nbsp;<span style="font-weight: initial;">aksi penerapan GNSTA.</span></div><div style="">7. Peningkatan Sumber Daya Kearsipan, sarana dan prasarana;</div><div style="">8. Pemerintah Kabupaten Mojokerto agar Penambahan Arsiparis baik di&nbsp;<span style="font-weight: initial;">LKD maupun OPD</span></div><div style="">9. LKD Kabupaten Mojokerto agar menyusun Daftar Pencarian Arsip&nbsp;<span style="font-weight: initial;">berdasarkan tata cara dan prosedur yang berlaku</span></div><div style="">10. LKD Kabupaten Mojokerto agar mengajukan arsip statis sebagai Memori&nbsp;<span style="font-weight: initial;">Kolektif Bangsa (MKB)</span></div><div style="">11. Kepala LKD Kabupaten Mojokerto agar mengikuti kompetensi Pejabat&nbsp;<span style="font-weight: initial;">Struktural di bidang kearsipan yang dipersyaratkan</span></div></div><div><span style="font-weight: initial;"><br></span></div>', '0000-00-00 00:00:00', 0),
	('20240072_K020240902', 72, 3, 1, 1, '2024', 'K020240902', '57.21', 2.2884, 57.21, 15, 0.04, NULL, 1, '2024-09-10 23:49:57', 1, 0, '', '', '', '0000-00-00 00:00:00', 0),
	('20240072_K020240903', 72, 3, 1, 1, '2024', 'K020240903', '82,12', 3.6954, 82.12, 15, 0.045, NULL, 1, '2024-10-21 20:50:13', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Penilaian seluruh sampel kebijakan instansi yang dinilai sudah cukup maksimal, hanya saja sebagian dari bukti dukung tidak memiliki relevansi pada jawaban. Penentuan masalah dilakukan dengan mempertimbangkan kelompok sasaran dan implementasi yang dilakukan berorientasi pada masa kini dan masa depan. Walaupun begitu, masih terdapat beberapa bukti yang belum memenuhi relevansi pada jawaban dalam masing-masing dimensi. Kemudian efektivitas dan kebermanfataan kebijakan tidak spesifk dijelaskan.</span>', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Perlu diperhatikan terkait evaluasi dalam hal efektivitas, efsiensi dan  kebermanfaatan kebijakan secara terukur dan untuk mencermati setiap bukti dukung yang diunggah.</span>', '0000-00-00 00:00:00', 0),
	('20240072_K020240904', 72, 3, 1, 1, '2024', 'K020240904', '4', 3.6, 80, 15, 0.045, NULL, 1, '2024-07-29 01:29:28', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">segera melakukan perbaikan dan pengembangan proses bisnis dan/atau penyesuaian Standar Operasional Prosedur (SOP)</span>', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Segera melakukan perbaikan dan pengembangan proses bisnis dan/atau penyesuaian Standar Operasional Prosedur (SOP)</span>', '0000-00-00 00:00:00', 0),
	('20240072_K020241001', 72, 3, 1, 1, '2024', 'K020241001', '77,66', 1.9415, 77.66, 12, 0.025, NULL, 1, '2024-11-20 17:05:40', 10, 0, '', '', '\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p class="MsoNormal">TAHAP I:</p>\n\n<p class="MsoNormal">Agar memenuhi daftar data yang sudah disepakati </p>\n\n\n\n\n\n<style>@font-face\n	{font-family:"Cambria Math";\n	panose-1:2 4 5 3 5 4 6 3 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:roman;\n	mso-font-pitch:variable;\n	mso-font-signature:-536870145 1107305727 0 0 415 0;}@font-face\n	{font-family:Calibri;\n	panose-1:2 15 5 2 2 2 4 3 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:swiss;\n	mso-font-pitch:variable;\n	mso-font-signature:-536858881 -1073732485 9 0 511 0;}p.MsoNormal, li.MsoNormal, div.MsoNormal\n	{mso-style-unhide:no;\n	mso-style-qformat:yes;\n	mso-style-parent:"";\n	margin:0cm;\n	mso-pagination:widow-orphan;\n	font-size:12.0pt;\n	font-family:"Calibri",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:Calibri;\n	mso-fareast-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:"Times New Roman";\n	mso-bidi-theme-font:minor-bidi;\n	mso-font-kerning:1.0pt;\n	mso-ligatures:standardcontextual;}.MsoChpDefault\n	{mso-style-type:export-only;\n	mso-default-props:yes;\n	font-family:"Calibri",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:Calibri;\n	mso-fareast-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:"Times New Roman";\n	mso-bidi-theme-font:minor-bidi;}div.WordSection1\n	{page:WordSection1;}</style>', '0000-00-00 00:00:00', 0),
