	('20240072_K020241102', 72, 3, 1, 1, '2024', 'K020241102', '74,42', 6.3257, 74.42, 28, 0.085, NULL, 1, '2024-10-15 03:43:27', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve;">1. KInerja yang ditetapkan pada dokumen perencanaan jangka menengah/tahunan belum sepenuhnya disertai indikator yang memenuhi kriteria SMART;\n2. Dokumen IKU formal di level kabupaten dan sebagian PD belum dilengkapi dengan detail informasi;\n3. Belum sepenuhnya laporan kinerja yang disusun memiliki kelengkapan informasi yang sama dengan kriteria yang ada pada PermenPANRB no. 53 Tahun 2014;\n4. Belum sepenuhnya rekomendasi pada LHE AKIP Internal yang disampaikan ditindaklanjuti sepenuhnya oleh PD</span><br>', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve;">1. Memastikan kembali kinerja strategis yang ditetapkan lebih berorientasi hasil yang disertai dengan indikaotr kinerja SMART;\n2. Menyempurnakan kualitas IKU dengan dilengkapi detail informasi;\n3. Memastikan seluruh laporan kinerja yang disusun sesuai dengan kriteria yang mengacu pada PermenPANRB no. 53 Tahun 2014;\n4. Memastikan keselarasan catatan dan rekomendasi pada laporan hasil evaluasi</span><br>', '0000-00-00 00:00:00', 0),
