	('20240072_K020241202', 72, 3, 1, 1, '2024', 'K020241202', '64,6', 1.615, 64.6, 10, 0.025, NULL, 1, '2024-07-01 02:23:07', 1, 0, '', '<span style="line-height: 107%; font-family: Arial, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">Nilai terendah terdapat pada nilai adaptif\ndengan turunan nilai / perilaku berupa siap menghadapi ketidakpastian</span> dan\nantusias', '<span style="line-height: 107%; font-family: Arial, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">Pemerintah Kabupaten Mojokerto dapat melakukan tujuh\ntahapan penguatan budaya kerja ASN BerAKHLAK yaitu : 1) Internalisasi, 2)\nPenyelarasan Sistem, 3) Pengukuran Baseline, 4) Penyusunan dan Implementasi\nAgenda Perubahan, 5) Pemantauan dan Evaluasi, 6) Penghargaan dan Apresiasi,\nserta 7) Penguatan Secara Berkelanjutan</span>', '0000-00-00 00:00:00', 0),
