	('20240073_K020240802', 73, 3, 1, 1, '2024', 'K020240802', '97,16', 4.858, 97.16, 20, 0.05, NULL, 1, '2024-08-21 22:25:15', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">baik</span>', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Agar Perkada tentang SOTK mempedomani model penyederhanaan struktur organisasi untuk penyederhanaan birokrasi yang telah ditetapkan oleh MenpanRB sesuai surat MenpanRB Nomor B/467/KT.01/2021 tanggal 27 Mei 2021 Hal Rekomendasi Kebijakan Penyederhanaan Struktur Organisasi Perangkat Daerah di Lingkungan Pemerintah Daerah Provinsi dan Kabupaten/Kota. Tindaklanjut mekanisme penyederhanaan struktur organisasi saat ini agar berkoordinasi dengan KemenpanRB.</span>', '0000-00-00 00:00:00', 0),
	('20240073_K020240803', 73, 3, 1, 1, '2024', 'K020240803', '3,49', 3.49, 69.8, 20, 0.05, NULL, 1, '2024-10-28 23:04:18', 10, 0, '', '<span style="font-size: 13.3333px;">Kolaborasi SPBE sangat penting untuk pertukaran informasi dan peningkatan kapasitas pengelola SPBE</span>', '<span style="font-size: 13.3333px;">Agar melakukan reviu dan evaluasi secara berkelanjutan pada semua domain</span>', '0000-00-00 00:00:00', 0),
	('20240073_K020240804', 73, 3, 1, 1, '2024', 'K020240804', '312', 3.805, 76.1, 20, 0.05, NULL, 1, '2024-08-01 01:59:06', 1, 0, '', '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">1) Memperluas pelaksanaan penilaian\nkompetensi untuk seluruh pegawai; 2)\nMengembangan pembangunan talent pool\ndan rencana suksesi untuk seluruh pegawai\nsesuai Peraturan Menteri PANRB No. 3 Tahun\n2020 tentang Manajemen Talenta; 3)\nMenyusun program pengembangan\nkompetensi sesuai dengan analisis\nkesenjangan pegawai untuk jangka panjang;\n4) Mengimplementasikan kebijakan pola\nkarir dan pengisian jabatan dengan mengacu\npada pada talent pool dan rencana suksesi\n(Manajemen Talenta) yang telah disusun; 5)\nMengevaluasi atas strategi yang telah\ndilaksanakan untuk mengatasi permasalahan\nkinerja pegawai.</span>', '0000-00-00 00:00:00', 0),
