	('20240073_K020241102', 73, 3, 1, 1, '2024', 'K020241102', '72,33', 6.14805, 72.33, 28, 0.085, NULL, 1, '2024-10-15 03:41:54', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve;">1. Masih ditemukan kondisi kinerja yang belum berorientasi hasil dan belum dilengkapi dengan indikator yang relevan;\n2. Perhitungan Tambahan Penghasilan Pegawai masih dilakukan secara manual;\n3. Terdapat ketidakselarasan antar data kinerja pada laporan kinerja yang disusun, sehingga diperoleh data yang berbeda antar kinerja;\n4. Belum seluruh PD menindaklanjuti catatan dan rekomendasi evaluasi internal tahun sebelumnya</span><br>', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve;">1. Melakukan reviu seluruh kinerja jangka tahunan agar berorientasi hasil dan dilengkap dengan indikator yang relevan;\n2. Memanfaatkan teknologi informasi dan komunikasi dalam melakukan rekapitulasi perhitungan Tambahan Penghasilan Pegawai;\n3. Terus melanjutkan proses integrasi pengukuran kinerja baik tingkat organisasi dan pegawai sehingga tergambar keterkaitan kinerja pegawai dengan organisasi;\n4. Mendorong hasil evaluasi akuntabilitas kinerja untuk dapat dimanfaatkan dalam peningkatan pencapaian target kinerja</span><br>', '0000-00-00 00:00:00', 0),
