	('20240074_K020240803', 74, 3, 1, 1, '2024', 'K020240803', '3,62', 3.62, 72.4, 20, 0.05, NULL, 1, '2024-10-28 23:04:54', 10, 0, '', '<span style="font-size: 13.3333px;">Kolaborasi SPBE sangat penting untuk pertukaran informasi dan peningkatan kapasitas pengelola SPBE</span>', '<span style="font-size: 13.3333px;">Agar melakukan reviu dan evaluasi secara berkelanjutan pada semua domain</span>', '0000-00-00 00:00:00', 0),
	('20240074_K020240804', 74, 3, 1, 1, '2024', 'K020240804', '260', 3.1705, 63.41, 20, 0.05, NULL, 1, '2024-08-01 02:00:26', 1, 0, '', '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">1) Memperluas pelaksanaan penilaian kompetensi untuk seluruh pegawai\ndan dipetakan untuk menjadi dasar penyusunan talent pool sesuai Peraturan\nMenteri PANRB No. 3 Tahun 2020 tentang Manajemen Talenta; 2)\nMelengkapi analisis kesenjangan kompetensi perindividu pegawai\nberdasarkan hasil assessment; 3) Menyusun analisis kesenjangan kinerja\nuntuk setiap pegawai yang diperbaharui secara berkala; 4) Menyusun dan\nmelaksanakan program peningkatan kompetensi secara terjadwal baik\nklasikal (Diklat dan/atau pelatihan) ataupun non-klasikal (Praktik Kerja, Magang, Coaching, Mentoring) yang disesuaikan dengan analisis\nkesenjangan masing-masing pegawai; 5) Menyusun kebijakan internal\ntentang pengisian jabatan (JPT, Administrator dan Pengawas) dengan\nmengacu pada pada talent pool dan rencana suksesi (Manajemen Talenta);\n6) Menganalisis permasalahan kinerja pegawai secara terstruktur dan\nmengevaluasi atas strategi yang telah diberikan untuk mengatasi\npermasalahan kinerja pegawai.</span>', '0000-00-00 00:00:00', 0),
	('20240074_K020240901', 74, 3, 1, 1, '2024', 'K020240901', '84,63', 1.6926, 84.63, 15, 0.02, NULL, 1, '2024-11-11 00:25:43', 8, 0, '', '', '1. Agar melaksanakan:<div><div>a. Penyusunan Peraturan Daerah tentang Penyelenggaraan Kearsipan</div><div>b.Sosialisasi kebijakan ke seluruh Perangkat Daerah dan</div><div>Dea/Kelurahan.</div><div>c. Kegiatan sosialiasi kearsipan agar dilakukan terhadap perusahaan</div><div>swasta, organisasi massa/politik, dan perorangan;</div><div>2.&nbsp;<span style="font-weight: initial;">Melaksanakan pembinaan kearsipan kepada:</span></div><div>a. Perusahan swasta, organisasi kemasyarakatan dan politik, dan&nbsp;<span style="font-weight: initial;">BUMDes terkait pengelolaan dan penyelamatan arsip dinamis dan</span><span style="font-weight: initial;">statis.</span></div><div>&nbsp;b. Pemerintahan Desa, terkait pembinaan dan penelusuran arsip&nbsp;<span style="font-weight: initial;">Sejarah Desa.</span></div><div>3. Meningkatkan pelaksanaan pengelolaan arsip Perangkat Daerah untuk&nbsp;<span style="font-weight: initial;">arsip yang beretensi sekurangnya 10 tahun dan kegiatan penyusutan</span></div><div>arsip inaktif secara rutin.</div></div>', '0000-00-00 00:00:00', 0),
