	('20240074_K020241102', 74, 3, 1, 1, '2024', 'K020241102', '70,07', 5.95595, 70.07, 28, 0.085, NULL, 1, '2024-10-15 03:43:40', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve;">1. Implementasi pohon kinerja belum sepenuhnya dimanfaatkan ke dalam perencanaan kinerja;\n2. Hasil pengukuran kinerja berjenjang yang telah dilakukan belum digunakan sebagai dasar pemberian reward and punishment;\n3. Belum maksimalnya pemanfaatan laporan kinerja;\n4. Belum terlihat adanya mekanisme dalam melakukan monitoring dan evaluasi tindak lanjut atas rekomendasi yang diberikan pada LHE AKIP internal seluruh Perangkat Daerah</span><br>', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve;">1. Mengoptimalkan pemanfaatan pohon kinerja baik pada level pemerintah daerah yang telah disusun ke dalam perencanaan kinerja;\n2. Mengoptimalkan pemanfaatan hasil pengukuran kinerja berjenjang untuk dijadikan sebagai dasar pemberian reward and punishment dan juga sebagai baukti tumbuhnya budaya kinerja yang baik;\n3. Mengoptimalkan pemanfaatan laporan kinerja untuk dijadikan dasar penetapan strategi/aktivitas dan penetapan target kinerja pada perencanaan kinerja tahun depan;\n4. Menyusun mekanisme yang dapat digunakan oleh Inspektorat/APIP dalam monitoring dan evaluasi tindak lanjut atas rekomendasi yang telah diberikan kepada seluruh PD</span><br>', '0000-00-00 00:00:00', 0),
