	('20240075_K020240801', 75, 3, 1, 1, '2024', 'K020240801', '3,30', 3.63, 72.6, 20, 0.05, NULL, 1, '2024-07-17 23:30:59', 1, 0, '', '', '', '0000-00-00 00:00:00', 0),
	('20240075_K020240802', 75, 3, 1, 1, '2024', 'K020240802', '100', 5, 100, 20, 0.05, NULL, 1, '2024-08-21 22:34:33', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Sangat Baik dengan capaian 101,17%</span>', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Agar segera ditetapkan Perkada tentang SOTK pasca penyederhanaan struktur organisasi\nagar dapat ditindaklanjuti ke tahap penyetaraan jabatan dan penyesuaian sistem kerja.</span>', '0000-00-00 00:00:00', 0),
	('20240075_K020240803', 75, 3, 1, 1, '2024', 'K020240803', '4,3', 4.3, 86, 20, 0.05, NULL, 1, '2024-10-28 23:04:38', 10, 0, '', '<span style="font-size: 13.3333px;">Kolaborasi SPBE sangat penting untuk pertukaran informasi dan peningkatan kapasitas pengelola SPBE</span>', '<span style="font-size: 13.3333px;">Agar melakukan reviu dan evaluasi secara berkelanjutan pada semua domain</span>', '0000-00-00 00:00:00', 0),
	('20240075_K020240804', 75, 3, 1, 1, '2024', 'K020240804', '299,5', 3.6525, 73.05, 20, 0.05, NULL, 1, '2024-08-01 01:59:49', 1, 0, '', '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">1. Menyusun dan menetapkan SKJ untuk\njenjang jabatan pelaksana nomenklatur baru\n(dengan mendapatkan validasi dari\nKementerian PANRB); 2. Melakukan pemetaan\nkompetensi secara merata untuk seluruh\npegawai dan diperbarui secara berkala; 3.\nMelakukan pemetaan talenta pada seluruh\npegawai; 4. Menyusun strategi pengembangan\nkompetensi dan kinerja jangka panjang (5\ntahun); 5. Menggunakan hasil assessment\nsebagai pertimbangan dalam pengisian\nJabatan Administrator dan Pengawas secara\nkonsisten; 6. Menyusun analisis permasalahan\nkinerja secara terstruktur dan menentukan\nstrategi yang tepat untuk mengatasi\npermasalahan tersebut.</span>', '0000-00-00 00:00:00', 0),
	('20240075_K020240901', 75, 3, 1, 1, '2024', 'K020240901', '73,93', 1.4786, 73.93, 15, 0.02, NULL, 1, '2024-11-11 00:25:46', 8, 0, '', '', '<ol><li>revisi dan rancangan JRA agar segera dilakukan pengesahan sehingga dapat segera dilskukan sosialisasi</li><li>melaksanakan pembinaan pengelolaan arsip desa</li><li>Intensitas pembinaan terutama dalam rangka pengelolaan arsip terjaga dan arsip aset</li><li>segera menyusun guide arsip statis dan inventaris arsip statis</li><li>penyusutan arsip yang telah dilaksanakan secara sistemik dan simultan</li><li>meningkatkan dukungan anggaran urusan kearsipan</li><li>Peningkatan Sumber Daya Kearsipan, sarana dan prasarana</li></ol>', '0000-00-00 00:00:00', 0),
