	('20240075_K020240904', 75, 3, 1, 1, '2024', 'K020240904', '3', 2.7, 60, 15, 0.045, NULL, 1, '2024-07-29 01:21:57', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Segera ditetapkan squad tim</span>', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Segera ditetapkan squad tim</span>', '0000-00-00 00:00:00', 0),
	('20240075_K020241001', 75, 3, 1, 1, '2024', 'K020241001', '77,48', 1.937, 77.48, 12, 0.025, NULL, 1, '2024-11-20 17:05:21', 10, 0, '', '\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p class="MsoNormal">TAHAP I:</p>\n\n<p class="MsoNormal">JUDUL DATA; Dari 47 data terdapat 40 data yang judulnya sudah\nsesuai kesepakatan dan 7 data yang judulnya tidak sesuai kesepakatan<br></p>\n\n<p class="MsoNormal">KESESUAIAN PERIODE; Dari 47 data terdapat 37 data yang\nperiodenya sudah sesuai kesepakatan dan 10 data periodenya tidak sesuai kesepakatan<br></p>\n\n<p class="MsoNormal">KESESUAIAN TABULASI; Dari 47 data terdapat 2 data yang\ntabulasinya sudah sesuai kesepakatan dan 45 data tabulasinya tidak sesuai\nkesepakatan<br></p>\n\n<p class="MsoNormal">KETERISIAN DATA</p>\n\n<p class="MsoNormal">Dari 74 keterisian data, tahun 2022 diisi sebanyak 57 data\ndan tahun 2023 diisi sebanyak 52 data</p>\n\n\n\n\n\n<style>@font-face\n	{font-family:"Cambria Math";\n	panose-1:2 4 5 3 5 4 6 3 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:roman;\n	mso-font-pitch:variable;\n	mso-font-signature:-536870145 1107305727 0 0 415 0;}@font-face\n	{font-family:Calibri;\n	panose-1:2 15 5 2 2 2 4 3 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:swiss;\n	mso-font-pitch:variable;\n	mso-font-signature:-536858881 -1073732485 9 0 511 0;}p.MsoNormal, li.MsoNormal, div.MsoNormal\n	{mso-style-unhide:no;\n	mso-style-qformat:yes;\n	mso-style-parent:"";\n	margin:0cm;\n	mso-pagination:widow-orphan;\n	font-size:12.0pt;\n	font-family:"Calibri",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:Calibri;\n	mso-fareast-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:"Times New Roman";\n	mso-bidi-theme-font:minor-bidi;\n	mso-font-kerning:1.0pt;\n	mso-ligatures:standardcontextual;}.MsoChpDefault\n	{mso-style-type:export-only;\n	mso-default-props:yes;\n	font-family:"Calibri",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:Calibri;\n	mso-fareast-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:"Times New Roman";\n	mso-bidi-theme-font:minor-bidi;}div.WordSection1\n	{page:WordSection1;}</style>', '\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p class="MsoNormal">TAHAP I:</p>\n\n<p class="MsoNormal">Agar memenuhi daftar data yang sudah disepakati </p>\n\n\n\n\n\n<style>@font-face\n	{font-family:"Cambria Math";\n	panose-1:2 4 5 3 5 4 6 3 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:roman;\n	mso-font-pitch:variable;\n	mso-font-signature:-536870145 1107305727 0 0 415 0;}@font-face\n	{font-family:Calibri;\n	panose-1:2 15 5 2 2 2 4 3 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:swiss;\n	mso-font-pitch:variable;\n	mso-font-signature:-536858881 -1073732485 9 0 511 0;}p.MsoNormal, li.MsoNormal, div.MsoNormal\n	{mso-style-unhide:no;\n	mso-style-qformat:yes;\n	mso-style-parent:"";\n	margin:0cm;\n	mso-pagination:widow-orphan;\n	font-size:12.0pt;\n	font-family:"Calibri",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:Calibri;\n	mso-fareast-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:"Times New Roman";\n	mso-bidi-theme-font:minor-bidi;\n	mso-font-kerning:1.0pt;\n	mso-ligatures:standardcontextual;}.MsoChpDefault\n	{mso-style-type:export-only;\n	mso-default-props:yes;\n	font-family:"Calibri",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:Calibri;\n	mso-fareast-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:"Times New Roman";\n	mso-bidi-theme-font:minor-bidi;}div.WordSection1\n	{page:WordSection1;}</style>', '0000-00-00 00:00:00', 0),
	('20240075_K020241002', 75, 3, 1, 1, '2024', 'K020241002', '83,24', 2.081, 83.24, 12, 0.025, NULL, 1, '2024-10-12 18:02:59', 10, 0, '', '<div><span style="font-size: 13.3333px;">Tidak mengikuti Monev Tahun 2023</span></div>', '<span style="font-size: 13.3333px;">Monev Ki Jatim selanjutnya agar mengirimkan SAQ sesuai dengan instrumen yang ditetapkan</span>', '0000-00-00 00:00:00', 0),
