	('20240076_K020240903', 76, 3, 1, 1, '2024', 'K020240903', '68.94', 3.1023, 68.94, 15, 0.045, NULL, 1, '2024-10-21 20:48:39', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;"> Hasil penilaian seluruh sampel kebijakan instansi yang dinilai, untuk progress\ninput kebijakan sudah baik, dimana enumerator menjawab semua pertanyaan dan melampirkan bukti jawaban dengan tepat waktu walaupun masih banyak\njawaban dan bukti jawaban yang belum relevan. Proses agenda setting kebijakan sudah baik dan relevan antara jawaban dan bukti dukung. Kebijakan\nmemenuhi kebutuhan stakeholder dan mempertimbangkan lingkungan eksternal kebijakan. Evaluasi kebijakan masih banyak yang belum relevan antara jawaban dan bukti jawaban.</span>', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Dalam tahap evaluasi kebijakan untuk mendapatkan hasil penilaian yang lebih baik perlu dilampirkan bukti jawaban yang relevan antara jawaban dengan bukti yang bisa mendukung jawaban tersebut karena tahap evaluasi berguna untuk mengukur sejauh mana kebijakan dapat bermanfaat bagi stakeholder terkait dan masyarakat.</span>', '0000-00-00 00:00:00', 0),
