	('20240077_K020241102', 77, 3, 1, 1, '2024', 'K020241102', '83,06', 7.0601, 83.06, 28, 0.085, NULL, 1, '2024-10-15 03:44:11', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve;">1. Penjabaran kinerja belum sepenuhnya menggambarkan kerangka logis dalam mencapai kinerja;\n2. Sebagian besar dokumen IKU PD belum memberikan informasi yang lengkap;\n3. Laporan kinerja belum dimanfaatkan dengan baik sebagai dasar dalam perbaikan kinerja ke depan;\n4. Informasi pada Laporan hasil evaluasi akuntabilitas kinerja belum sepenuhnya memberikan peningkatan kualitas AKIP di PD</span>', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve;">1. Menyempurnakan proses penjabaran kinerja dengan berpedoman pada prinsip-prinsip penyusunan yang ada dalam PermenPANRB no. 89 tahun 2021;\n2. Meningkatkan kualitas dokumen IKU seluruh PD dengan memberikan informasi yang lengkap, detail dan spesifik;\n3. Meningkatkan kualitas laporan kinerja seluruh PD dengan menyajikan informasi yang detail dan spesifik serta analisis yang mendalam;\n4. Mendorong seluruh PD agar benar-benar menindaklanjuti hasil evaluasi AKIP dengan menyusun rencana aksi yang memuat langkah-langkah perbaikan nyata\n</span><div><span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve;"><br></span></div>', '0000-00-00 00:00:00', 0),
