	('20240078_K020241102', 78, 3, 1, 1, '2024', 'K020241102', '74,02', 6.2917, 74.02, 28, 0.085, NULL, 1, '2024-10-15 03:40:59', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve;">1. Masih ditemukan beberapa penetapan target kinerja pada level pemerintah daerah dan perangkat daerag belum sepenuhnya ditetapkan secara realistis, karena masih ditemukan beberapa target kinerja tahun sebelumnya;\n2. Hasil pengukuran kinerja berjenjang yang telah dilakukan belum sepenuhnya digunakan sebagai dasar perbaikan strategi, kebijakan, aktivitas dan anggaran guna mencapai kinerja yang telah ditetapkan;\n3. Belum maksimalnya pemanfaatan laporan kinerja, khususnya pada level perangkat daerah untuk dijadikan dasar penetapan strategi atau aktivitas dan penetapan target kinerja pada perencanaan kinerja tahun depan;\n4. Laporan hasil evaluasi akuntabilitas kinerja internal yang disusun belum sepenuhnya berkualitas</span><br>', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve; text-decoration-skip-ink: none;">1. Memastikan kembali penetapan sasaran strategis pada level pemerintah daerah untuk lebih berorientasi </span><span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve; font-style: italic; text-decoration-skip-ink: none;">outcome </span><span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve; text-decoration-skip-ink: none;">sesuai dengan levelnya sehingga dampak kondisi kinerja yang ditetapkan dapat menjawab isu strategis yang ada pada pemerintah daerah dan dapat dirasakan dampaknya secara langsung oleh masyarakat;\n2. Mengoptimalkan pemanfaatan hasil pengukuran kinerja berjenjang untuk dijadikan sebagai dasar perbaikan strategi, kebijakan, aktivitas dan anggaran guna mencapai kinerja yang telah ditetapkan;\n3. Mengoptimalkan pemanfaatan laporan kinerja, khususnya pada level perangkat daerah untuk dijadikan dasar penetapan strategi atau aktivitas dan penetapan target kinerja pada perencanaan kinerja tahun depan;\n4. Mendorong adanya pemanfaatan hasil evaluasi SAKIP internal untuk dijadikan dasar pemberian </span><span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve; font-style: italic; text-decoration-skip-ink: none;">reward </span><span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve; text-decoration-skip-ink: none;">dan </span><span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve; font-style: italic; text-decoration-skip-ink: none;">punishment </span><span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve; text-decoration-skip-ink: none;">sehingga akan mendorong terciptanya budaya kinerja di lingkungan Pemerintah Kabupaten Bojonegoro</span>', '0000-00-00 00:00:00', 0),
