	('20240079_K020241001', 79, 3, 1, 1, '2024', 'K020241001', '57,62', 1.4405, 57.62, 12, 0.025, NULL, 1, '2024-11-20 17:07:13', 10, 0, '', '\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p class="MsoNormal">TAHAP I:</p>\n\n<p class="MsoNormal">JUDUL DATA; Dari 47 data terdapat 45 data yang judulnya sudah\nsesuai kesepakatan dan 2 data\nyang belum diinput</p>\n\n<p class="MsoNormal">KESESUAIAN PERIODE; Dari 47 data terdapat 26 data yang\nperiodenya sudah sesuai kesepakatan dan 21 data periodenya tidak sesuai kesepakatan<br></p>\n\n<p class="MsoNormal">KESESUAIAN TABULASI; Dari 47 data terdapat 30 data yang\ntabulasinya sudah sesuai kesepakatan dan 17 data tabulasinya tidak sesuai\nkesepakatan <br></p>\n\n<p class="MsoNormal">KETERISIAN DATA</p>\n\n<p class="MsoNormal">Dari 74 keterisian data, tahun 2022 diisi sebanyak 49 data\ndan tahun 2023 diisi sebanyak 17 data</p>\n\n\n\n\n\n<style>@font-face\n	{font-family:"Cambria Math";\n	panose-1:2 4 5 3 5 4 6 3 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:roman;\n	mso-font-pitch:variable;\n	mso-font-signature:-536870145 1107305727 0 0 415 0;}@font-face\n	{font-family:Calibri;\n	panose-1:2 15 5 2 2 2 4 3 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:swiss;\n	mso-font-pitch:variable;\n	mso-font-signature:-536858881 -1073732485 9 0 511 0;}p.MsoNormal, li.MsoNormal, div.MsoNormal\n	{mso-style-unhide:no;\n	mso-style-qformat:yes;\n	mso-style-parent:"";\n	margin:0cm;\n	mso-pagination:widow-orphan;\n	font-size:12.0pt;\n	font-family:"Calibri",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:Calibri;\n	mso-fareast-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:"Times New Roman";\n	mso-bidi-theme-font:minor-bidi;\n	mso-font-kerning:1.0pt;\n	mso-ligatures:standardcontextual;}.MsoChpDefault\n	{mso-style-type:export-only;\n	mso-default-props:yes;\n	font-family:"Calibri",sans-serif;\n	mso-ascii-font-family:Ca