	('20240079_K020241002', 79, 3, 1, 1, '2024', 'K020241002', '73,20', 1.83, 73.2, 12, 0.025, NULL, 1, '2024-10-12 18:53:28', 10, 0, '', '<div><span style="font-size: 13.3333px;">Hasil Monev Tahun 2023 dan&nbsp;</span><span style="font-size: 13.3333px; font-weight: initial;">Hasil Karya Laman Web dan Media Sosial kurang maksimal</span></div>', '<div><span style="font-size: 13.3333px;">Monev Ki Jatim selanjutnya agar mengirimkan SAQ sesuai dengan instrumen yang ditetapkan</span></div><div><span style="font-size: 13.3333px;">Agar hasil karya laman web dan media sosial yang dikirim ke JPRA selanjutnya lebih baik lagi</span></div>', '0000-00-00 00:00:00', 0),
	('20240079_K020241003', 79, 3, 1, 1, '2024', 'K020241003', '64,78', 4.5346, 64.78, 12, 0.07, NULL, 1, '2024-07-17 21:40:30', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Cukup</span>', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Perlu ada upaya untuk mendorong pemanfaatan sistem pengadaan mulai dari perencanaan hingga realisasi pengadaan (transaksional dan pencatatan) dan keterisian Formasi Jabatan\nFungsional Pengelola Pengadaan Barang/Jasa.</span>', '0000-00-00 00:00:00', 0),
