	('20240079_K020241102', 79, 3, 1, 1, '2024', 'K020241102', '80,13', 6.81105, 80.13, 28, 0.085, NULL, 1, '2024-10-15 23:16:10', 1, 0, '', '<span data-sheets-root="1" style="font-size: 11pt; font-family: Calibri, Arial;">1, Penerjemahan pohon kinerja ke dalam perencanaan kinerja belum sepenuhnya berkualitas ;<br>2. Masih belum optimalnya pemanfaatan hasil pengukuran kinerja sebagai dasar perbaikan strategi, kebijakan, aktivitas dan penganggaran :<br>3. Masih ditemukan beberapa pencapaian kinerja yang belum mengakomodir upaya perbaikkan ke depan pada pencapaian kinerjannya ;<br>4. Temuan rekomendasi yang diberikan belum terkait dengan pemberian nilai per komponen evaluasi AKIP internal.<br></span>', '<span data-sheets-root="1" style="font-size: 11pt; font-family: Calibri, Arial;">1. Mendorong perbaikan pada pelaksanaan identifikasi crosscuing di pohon kinerja level PD diharapkan tidak hanya menyebutkan unit kerja tapi juga peran spesifik ;<br>2. Mengoptimalkan pemanfaatan hasil pengukuran kinerja sebagai dasar perbaikan strategi, kebijakan, aktivitas dan penganggaran untuk menjaga pencapaian target kinerja yang ditetapkan;<br>3. Meningkatkan kualitas LPPD dengan cara memastikan pencapaian kinerja yang dijanjikan telah memiliki analisis, khususnya upaya perbaikan ke depan pada pencapaian kinerjanya;<br>4. Mengoptimalkan pelaksanaan evaluasi inernl dengan menyampaikan laporan hasil evaluasi yang menyajikan temuan dan rekomendasi yang sesuai dengan gambaran penilaian per komponen AKIP internal sehingga perbaikan pelaksanaan SAKIP di PD lebih optimal.</span><br>', '0000-00-00 00:00:00', 0),
