	('20240080_K020240804', 80, 3, 1, 1, '2024', 'K020240804', '300.5', 3.6645, 73.29, 20, 0.05, NULL, 1, '2024-08-01 01:58:46', 1, 0, '', '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">1. Menetapkan seluruh SKJ yang telah disusun dan\nmendapatkan validasi dari Kementerian PANRB; 2.\nMelakukan pemetaan kompetensi secara merata\nuntuk seluruh pegawai dan diperbarui secara\nberkala; 3. Melakukan pemetaan talenta pada\nseluruh pegawai; 4. Menyusun strategi\npengembangan kompetensi dan kinerja jangka\npanjang (5 tahun); 5. Menggunakan hasil\nassessment sebagai pertimbangan dalam\npengisian Jabatan Administrator dan Pengawas\nsecara konsisten; 6. Menentukan strategi yang\ntepat untuk mengatasi permasalahan kinerja dan\nmelaksanakan strategi tersebut.</span>', '0000-00-00 00:00:00', 0),
