	('20240080_K020241101', 80, 3, 1, 1, '2024', 'K020241101', 'WTP', 11, 100, 28, 0.11, NULL, 1, '2024-07-18 00:40:18', 1, 0, '', '', '', '0000-00-00 00:00:00', 0),
	('20240080_K020241102', 80, 3, 1, 1, '2024', 'K020241102', '80,60', 6.851, 80.6, 28, 0.085, NULL, 1, '2024-10-15 03:41:26', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve; text-decoration-skip-ink: none;">1. Belum terlihat pemetaan </span><span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve; font-style: italic; text-decoration-skip-ink: none;">crosscutting </span><span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve; text-decoration-skip-ink: none;">antar perangkat daerah pada pohon kinerja pemda, sehingga belum terlihat bagaimana kolaborasi antar perangkat daerah dalam mewujudkan kinerja organisasi;\n2. Aplikasi pengukuran dan monev kinerja Pemkab. Gresik yaitu SIAKRI belum mengakomodir pohon kinerja, sehingga perencanaan kinerja yang ada belum sesuai dengan pohon kinerja/cascading kinerja yang ada;\n3. Informasi kinerja yang telah dituangkan dalam LPPD maupun LAKIP PD belum dimanfaatkan dengan baik, terutama pada proses penentuan target maupun strategi serta aktivitas dalam perencanaan tahunan untuk mendukung pencapian kinerja ke depan;\n4. Laporan hasil evaluasi belum memberikan temuan dan rekomendasi yang cukup serta konkrit sesuai dengan permasalahan utama yang dialami oleh setiap unit kerja dalam implementasi SAKIP</span>', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve; text-decoration-skip-ink: none;">1. Mendorong pemanfaatan pohon kinerja yang telah disusun dengan menuangkannya ke dalam dokumen perencanaan, sehingga keselarasan antara pohon kinerja dan dokumen perencanaan dapat tergambar dengan baik;\n2. Mengembangkan aplikasi pengukuran dan monev kinerja yang sudah ada yaitu SIAKRI agar dapat mengakomodir pohon kinerja, sehingga perencanaan kinerja yang ada dapat selaras dengan pohon kinerja/cascading kinerja yang ada;\n3. Memanfaatkan informasi kinerja yang ada dalam LPPD maupun LAKIP PD sebagai dasar pertimbangan dalam menentukan target, strategi, serta aktivitas dan diharpkan agar dituangkan dalam dokumen perencanaan kedepan sehingga dapat mendukung pencapaian kinerja kedepan, terkhusus kinerja yang memiliki realisasi rendah ditahun sebelumnya;\n4. Mengoptimalkan mekanisme monitoring atas tindak lanjut rekomendasi hasil evaluasi akuntabilitas kinerja internal dengan memastikan inspektorat telah memberikan </span><span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve; font-style: italic; text-decoration-skip-ink: none;">feedback </span><span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve; text-decoration-skip-ink: none;">terhadap rencana aksi tindak lanjut hasil evaluasi yang telah disusun oleh perangkat daerah agar tindak lanjut yang ada telah sesuai dengan apa yang diharapkan oleh Inspektorat</span>', '0000-00-00 00:00:00', 0),
