	('20240081_K020241102', 81, 3, 1, 1, '2024', 'K020241102', '83,18', 7.0703, 83.18, 28, 0.085, NULL, 1, '2024-10-15 03:42:20', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve;">1. Penerjemahan perjenjangan kinerja ke dalam perencanaan pada beberapa PD belum sepenuhnya optimal;\n2. Aplikasi manajemen kinerja dan aplikasi pengelolaan anggaran belum terintegrasi;\n3. Pemanfaatan informasi dalam laporan kinerja baik untuk Pemda maupun PD belum secara maksimal dilakukan untuk perbaikan perencanaan dan strategi kinerja tahun berikutnya\n4. Hasil evaluasi internal yang dituangkan dalam bentuk laporan hasil evaluasi belum memberikan temuan dan rekomendasi yang cukup</span><br>', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve;">1. Melakukan optimalisasi penerjemahan perjenjangan kinerja ke dalam perencanaan pada setiap PD;\n2. Melakukan integrasi antara aplikasi manajemen kinerja dan aplikasi pengelolaan anggaran untuk memungkinkan pemantauan real time;\n3. Memanfaatkan analisa atas pencapaian target kinerja sebelumnya untuk menentukan target kinerja selanjutnya;\n4. Menorong adanya pemantauan secara berkala atas tindak lanjut rekomendasi hasil evaluasi AKIP pada PD</span><br>', '0000-00-00 00:00:00', 0),
