	('20240082_K020241003', 82, 3, 1, 1, '2024', 'K020241003', '31,12', 2.1784, 31.12, 12, 0.07, NULL, 1, '2024-07-17 20:40:35', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Kurang</span>', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Perlu dilakukan langkah strategis untuk bisa\nmendorong peningkatan tata kelola pengadaan</span>', '0000-00-00 00:00:00', 0),
	('20240082_K020241101', 82, 3, 1, 1, '2024', 'K020241101', 'WTP', 11, 100, 28, 0.11, NULL, 1, '2024-07-18 00:39:36', 1, 0, '', '', '', '0000-00-00 00:00:00', 0),
	('20240082_K020241102', 82, 3, 1, 1, '2024', 'K020241102', '62,14', 5.2819, 62.14, 28, 0.085, NULL, 1, '2024-10-15 03:39:28', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve;">1. Pada RPD Kabupaten Bangkalan Tahun 2024-2026 terdapat sasaran strategis yang masih berupa ouput/proses, yaitu misalnya meningkatnya PPKS yang tertangani;\n2. Aplikasi BANGK AKIP belum digunakan pada pengukuran kinerja pada tahun 2024 baik level Kabupaten maupun Perangkat Daerah. Hal ini terbukti dengan tidak adanya inputan progress capaian kinerja baik secara ulanan maupun triwulan;\n3. Kualitas pengungkapan informasi kinerja yang dituangkan dalam laporan kinerja pada level Perangkat Daerah masih terbatas sehingga belum menghasilkan umpan balik berupa perbaikan atas perencanaan kinerja dan strategi dalam pelaksanaannya\n4. Evaluasi internal yang dilakukan oleh Inspektorat Kabupaten Bangkalan masih sebatas pada aspek keberadaan dan belum mendalam sampai kepada aspek kualitas dan implementasi/pemanfaatan, misalnya pada LHE AKIP Internal DInas Pendidikan</span>', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve;">1. Melakukan reviu dan perbaikan pada dokumen perencanaan pada level Kabupaten maupun Perangkat Daerah untuk memastikan tujuan dan sasaran strategis telah berorientasi pada hasil sehingga dapat menjawab isu-isu strategis di Kabupaten Bangkalan;\n2. Memanfaatkan aplikasi BANGK AKIP dalam melakukan manajemen kinerja khususnya pengukuran kinerja secara berkala yang dilaukan oleh seluruh Perangkat Daerah;\n3. Memastikan data yang disampaikan pada Laporan Kinerja seluruh Perangkat Daerah telah direviu sehingga sumber data valid dan dapat diandalkan;\n4. Mendorong pelaksanaan monitoring secara berkala terkait rekomendasi yang diberikan kepada Perangkat Daerah guna memastikan bahwa tindak lanjut yang dilakukan dalam menjawab rekomendasi tersebut telah sesuai dengan yang diinginkan oleh evaluator internal</span>', '0000-00-00 00:00:00', 0),
	('20240082_K020241103', 82, 3, 1, 1, '2024', 'K020241103', '0,5', 2.805, 33, 28, 0.085, NULL, 1, '2024-08-01 02:35:56', 1, 0, '', 'cukup', '', '0000-00-00 00:00:00', 0),
