	('20240083_K020240803', 83, 3, 1, 1, '2024', 'K020240803', '3,57', 3.57, 71.4, 20, 0.05, NULL, 1, '2024-10-28 23:05:23', 10, 0, '', '<span style="font-size: 13.3333px;">Kolaborasi SPBE sangat penting untuk pertukaran informasi dan peningkatan kapasitas pengelola SPBE</span>', '<span style="font-size: 13.3333px;">Agar melakukan reviu dan evaluasi secara berkelanjutan pada semua domain</span>', '0000-00-00 00:00:00', 0),
	('20240083_K020240804', 83, 3, 1, 1, '2024', 'K020240804', '230.5', 2.811, 56.22, 20, 0.05, NULL, 1, '2024-08-01 02:01:31', 1, 0, '', '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">1. Menyusun SKJ secara lengkap (manajerial,\nsosiokultural, teknis) untuk seluruh jabatan (tidak\nhanya Administrator); 2. Melakukan pemetaan\nkompetensi untuk seluruh pegawai; 3. Melakukan\npemetaan talenta berdasarkan Permenpan\n3/2020; 4. Menyusun strategi pengembangan\nkompetensi dan kinerja jangka panjang (5 tahun);\n5. Melaksanakan pengisian Administrator dan\nPengawas dengan mempertimbangkan hasil\nassessment pegawai; 6. Menyusun analisis\npermasalahan kinerja dan menentukan strategi\nyang tepat untuk mengatasinya.</span>', '0000-00-00 00:00:00', 0),
