	('20240083_K020241001', 83, 3, 1, 1, '2024', 'K020241001', '65,59', 1.63975, 65.59, 12, 0.025, NULL, 1, '2024-11-20 17:06:24', 10, 0, '', '', '\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p class="MsoNormal">TAHAP I:</p>\n\n<p class="MsoNormal">Agar memenuhi daftar data yang sudah disepakati </p>\n\n\n\n\n\n<style>@font-face\n	{font-family:"Cambria Math";\n	panose-1:2 4 5 3 5 4 6 3 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:roman;\n	mso-font-pitch:variable;\n	mso-font-signature:-536870145 1107305727 0 0 415 0;}@font-face\n	{font-family:Calibri;\n	panose-1:2 15 5 2 2 2 4 3 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:swiss;\n	mso-font-pitch:variable;\n	mso-font-signature:-536858881 -1073732485 9 0 511 0;}p.MsoNormal, li.MsoNormal, div.MsoNormal\n	{mso-style-unhide:no;\n	mso-style-qformat:yes;\n	mso-style-parent:"";\n	margin:0cm;\n	mso-pagination:widow-orphan;\n	font-size:12.0pt;\n	font-family:"Calibri",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:Calibri;\n	mso-fareast-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:"Times New Roman";\n	mso-bidi-theme-font:minor-bidi;\n	mso-font-kerning:1.0pt;\n	mso-ligatures:standardcontextual;}.MsoChpDefault\n	{mso-style-type:export-only;\n	mso-default-props:yes;\n	font-family:"Calibri",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:Calibri;\n	mso-fareast-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:"Times New Roman";\n	mso-bidi-theme-font:minor-bidi;}div.WordSection1\n	{page:WordSection1;}</style>', '0000-00-00 00:00:00', 0),
	('20240083_K020241002', 83, 3, 1, 1, '2024', 'K020241002', '31,14', 0.7785, 31.14, 12, 0.025, NULL, 1, '2024-10-12 18:47:07', 10, 0, '', '<div><span style="font-size: 13.3333px; font-weight: initial;">Hasil Karya Laman Web dan Media Sosial kurang maksimal</span><br></div><div><span style="font-size: 13.3333px;">Laman Web PPID kurang sesuai dengan PerKI 1/2021</span></div>', '<div><span style="font-size: 13.3333px;">Monev Ki Jatim selanjutnya agar mengirimkan SAQ sesuai dengan instrumen yang ditetapkan</span></div><div><span style="font-size: 13.3333px;">Agar hasil karya laman web dan media sosial yang dikirim ke JPRA selanjutnya lebih baik lagi&nbsp;</span></div><div><span style="font-size: 13.3333px;">Laman Web PPID agar disesuaikan dengan PerKI 1/2021</span></div><div><br></div>', '0000-00-00 00:00:00', 0),
	('20240083_K020241003', 83, 3, 1, 1, '2024', 'K020241003', '47,45', 3.3215, 47.45, 12, 0.07, NULL, 1, '2024-07-17 21:20:06', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Kurang</span>', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Perlu dilakukan langkah strategis untuk bisa mendorong peningkatan tata kelola pengadaan</span>', '0000-00-00 00:00:00', 0),
	('20240083_K020241101', 83, 3, 1, 1, '2024', 'K020241101', 'WTP', 11, 100, 28, 0.11, NULL, 1, '2024-07-18 00:44:15', 1, 0, '', '', '', '0000-00-00 00:00:00', 0),
	('20240083_K020241102', 83, 3, 1, 1, '2024', 'K020241102', '72,43', 6.15655, 72.43, 28, 0.085, NULL, 1, '2024-10-15 03:38:08', 1, 0, '', '<span data-sheets-root="1" style="font-size: 11pt; font-family: Calibri, Arial;">1. Cascading kinerja yang ditetapkan di tingkat PD belum menjabarkan kinerja dengan baik, terutama pada penetapan kinerja di level eselon II / setingaktnya :<br>2. Belum semua IKU diperjanjikan di tingkat PD dijelaskan dengan baik pada dokumen IKU ;<br>3. Laporan kinerja tingkat Pemda dan PD belum menyajikan informasi dengan baik terkait analisis penyebab keberhasilan/ kegagalan atas pencapaian kinerja ;<br>4. Belum ada informasi atas LHE internal tahun 2024.<br><br></span>', '<span data-sheets-root="1" style="font-size: 11pt; font-family: Calibri, Arial;">1. Mendorong identifikasi kinerja antara (intermediate outcome dan immediate outcome) sebagai upaya penjabaran kinerja utama pada tiap PD dalam menunjang pencapaian kinerja yang optimal ;<br>2. Melakukan perbaikan kualitas penyusunan dokumen IKU dengan memastikan informasi yang disajikan telah memuat definisi operasional dan forumulasi relevan;<br>3. Memastikan informasi laporan kinerja di tingkat pemda atau PD disertai dengan hasil pengukuran data kinerja yang mendukung ;<br>4.Memberikan catatan dan rekomendasi yang spesifik pada setiap PD dan memberikan infromasi konkrit pin perbaikan yang harus ditindaklanjuti dan dituangkan pada LHE PD.</span><br>', '0000-00-00 00:00:00', 0),
	('20240083_K020241103', 83, 3, 1, 1, '2024', 'K020241103', '0,5', 2.805, 33, 28, 0.085, NULL, 1, '2024-08-01 02:40:12', 1, 0, '', 'cukup', '', '0000-00-00 00:00:00', 0),
