	('20240084_K020241102', 84, 3, 1, 1, '2024', 'K020241102', '72,11', 6.12935, 72.11, 28, 0.085, NULL, 1, '2024-10-15 03:44:41', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve;">1. Pemanfaatan pohon kinerja sebagai dasar untuk penyusunan dokumen perencanaan belum dilakukan secara menyeluruh;\n2. Belum terdapat tindak lanjut terhadap penyempurnaan aplikasi monitoring dan evaluasi yang dimiliki;\n3. Penuangan informasi benchmark capaian kinerja dengan membandingkan realisasi belum dilakukan di semua indikator yang bersifat makro;\n4. Monitoring terhdap tindak lanjut rekomendasi hasil evaluasi belum optimal</span><br>', '<span style="font-family: docs-Calibri; font-size: 16px; white-space-collapse: preserve;">1. Mereviu kembali perencanaan kinerja pada seluruh unit kerja;\n2. Menyempurnakan aplikasi monitoring dan evaluasi yang ada agar dapat melakukan monitoring dan evaluasi terhadap ketercapaian kinerja secara berkala dan real time baik di level Pemda maupun PD;\n3. Menginformasikan data benchmark capaian kinerja dengan membandingkan realisasi nasional atas indikator yang bersifat makro;\n4. Mengoptimalkan mekanisme monitoring atas TLHE akuntabilitas kinerja internal </span><br>', '0000-00-00 00:00:00', 0),
