	('20240085_K020241102', 85, 3, 1, 1, '2024', 'K020241102', '70,15', 5.96275, 70.15, 28, 0.085, NULL, 1, '2024-10-15 22:55:25', 1, 0, '', '<span data-sheets-root="1" style="font-size: 11pt; font-family: Calibri, Arial;">1. Ditemukan kinerja yang belum mengeksplorasi alternatif solusi / CSF yang cukup untuk pencapaian kinerja ;<br>2. Hasil monev yang dilakukan belum dimanfaatkan secara optimal sebagai bahan pertimbangan penentuan strategis ;<br>3. Masih ditemukan realisasi kinerja tahun 2023 yang masih kosong karena data belum rilis dari BPS ;<br>4. Masih terdapat PD yang belum menindaklanjuti catatan dan rekomendasi evaluasi internal tahun sebelumnya.</span><br>', '<span data-sheets-root="1" style="font-size: 11pt; font-family: Calibri, Arial;">1. Memastikan pohon kinerja yang menggabarkan hubungan logis secara langsung serta mengeskplorasi CSF ;<br>2. Mendorong hasil monev yang dilakukan sebagai bahan pertimbangan dalam penentuan strategis ;<br>3. Memastikan seluruh indikator dilengkapi dengan realisasi kinerja apabila belum dirilis oleh BPS maka diberi tanda (*) dan menggunakan realisasi tahun sebelumnya ;<br>4. Merumuskan mekanisme monitoring tindal lanjut PD yang efektif terhadap rekomendasi hasil evaluasi AKIP yang telah dilakukan untuk memastikan rekomendasi yang diberikan oleh inspektorat ditindaklanjuti.</span><br>', '0000-00-00 00:00:00', 0),
