	('20240087_K020241102', 87, 3, 1, 1, '2024', 'K020241102', '72,49', 6.16165, 72.49, 28, 0.085, NULL, 1, '2024-10-15 02:13:04', 1, 0, '', '<ol><li><font face="docs-Calibri"><span style="font-size: 13.3333px; white-space-collapse: preserve;">Meskipun sudah dilakukan perbaikan PK, namun masih ditemukan Indikator\nkinerja yang belum relevan dan cukup dalam menjawab kondisi atau sasaran\nstrategis;</span></font></li><li><font face="docs-Calibri"><span style="font-size: 13.3333px; white-space-collapse: preserve;">Formulasi perhitungan atau data yang digunakan untuk mengukur kinerja yang\nbelum sepenuhnya andal untuk mengukur capaian kinerja kondisi yang\ndiharapkan masih ditemukan, khususnya pada PD;</span></font></li><li><font face="docs-Calibri"><span style="font-size: 13.3333px; white-space-collapse: preserve;">Terdapat ketidakselarasan antara narasi dan formulasi perhitungan yang ada\npada laporan kinerja sehingga terdapat perbedaan data;</span></font></li><li><font face="docs-Calibri"><span style="font-size: 13.3333px; white-space-collapse: preserve;">Laporan hasil evaluasi belum sepenuhnya memberikan temuan dan\nrekomendasi yang cukup konkrit pada setiap komponen evaluasi AKIP internal\n(perencanaan kinerja, pengukuran kinerja, pelaporan kinerja dan evaluasi AKIP\ninternal);\n</span></font><div><br></div></li></ol>', '<div><span style="font-size: 13.3333px;">1. Mereviu kembali perencanaan kinerja secara menyeluruh baik level kota atau PD</span></div><div><span style="font-size: 13.3333px;">untuk memastikan sasaran strategis disertai dengan indikator kinerja relevan dan</span></div><div><span style="font-size: 13.3333px;">cukup, sehingga dapat menggambarkan kondisi yang diharapkan;</span></div><div><span style="font-size: 13.3333px;">2. Memastikan formulasi perhitungan atau keandalan data yang digunakan untuk</span></div><div><span style="font-size: 13.3333px;">mengukur kinerja telah sesuai dengan capaian kinerja kondisi yang diharapkan;</span></div><div><span style="font-size: 13.3333px;">3. Memastikan sistem pengukuran kinerja organisasi, yakni aplikasi APKPD dapat</span></div><div><span style="font-size: 13.3333px;">terintegrasi dengan aplikasi PUSDASIP, serta memastikan perumusan kinerja</span></div><div><span style="font-size: 13.3333px;">individu yang ada pada PUSDASIP benar-benar terkait dengan kinerja organisasi,</span></div><div><span style="font-size: 13.3333px;">sehingga dapat dipastikan kinerja individu menunjang kinerja organisasi.</span></div>', '0000-00-00 00:00:00', 0),
