	('20240088_K020240903', 88, 3, 1, 1, '2024', 'K020240903', '69.00', 3.105, 69, 15, 0.045, NULL, 1, '2024-10-21 20:53:34', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Masih kurang maksimal dalam memberikan bukti dukung yang dibutuhkan dan yang relevan dengan jawaban yang diberikan. Kebijakan yang diukur sudah mengedepankan kepentingan kebutuhan kelompok sasaran. Walapun begitu, masih terdapat data dukung untuk seluruh dimensi IKK yang masih belum lengkap untuk dapat memenuhi relevansi dengan seluruh jawaban</span>', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Perlu melengkapi dan menguggah bukti dukung yang relevan dengan jawaban dan\npertanyaan</span>', '0000-00-00 00:00:00', 0),
	('20240088_K020240904', 88, 3, 1, 1, '2024', 'K020240904', '4', 3.6, 80, 15, 0.045, NULL, 1, '2024-07-29 01:57:11', 1, 0, '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Segera melakukan perbaikan dan pengembangan proses bisnis dan/atau penyesuaian Standar Operasional Prosedur (SOP)</span>', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">Segera melakukan perbaikan dan pengembangan proses bisnis dan/atau penyesuaian Standar Operasional Prosedur (SOP)</span>', '0000-00-00 00:00:00', 0),
	('20240088_K020241001', 88, 3, 1, 1, '2024', 'K020241001', '81,84', 2.046, 81.84, 12, 0.025, NULL, 1, '2024-11-20 17:07:10', 10, 0, '', '\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p class="MsoNormal">TAHAP I:</p>\n\n<p class="MsoNormal">JUDUL DATA; Dari 47 data terdapat 47 data yang judulnya sudah\nsesuai kesepakatan<br></p>\n\n<p class="MsoNormal">KESESUAIAN PERIODE; Dari 47 data terdapat 47 data yang\nperiodenya sudah sesuai kesepakatan<br></p>\n\n<p class="MsoNormal">KESESUAIAN TABULASI; Dari 47 data terdapat 46 data yang\ntabulasinya sudah sesuai kesepakatan dan 1 data tabulasinya tidak sesuai\nkesepakatan <br></p>\n\n<p class="MsoNormal">KETERISIAN DATA</p>\n\n<p class="MsoNormal">Dari 74 keterisian data, tahun 2022 diisi sebanyak 40 data\ndan tahun 2023 diisi sebanyak 64 data</p>\n\n\n\n\n\n<style>@font-face\n	{font-family:"Cambria Math";\n	panose-1:2 4 5 3 5 4 6 3 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:roman;\n	mso-font-pitch:variable;\n	mso-font-signature:-536870145 1107305727 0 0 415 0;}@font-face\n	{font-family:Calibri;\n	panose-1:2 15 5 2 2 2 4 3 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:swiss;\n	mso-font-pitch:variable;\n	mso-font-signature:-536858881 -1073732485 9 0 511 0;}p.MsoNormal, li.MsoNormal, div.MsoNormal\n	{mso-style-unhide:no;\n	mso-style-qformat:yes;\n	mso-style-parent:"";\n	margin:0cm;\n	mso-pagination:widow-orphan;\n	font-size:12.0pt;\n	font-family:"Calibri",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:Calibri;\n	mso-fareast-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:"Times New Roman";\n	mso-bidi-theme-font:minor-bidi;\n	mso-font-kerning:1.0pt;\n	mso-ligatures:standardcontextual;}.MsoChpDefault\n	{mso-style-type:export-only;\n	mso-default-props:yes;\n	font-family:"Calibri",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:Calibri;