	('20240088_K020241102', 88, 3, 1, 1, '2024', 'K020241102', '80,06', 6.8051, 80.06, 28, 0.085, NULL, 1, '2024-10-15 02:19:55', 1, 0, '', '<div><font face="docs-Calibri"><span style="font-size: 13.3333px; white-space-collapse: preserve;">1.Penjabaran kinerja yang telah dilakukan belum menginformasikan</span></font></div><div><font face="docs-Calibri"><span style="font-size: 13.3333px; white-space-collapse: preserve;">secara lengkap potensi critical success factor yang memiliki pengaruh</span></font></div><div><font face="docs-Calibri"><span style="font-size: 13.3333px; white-space-collapse: preserve;">kuat dalam mengawal kinerja tiap jenjang;</span></font></div><div><font face="docs-Calibri"><span style="font-size: 13.3333px; white-space-collapse: preserve;">2.Masih terdapat beberapa indikator kinerja yang belum memiliki definisi</span></font></div><div><font face="docs-Calibri"><span style="font-size: 13.3333px; white-space-collapse: preserve;">operasional yang spesifik;</span></font></div><div><font face="docs-Calibri"><span style="font-size: 13.3333px; white-space-collapse: preserve;">3.Informasi dalam laporan kinerja belum sepenuhnya digunakan untuk</span></font></div><div><font face="docs-Calibri"><span style="font-size: 13.3333px; white-space-collapse: preserve;">perbaikan strategi perencanaan kinerja tahun berikutnya, terutama pada</span></font></div><div><font face="docs-Calibri"><span style="font-size: 13.3333px; white-space-collapse: preserve;">capaian kinerja yang belum tercapai sesuai target di tahun sebelumnya;</span></font></div><div><font face="docs-Calibri"><span style="font-size: 13.3333px; white-space-collapse: preserve;">4.Informasi dalam laporan kinerja belum sepenuhnya digunakan untuk</span></font></div><div><font face="docs-Calibri"><span style="font-size: 13.3333px; white-space-collapse: preserve;">perbaikan strategi perencanaan kinerja tahun berikutnya, terutama pada</span></font></div><div><font face="docs-Calibri"><span style="font-size: 13.3333px; white-space-collapse: preserve;">capaian kinerja yang belum tercapai sesuai target di tahun sebelumnya.</span></font></div><div><br></div>', '<div><span style="font-size: 13.3333px;">1. Pemerintah Kota Blitar agar terus melakukan perbaikan terhadap penetapan</span></div><div><span style="font-size: 13.3333px;">target yang dimiliki, baik dalam dokumen perencanaan tahunan maupun</span></div><div><span style="font-size: 13.3333px;">dalam rencana aksi setiap PD ;</span></div><div><span style="font-size: 13.3333px;">2.Pemerintah Kota Blitar agar mereviu dan melakukan penyempurnaan</span></div><div><span style="font-size: 13.3333px;">penjelasan definisi operasional terhadap seluruh indikator kinerja yang dimiliki</span></div><div><span style="font-size: 13.3333px;">sehingga dapat menguatkan keandalan data serta alasan dari penggunaan</span></div><div><span style="font-size: 13.3333px;">indikator kinerja tersebut;</span></div><div><span style="font-size: 13.3333px;">3.Memanfaatkan informasi yang tertuang dalam LPPD maupun laporan kinerja</span></div><div><span style="font-size: 13.3333px;">seluruh PD agar menjadi dasar dalam menetapkan perbaikan strategi</span></div><div><span style="font-size: 13.3333px;">perencanaan kinerja baik pada tahun depan maupun periode perencanaan</span></div><div><span style="font-size: 13.3333px;">jangka menengah berikutnya;</span></div>', '0000-00-00 00:00:00', 0),
