	('20240091_K020241102', 91, 3, 1, 1, '2024', 'K020241102', '76,74', 6.5229, 76.74, 28, 0.085, NULL, 1, '2024-10-14 23:35:31', 1, 0, '', '<ol><li>Belum melakukan identifikasi crosscutting kinerja sebagai bentuk sharing outcome antar PD ;</li><li>Penetapan sasaran strategis belum spesiifk menjelaskan kondisi yang ingin dicapai ;</li><li>Pohon kinerja belum dimanfaatkan sebagai dasar dalam penyusunan dokumen perencanaan ;</li><li>Indikator kinerja masih ada yang belum memenuhi kriteria SMART.</li><li>Belum sepenuhnya indikator kinerja utama disertai dengan definisi operasional :</li><li>Belum maksimalnya pengungkapan informasi kinerja yang dituangkan dalam laporan kinerja ;</li><li>hasil evaluasi internal belum memberikan temua dan rekomendasi yang menyelesaikan akar permasalahan ;</li><li>hasil evaluasi yang dilakukan Inspektorat pada seluruh PD belum memacu perbaikan akuntabilitas secara signifikan.</li></ol>', '<ol><li>melakukan review dan perbaikan penetapan kinerja pada dokumen perencanaan baik PD maupun pemda ;</li><li><span style="font-size: 14px;">melakukan review indikator kinerja yang digunakan untuk mengukur kinerja level Pemda dan PD ;</span><br></li><li><span style="font-size: 14px;">Mendorong pemanfaatan pohon kienrja yang disusun dalam dokumen perencanaan setiap PD.</span></li></ol>', '0000-00-00 00:00:00', 0),
