	('20240094_K020240804', 94, 3, 1, 1, '2024', 'K020240804', '282', 3.439, 68.78, 20, 0.05, NULL, 1, '2024-08-01 02:02:48', 1, 0, '', '', '<span style="font-family: docs-Calibri; font-size: 15px; white-space-collapse: preserve;">1) Memperluas pelaksanaan penilaian\nkompetensi untuk seluruh pegawai; 2)\nMengembangkan dan memastikan secara\nterstruktur komponen pemetaan talenta\npegawai dan rencana suksesi sesuai dengan\nPeraturan Menteri PANRB No. 3 Tahun 2020\ntentang Manajemen Talenta; 3)\nMelaksanakan secara terjadwal dan\nmengevaluasi strategi/program yang telah\ndisusun untuk peningkatkan kompetensi pegawai baik klasikal maupun non klasikal\n(diklat, praktik kerja/magang, coaching,\nmentoring); 4) Melaksanakan pola karir dan\npengisian jabatan dengan mengacu pada\ntalent pool dan rencana suksesi (Manajemen\nTalenta) yang telah disusun; 5) Menyusun\nanalisis permasalahan kinerja perindividu\npegawai serta menyusun strategi untuk\nmengatasi permasalahan tersebut.</span>', '0000-00-00 00:00:00', 0),
