	('20240094_K020241102', 94, 3, 1, 1, '2024', 'K020241102', '66,22', 5.6287, 66.22, 28, 0.085, NULL, 1, '2024-10-15 02:40:08', 1, 0, '', '<ol><li>terdapat perbedaan penetapan nomenklatur perencanaan antar dokumen perencanaan ;</li><li>Hasil monev belum dimanfaatkan secara optimal ;</li><li>informasi dalam laporan kinerja belum sepenuhnya digunakan untuk perbaikan strategi perencanaan kinerja tahun berikutnya ;</li><li>LHE Akip inetnal PD belum memuat berbagai catatn/ temuan yang berhubungan dengan implementasi AKIP di PD</li></ol>', '<ol><li>Melakukan review pada seluruh dokumen perencanaan kinerja yang ditetapkan ;</li><li>Mendorong pemanfaatan hasil monitoring dan evaluasi yang digunakan untuk menjadi masukan dalam menentukan strategi, aktivitas, penyesuaian antara kinerja dan anggaran kedepan ;</li><li>Meningkatkan kualitas LHE AKIP internal dengan memberikan catatan/ temuan yang sehubungan dengan implementasi AKIP di PD.</li></ol>', '0000-00-00 00:00:00', 0),
