	('20240095_C020240302', 95, 3, 1, 1, '2024', 'C020240302', '47.1187', 1.41345, 94.23, 15, 0.015, NULL, 1, '2024-11-06 21:39:57', 10, 0, '', 'Jumlah responden : 11<br>', 'Meningkatkan kesadaran keamanan informasi melalui pelatihan rutin, komunikasi tentang risiko, dan penerapan kebijakan yang ketat adalah langkah penting untuk melindungi data dari ancaman siber.', '0000-00-00 00:00:00', 0),
	('20240095_C020240304', 95, 3, 1, 1, '2024', 'C020240304', '3', 2.7, 60, 15, 0.045, NULL, 1, '2024-10-01 03:20:46', 1, 0, '', '', '', '0000-00-00 00:00:00', 0),
	('20240095_C020240305', 95, 3, 1, 1, '2024', 'C020240305', '4,4', 3.96, 88, 15, 0.045, NULL, 1, '2024-10-28 23:00:23', 10, 0, '', '<span style="font-size: 13.3333px;">Arsitektur SPBE harus dilakukan reviu dan evaluasi setiap tahun</span>', '<span style="font-size: 13.3333px;">agar terus melakukan inovasi proses bisnis</span><div>agar mengidentifikasi layanan online untuk diintegrasikan dalam portal layanan</div>', '0000-00-00 00:00:00', 0),
	('20240095_C020240401', 95, 3, 1, 1, '2024', 'C020240401', '100', 4, 100, 10, 0.04, NULL, 1, '2024-11-01 00:03:55', 12, 0, '', '<span style="font-size: 13.3333px;">capaian pencatatan RUP sudah sangat baik, dipertahankan untuk penilaian tahun 2025</span>', '<span style="font-size: 13.3333px;">capaian pencatatan RUP sudah sangat baik, dipertahankan untuk penilaian tahun 2025</span>', '0000-00-00 00:00:00', 0),
	('20240095_C020240402', 95, 3, 1, 1, '2024', 'C020240402', '99', 1.98, 99, 10, 0.02, NULL, 1, '2024-10-31 21:57:21', 11, 0, '', 'Tingkatkan. Sedikit lagi.', '<span style="font-size: 13.333333px;">Jangan lupa unggah SPT Tahunan di aplikasi Si-Master sebelum tanggal 1 April.</span>', '0000-00-00 00:00:00', 0),
	('20240095_C020240403', 95, 3, 1, 1, '2024', 'C020240403', '46.27', 0.9254, 46.27, 10, 0.02, NULL, 1, '2024-11-20 02:34:44', 10, 0, '', '<div>Tahap I :</div><ul><li>Dataset yang diampu masih kurang</li><li>Pemenuhan data tahun 2020-2022 kurang&nbsp;</li><li>Pemenuhan keterisian data masih belum optimal</li><li>Interval waktu periode data masih panjang</li><li>Jumlah variabel masih belum merepresentasikan informasi yang disampaikan</li></ul><p>Tahap II :</p><ul><li>Terdapat beberapa inkonsistensi dalam pelaksanaan yang perlu diatasi melalui pelatihan dan pemantauan lebih intensif.</li><li>Peningkatan integrasi sistem perlu dilakukan untuk menghindari kesalahan dan mempercepat proses.</li><li>Perlu ada upaya untuk memperluas jangkauan audiens, khususnya di platform digital, dan evaluasi lebih lanjut terhadap efektivitas distribusinya.<br><br></li></ul>', '<div>Tahap I:</div><ul><li>&nbsp;Agar dilakukan pemenuhan data tahun 2020-2022&nbsp;</li><li>&nbsp;Pemenuhan keterisian data perlu diinput sesuai periode data&nbsp;</li><li>Interval waktu periode data perlu dikaji ulang&nbsp;</li><li>Jumlah variabel perlu dikaji ulang dan ditingkatkan&nbsp; <br></li></ul><div>Tahap II</div><ul><li>Perlu sistem pemantauan untuk memastikan konsistensi dan ketepatan waktu pengumpulan data.</li><li>Perlu dilakukan audit atau pengecekan ulang secara rutin terhadap data yang telah diproses untuk menjaga akurasi hasil.</li><li>Manfaatkan lebih banyak platform digital dan sosial media untuk memperluas jangkauan audiens terhadap media yang digunakan serta pastikan informasi menjangkau audiens yang lebih luas dan relevan.<br><br></li></ul>', '0000-00-00 00:00:00', 0),
	('20240095_C020240404', 95, 3, 1, 1, '2024', 'C020240404', '87,25', 1.745, 87.25, 10, 0.02, NULL, 1, '2024-10-13 00:19:53', 10, 0, '', '<div><span style="font-size: 13.3333px;">Hasil Karya Laman Web dan Media Sosial belum maksimal</span></div>', '<span style="font-size: 13.3333px;">Agar hasil karya laman web dan media sosial yang dikirim ke JPRA selanjutnya lebih baik lagi</span>', '0000-00-00 00:00:00', 0),
	('20240095_C020240501', 95, 3, 1, 1, '2024', 'C020240501', '40', 2, 40, 26, 0.05, NULL, 1, '2024-10-30 23:54:22', 3, 0, '', '<span style="font-size: 13.3333px;">Telah dilakukan Desk Evaluasi TPI</span>', '<span style="font-size: 13.3333px;">Pembangunan Zona Integritas telah berjalan lebih dari satu tahun, monev dari Tim Penilai Internal dilaksanakan secara berkala sebagai upaya untuk peningkatan kualitas pembangunan Zona Integritas, agar terus melakukan perbaikan pada 6 area perubahan secara terus menerus dan mendokumentasikan seluruh upaya yang telah dilakukan secara komprehesif.</span>', '0000-00-00 00:00:00', 0),
	('20240095_C020240502', 95, 3, 1, 1, '2024', 'C020240502', '77,93', 10.1309, 77.93, 26, 0.13, NULL, 1, '2024-10-29 00:24:10', 1, 0, '', '', '', '0000-00-00 00:00:00', 0),
	('20240095_C020240503', 95, 3, 1, 1, '2024', 'C020240503', '100', 5, 100, 26, 0.05, NULL, 1, '2024-08-02 04:09:19', 7, 0, '', '', '', '0000-00-00 00:00:00', 0),
	('20240095_C020240504', 95, 3, 1, 1, '2024', 'C020240504', '2,68', 2.208, 73.6, 26, 0.03, NULL, 1, '2024-09-04 20:46:50', 5, 0, '', '', '', '0000-00-00 00:00:00', 0),
	('20240095_C020240601', 95, 3, 1, 1, '2024', 'C020240601', '82', 1.64, 82, 10, 0.02, NULL, 1, '2024-10-06 22:07:28', 1, 0, '', '<div>untuk melengkapi kembali, kegiatan-kegiatan yang berkaitan dengan penyisipan informasi budaya kerja BerAKHLAK serta menyertakan bukti dukung pemutaran video budaya kerja BerAKHLAK.</div>', 'Melakukan internalisasi core values BerAKHLAK secara berkelanjutan dan penguatan kembali peran agen perubahan dalam implementasi budaya BerAKHLAK.&nbsp;', '0000-00-00 00:00:00', 0),
	('20240095_C020240602', 95, 3, 1, 1, '2024', 'C020240602', ' 86.71 ', 1.7342, 86.71, 10, 0.02, NULL, 1, '2024-10-07 02:23:22', 1, 0, '', 'untuk meningkatkan nilai IP ASN', '<span style="font-size: 13.3333px;">Agar aktif mencari informasi terkait pengembangan kompetensi</span>', '0000-00-00 00:00:00', 0),
	('20240095_C020240603', 95, 3, 1, 1, '2024', 'C020240603', '67,90', 1.358, 67.9, 10, 0.02, NULL, 1, '2024-10-31 03:51:42', 13, 0, '', '<p class="MsoNormal">capaian masuk dalam kategori sedang<o:p></o:p></p>', '<p class="MsoNormal">agar memaksimalkan inputing sertifikat pengembangan\nkompetensi kedalam aplikasi Sibangkodir<o:p></o:p></p>', '0000-00-00 00:00:00', 0),
	('20240095_C020240604', 95, 3, 1, 1, '2024', 'C020240604', '44.4', 0.666, 44.4, 10, 0.015, NULL, 1, '2024-10-08 02:34:35', 10, 0, '', '', '<div>Memanfaatkan Aplikasi Tata Naskah Dinas Elektronik (TNDE).</div><div>Memanfaatkan Sistem Penghubung Layanan Pemerintah (SPLP) untuk bertukar, mengakses, dan memanfaatkan data satu sama lain secara efisien.</div><div>Penggunaan Domain resmi jatimprov.go.id.</div><div>Mendaftarkan aplikasi yang aktif ke APPS Jatim ( https://apps.jatimprov.go.id ).</div>', '0000-00-00 00:00:00', 0),
	('20240095_C020240605', 95, 3, 1, 1, '2024', 'C020240605', '3', 1.5, 60, 10, 0.025, NULL, 1, '2024-10-05 14:13:52', 10, 0, '', '<div>- Jumlah aduan yang masuk pada kanal SP4N-LAPOR! masih belum optimal</div><div>- Pemberian penilaian rating bintang masih minim<br></div>- Publikasi dan sosialisasi kanal pengaduan SP4N-LAPOR! belum optimal', '<div>- Disarankan untuk dapat menginputkan aduan yang masuk ke kanal \nselain LAPOR!,&nbsp; ke dalam aplikasi LAPOR! dengan memanfaatkan fitur \nmanual pada LAPOR!</div><div>- Disarankan untuk dapat mereminder pelapor, untuk dapat memberikan penilaian rating bintang</div>- Melakukan publikasi dan sosialisasi kanal pengaduan SP4N-LAPOR!', '0000-00-00 00:00:00', 0);
