	(1, 'Badan Kepegawaian Daerah', 'Badan Kepegawaian Daerah', 'U001', 'opd', 1, NULL, 'Membantu Gubernur melaksanakan fungsi penunjang urusan pemerintahan yang menjadi kewenangan Pemerintah Provinsi di bidang kepegawaian serta tugas pembantuan.', 'Penyusunan kebijakan teknis di bidang kepegawaian;\r\n"Pelaksanaan tugas dukungan teknis di bidang\r\nkepegawaian;"\r\n"Pemantauan, evaluasi dan pelaporan pelaksanaan\r\ntugas dukungan teknis di bidang kepegawaian;"\r\n"Pembinaan teknis penyelenggaraan fungsi penunjang\r\nurusan pemerintahan daerah di bidang kepegawaian;"\r\n"Pelaksanaan administrasi Badan di bidang\r\nkepegawaian; dan"\r\n"Pelaksanaan fungsi lain yang diberikan oleh Gubernur\r\nsesuai dengan tugas dan fungsinya."\r\n"Pembinaan teknis penyelenggaraan fungsi penunjang\r\nurusan pemerintahan daerah di bidang kepegawaian;"\r\n"Pelaksanaan administrasi Badan di bidang\r\nkepegawaian; dan"\r\n"Pelaksanaan fungsi lain yang diberikan oleh Gubernur\r\nsesuai dengan tugas dan fungsinya."', NULL, NULL, NULL, 'assets/landing/images/opd/bkd.jpg', 'foto/bu yuyun.jpg', 'Indah Wahyuni SH., M.Si', 'Kepala', 'bkd@jatimprov.go.id', 'Jl. Jemur Andayani I, Surabaya', 'http://bkd.jatimprov.go.id/', '@bkdjatim', '', '@bkdjatim', '(031) 8477551', '8477404', '1) Sekretariat;\r\n2) Bidang Perencanaan, Pengadaan, Pengolahan Data Dan Sistem Informasi; 3)\r\nBidang Pembinaan, Kesejahteraan Dan Perlindungan Hukum; 4) Bidang Mutasi; 5)\r\nBidangan Pengembangan Aparatur Sipil Negara', '0', '60.523.390.650', '137', 'Badan Kepegawaian Daerah', '503000000010000', '730310'),
	(2, 'Badan Kesatuan Bangsa dan Politik', 'Badan Kesatuan Bangsa dan Politik', 'U002', 'opd', 1, NULL, 'Membantu Gubernur melaksanakan tugas di bidang kesatuan bangsa dan politik di wilayah Provinsi.', '"perumusan kebijakan teknis di bidang kesatuan\nbangsa dan politik di wilayah Provinsi sesuai dengan\nketentuan peraturan perundang-undangan;"\n"Pelaksanaan kebijakan di bidang pembinaan ideologi\nPancasila dan wawasan kebangsaan, penyelenggaraan\npolitik dalam negeri dan kehidupan demokrasi,\npemeliharaan ketahanan ekonomi, sosial, dan\nbudaya, pembinaan kerukunan antarsuku dan intra\nsuku, umat beragama, ras, dan golongan lainnya,\nfasilitasi organisasi kemasyarakatan serta\npelaksanaan kewaspadaan nasional dan penanganan\nkonflik sosial di wilayah Provinsi sesuai dengan\nketentuan peraturan perundang-undangan;"\n"pelaksanaan koordinasi di bidang pembinaan ideologi\nPancasila dan wawasan kebangsaan, penyelenggaraan\npolitik dalam negeri dan kehidupan demokrasi,\npemeliharaan ketahanan ekonomi, sosial, dan\nbudaya, pembinaan kerukunan antarsuku dan intra\nsuku, umat beragama, ras, dan golongan lainnya,\nfasilitasi organisasi kemasyarakatan serta\npelaksanaan kewaspadaan nasional dan penanganan\nkonflik sosial di wilayah Provinsi sesuai dengan\nketentuan peraturan perundang-undangan;"\n"Pelaksanaan pemantauan, evaluasi, dan pelaporan di\nbidang pembinaan ideologi Pancasila dan wawasan\nkebangsaan, penyelenggaraan politik dalam negeri\ndan kehidupan demokrasi, pemeliharaan ketahanan\nekonomi, sosial, dan budaya, pembinaan kerukunan\nantarsuku dan intra suku, umat beragama, ras,\ndan golongan lainnya, fasilitasi organisasi\nkemasyarakatan serta pelaksanaan kewaspadaan\nnasional dan penanganan konflik sosial di wilayah\nProvinsi sesuai dengan ketentuan peraturan\nperundang-undangan;\n"\n"Pelaksanaan fasilitasi forum koordinasi pimpinan\ndaerah Provinsi;"\n"pelaksanaan administrasi Badan di bidang kesatuan\nbangsa dan politik Provinsi; dan"\n"pelaksanaan fungsi lain yang diberikan oleh\nGubernur."', NULL, NULL, NULL, NULL, 'foto/Kepala_Bakorwil_Madiun-removebg-preview (1).jpg', 'Eddy SUPRIYANTO, S.STP., M.PSDM', 'Kepala', '', 'Jl. Putat Indah No. 1 Surabaya', 'https://bakesbangpol.jatimprov.go.id/', '@bakesbangpol_jatim', '', '', '(031) 5677935', NULL, '1. Sekretariat \r\n  a. Sub Bagian Tata Usaha\r\n  b. Sub Bagian Penyusunan Prog\r\n  c. Sub Bagian Keuangan \r\n \r\n 2. Bidang Hubungan Antar Lembaga \r\n  a. Sub Bidang Lembaga Politik\r\n  b. Sub Bidang Lembaga Masayarakat\r\n \r\n 3. Bidang Integrasi Bangsa\r\n  a. Sub Bidang Pembauran\r\n  b. Sub Bidang Wawasan Kebangsaan\r\n \r\n 4. Bidang Budaya Politik \r\n  a. Sub Bidang Pengembangan Etika Politik.\r\n  b. Sub Bidang Demokrasi dan HAM \r\n \r\n 5. Bidang Kewaspadaan\r\n  a. Sub Bidang Pencegahan Konflik\r\n  b. Sub Bidang Penanganan Konflik', '0', 'Rp. 52.094.694.800,-', '73', 'Badan Kesatuan Bangsa dan Politik', '801000000010000', '264048'),
	(3, 'Badan Penanggulangan Bencana Daerah', 'Badan Penanggulangan Bencana Daerah', 'U003', 'opd', 1, NULL, 'Membantu Gubernur melaksanakan urusan pemerintahan yang menjadi kewenangan Pemerintah Provinsi di bidang penanggulangan bencana.', '"Perumusan kebijakan di bidang penanggulangan\r\nbencana;"\r\n"Pelaksanaan kebijakan di bidang penanggulangan\r\nbencana;"\r\n"Pelaksanaan evaluasi dan pelaporan di bidang\r\npenanggulangan bencana;"\r\n"Pelaksanaan administrasi Badan di bidang\r\npenanggulangan bencana; dan"\r\n"Pelaksanaan fungsi lain yang diberikan oleh\r\nGubernur."', NULL, NULL, NULL, NULL, 'foto/bapak_Gatot_keki-removebg-min.jpg', 'Gatot Soebroto, S.E, M.PSDM', 'Kepala', '', 'Jl. S. Parman No. 55, Waru - Sidoarjo', 'https://web.bpbd.jatimprov.go.id/', '@bpbd_jatim ', 'BPBDJTM', '', '(031) 8550222', NULL, 'Bidang Pencegahan dan Kesiapsiagaan, Bidang Kedaruratan dan Logistik, Bidang Rehabilitasi dan Rekonstruksi, Sekretaris, Kasubag Umum dan Kepegawaian, Kasubag Program dan Pelaporan, Kasubag Keuangan, Kasi Pencegahan, Kasi Kesiapsiagaan, Kasi Kedaruratan, Kasi Logistik, Kasi Rehabilitasi dan Kasi Rekonstruksi', '0', '64.489.934.000', 'PNS: 44 Orang; PTT-PK: 53', 'Badan Penanggulangan Bencana Daerah', '105000000040000', '451037'),
	(4, 'Badan Pendapatan Daerah', 'Badan Pendapatan Daerah', 'U004', 'opd', 1, NULL, 'Membantu Gubernur melaksanakan fungsi penunjang urusan pemerintahan yang menjadi kewenangan Pemerintah Provinsi di bidang keuangan.', 'Penyusunan kebijakan teknis di bidang keuangan;\r\nPelaksanaan tugas dukungan teknis di bidang keuangan;\r\n"Pemantauan, evaluasi dan pelaporan pelaksanaan tugas\r\ndukungan teknis di bidang keuangan;\r\n"\r\n"Pembinaan teknis penyelenggaraan fungsi penunjang\r\nurusan pemerintahan daerah di bidang keuangan;"\r\n"Pelaksanaan administrasi Badan di bidang keuangan;\r\ndan"\r\n"Pelaksanaan fungsi lain yang diberikan oleh Gubernur\r\nsesuai dengan tugas dan fungsinya."', NULL, NULL, NULL, NULL, 'foto/Foto Bobby - Andi pranawa.jpg', 'Dr. Bobby Soemiarsono,S.H.,M.Si', 'Kepala', '', 'Jl.Manyar Kertoarjo No.1 Surabaya', 'https://www.dipendajatim.go.id/', '@bapendajatim', '', '@bapendajatim', '(031) 5947953, 5941162, 5941163, ', '(031) 5941165', '1 Sekretariat/4 Bidang/38 Subbag/12 Subbid/70 Seksi', '35 UPT', '446,803,055,000', '1.274', 'Badan Pendapatan Daerah', '502000000030000', '285001'),
	(5, 'Badan Riset dan Inovasi Daerah', 'Badan Riset dan Inovasi Daerah', 'U005', 'opd', 1, NULL, 'Membantu Gubernur melaksanakan urusan pemerintahan yang menjadi kewenangan Pemerintah Provinsi di bidang penelitian dan pengembangan.', '"Penyusunan kebijakan teknis di bidang penelitian,\npengembangan, pengkajian, penerapan, invensi dan\ninovasi;"\n"Penyusunan perencanaan program dan anggaran\npenelitian, pengembangan, pengkajian, penerapan,\ninvensi dan inovasi Pemerintahan Provinsi;"\n"Pengoordinasian dan sinkronisasi pelaksanaan\npenelitian, pengembangan, pengkajian, penerapan,\ninvensi dan inovasi lingkup Pemerintahan Provinsi;"\n"Pelaksanaan penelitian, pengembangan, pengkajian,\npenerapan, invensi dan inovasi di Pemerintahan\nProvinsi;"\n"Pelaksanaan pengkajian kebijakan lingkup urusan\nPemerintahan Provinsi;"\nFasilitasi dan pelaksanaan inovasi daerah;\n"Fasilitasi lembaga penelitian dan pengembangan\nkabupaten/kota;"\n"Pembinaan teknis penyelenggaraan fungsi penunjang\nurusan pemerintahan di bidang penelitian dan\npengembangan;"\n"Pelaksanaan administrasi penelitian, pengembangan,\npengkajian, penerapan, invensi dan inovasi\nPemerintahan Provinsi;\n"\n"Pelaksanaan monitoring, evaluasi dan pelaporan atas\npelaksanaan penelitian, pengembangan, pengkajian,\npenerapan, invensi dan inovasi di Provinsi; dan"\n"Pelaksanaan fungsi lain yang diberikan oleh Gubernur\nsesuai dengan tugas dan fungsinya."', NULL, NULL, NULL, NULL, 'foto/kepala-brida-jatim.jpg', 'Dr. Andriyanto,S.H.,M.Kes', 'Kepala', '', 'Jl. Gayung Kebonsari No. 56 Surabaya', 'https://balitbang.jatimprov.go.id/', '@balitbangprovjatim ', '', '', ' (031) 8290738', NULL, '5 Bidang Dan 15 Subbag/Subbid', '0', '33.353.378.000', '83 Orang', 'Badan Penelitian dan Pengembangan', '505000000010000', '224081'),
	(6, 'Badan Pengelola Keuangan dan Aset Daerah', 'Badan Pengelola Keuangan dan Aset Daerah', 'U006', 'opd', 1, NULL, '"Membantu Gubernur melaksanakan fungsi penunjang urusan pemerintahan yang menjadi kewenangan Pemerintah Provinsi di bidang keuangan."', 'Penyusunan kebijakan teknis di bidang keuangan;\n\nPelaksanaan tugas dukungan teknis di bidang keuangan;\n"Pemantauan, evaluasi dan pelaporan pelaksanaan tugas\ndukungan teknis di bidang keuangan;\n"\n"Pembinaan teknis penyelenggaraan fungsi penunjang urusan\npemerintahan daerah di bidang keuangan;\n"\nPelaksanaan administrasi badan di bidang keuangan; dan\n"Pelaksanaan fungsi lain yang diberikan oleh Gubernur sesuai\ndengan tugas dan fungsinya."', NULL, NULL, NULL, NULL, 'foto/Pak Sigit - BPKAD.jpg', 'Ir. SIGIT PANOENTOEN,M.Si', 'Kepala', '', 'Jl. Johar No.19-21 ', 'https://bpkad.jatimprov.go.id/', '@bpkadjatim', '', '', '(031) 3532291 3532294-3532296', NULL, '1 Sekretariat, 5 Bidang, 1 UPT, 4 Subbagian, 15 Subbidang, 2 Seksi', '1 (UPT PPKD BPKAD)', 'Pendapatan Daerah Rp 15.548.206.089.680,00 Belanja Daerah Rp 5.251.830.940.969,3', '155 Pegawai (PNS dan PTT-PK)', 'Badan Pengelola Keuangan dan Aset Daerah', '502000000020000', '676205'),
	(7, 'Badan Pengembangan Sumber Daya Manusia', 'Badan Pengembangan Sumber Daya Manusia', 'U007', 'opd', 1, NULL, '"Membantu Gubernur melaksanakan fungsi\npenunjang urusan pemerintahan yang menjadi\nkewenangan Pemerintah Provinsi di bidang pengembangan\nkompetensi aparatur bagi aparatur sipil negara, anggota\nDPRD dan aparatur desa."', '"1. Penyusunan kebijakan teknis di bidang\npengembangan kompetensi aparatur bagi aparatur\nsipil negara, anggota DPRD dan aparatur desa"\n"2. Pelaksanaan tugas dukungan teknis di bidang\npengembangan kompetensi aparatur bagi aparatur\nsipil negara, anggota DPRD dan aparatur desa;"\n"3. Pemantauan, evaluasi dan pelaporan pelaksanaan\ntugas dukungan teknis di bidang pengembangan\nkompetensi aparatur bagi aparatur sipil negara,\nanggota DPRD dan aparatur desa;"\n"4. Pembinaan teknis penyelenggaraan fungsi penunjang\nurusan pemerintahan daerah di bidang pengembangan\nkompetensi aparatur bagi aparatur sipil negara,\nanggota DPRD dan aparatur desa;"\n"5. Pelaksanaan administrasi Badan di bidang\npengembangan kompetensi aparatur bagi aparatur\nsipil negara, anggota DPRD dan aparatur desa; dan"\n"6. Pelaksanaan fungsi lain yang diberikan oleh Gubernur\nsesuai dengan tugas dan fungsinya."', NULL, NULL, NULL, NULL, 'foto/Pak Biro.jpg', 'Dr. RAMLIYANTO, S.P., M.P', 'Kepala', '', 'Jl. Balongsari Tama, Tandes', 'https://bpsdm.jatimprov.go.id/', '@bpsdmjatim', 'Bpsdm Jawa Timur', '@bpsdm_jatim', '(031) 7412278', NULL, '5 bidang, 15 Subbag/Subbid', '0', 'Rp. 156.246.477.000,-', 'PNS = 190, PTT-PK = 36', 'Badan Pengembangan Sumber Daya Manusia', '504000000010000', '591507'),
	(8, 'Badan Penghubung', 'Badan Penghubung', 'U008', 'opd', 1, NULL, 'Membantu Gubernur untuk menunjang koordinasi pelaksanaan urusan pemerintahan dan pembangunan dengan Pemerintah Pusat.', '"Penyusunan kebijakan teknis untuk menunjang\nkoordinasi pelaksanaan urusan pemerintahan dan\npembangunan dengan Pemerintah Pusat;"\n"Pemberian dukungan teknis untuk koordinasi\npelaksanaan urusan pemerintahan dan pembangunan\ndengan Pemerintah Pusat;"\n"Pemantauan, evaluasi dan pelaporan pelaksanaan tugas\ndukungan teknis untuk menunjang koordinasi\npelaksanaan urusan pemerintahan dan pembangunan\ndengan Pemerintah Pusat;\n"\n"Pembinaan teknis penyelenggaraan fungsi penunjang\nkoordinasi pelaksanaan urusan pemerintahan dan\npembangunan dengan Pemerintah Pusat;"\n"Pelaksanaan administrasi Badan di bidang koordinasi\npelaksanaan urusan pemerintahan dan pembangunan\ndengan Pemerintah Pusat; dan "\n"Pelaksanaan fungsi lain yang diberikan oleh Gubernur\nsesuai dengan tugas dan fungsinya."', NULL, NULL, NULL, NULL, 'foto/WhatsApp Image 2023-02-11 at 14.55.jpg', 'Zainal Fanani, S. STP, MAP', 'Kepala', '', 'Jl. Pasuruan No. 16-20 Menteng Jakarta Pusat', 'https://perwakilan.jatimprov.go.id/', '@bapengda.provjatim', 'Bapengda', '', ' (021) 310039', NULL, '1 Subbag dan 3 Subbid', '0', '37483432000', '67', 'Badan Penghubung Daerah Provinsi', '507000000010000', '888072'),
