	(16, 'Dinas Kebudayan dan Pariwisata', 'Dinas Kebudayan dan Pariwisata', 'U016', 'opd', 1, NULL, 'Membantu Gubernur melaksanakan urusan\npemerintahan yang menjadi kewenangan Pemerintah\nProvinsi di bidang kebudayaan, pariwisata, dan ekonomi\nkreatif serta tugas pembantuan.', '"Perumusan kebijakan di bidang kebudayaan,\npariwisata, dan ekonomi kreatif"\n"Pelaksanaan kebijakan di bidang kebudayaan,\npariwisata, dan ekonomi kreatif;"\n"Pelaksanaan evaluasi dan pelaporan di bidang\nkebudayaan, pariwisata, dan ekonomi kreatif;"\n"Pelaksanaan administrasi Dinas di bidang kebudayaan,\npariwisata, dan ekonomi kreatif; dan"\n"Pelaksanaan fungsi lain yang diberikan oleh Gubernur\nsesuai dengan tugas dan fungsinya."', NULL, NULL, NULL, NULL, 'foto/kadisbudpar.jpg', 'Evy Afianasari, S.T., M.M.A.', 'Kepala', '', 'Jl. Wisata Menanggal Surabaya\r\n', 'https://disbudpar.jatimprov.go.id/', '@disbudparjatimprov ', 'Dinas Kebudayaan dan Pariwisata Jawa Timur', '', '0318531814-16', NULL, '1. Bidang Pemasaran Pariwisata, 2. Bidang Destinasi Pariwisata, 3. Bidang Industri Pariwisata, 4. Bidang Cagar Budaya Sejarah, 5. Bidang Kebudayaan dan 6. Sekretariat', '4 UPT : 1. UPT. Taman Budaya, 2. UPT. Museum Mpu Tantular, 3. UPT. Pemberdayaan Lembaga Seni Wilwatikta dan 4. UPT. Laboratorium Pengembangan dan Pelatihan Kesenian', 'Rp. 117.286.483.000,-', '320 orang (189 ASN dan 131 PTT)', 'Dinas Kebudayaan dan Pariwisata', '222326000030000', '288258'),
	(17, 'Dinas Kehutanan', 'Dinas Kehutanan', 'U017', 'opd', 1, NULL, 'Membantu Gubernur dalam urusan pemerintahan\nyang menjadi kewenangan Pemerintah Provinsi di bidang\nkehutanan serta tugas pembantuan.', 'Perumusan kebijakan di bidang kehutanan;\nPelaksanaan kebijakan di bidang kehutanan;\n"Pelaksanaan evaluasi dan pelaporan di bidang\nkehutanan;"\n"Pelaksanaan administrasi Dinas di bidang kehutanan;\ndan\n"\n"Pelaksanaan fungsi lain yang diberikan oleh Gubernur\nsesuai dengan tugas dan fungsinya."', NULL, NULL, NULL, NULL, '1', 'Dr. Ir. Jumadi, MMT\n', 'Kepala', NULL, 'Jl. Bandara Juanda Sidoarjo', 'https://dishut.jatimprov.go.id/', '@dinaskehutananjatim', 'Dinas Kehutanan Provinsi Jawa Timur', NULL, '(031) 8666549', '8667858', '5, Sekretariat, Bidang Planologi Kehutanan, Bidang Konservasi Sumber Daya Hutan dan Ekosistem, Bidang Pengelolaan Hutan Produksi Lestari, Bidang Pengelolaan Daerah Aliran Sungai dan Perhutanan Sosial ', '13', '252.708.604.000', '793', 'Dinas Kehutanan', '328000000010000', '250594'),
	(18, 'Dinas Kelautan dan Perikanan', 'Dinas Kelautan dan Perikanan', 'U018', 'opd', 1, NULL, 'Membantu Gubernur melaksanakan urusan\npemerintahan yang menjadi kewenangan Pemerintah\nProvinsi di bidang kelautan dan perikanan dan tugas\npembantuan.\n', '"Perumusan kebijakan di bidang kelautan dan\nperikanan;"\n"Pelaksanaan kebijakan di bidang kelautan dan\nperikanan;"\n"Pelaksanaan evaluasi dan pelaporan di bidang\nkelautan dan perikanan;"\n"Pelaksanaan administrasi Dinas di bidang kelautan\ndan perikanan; dan"\n"Pelaksanaan fungsi lain yang diberikan oleh Gubernur\nterkait dengan tugas dan fungsinya."', NULL, NULL, NULL, NULL, 'foto/Kadis PU SDA.jpg', 'Dr. Muhammad Isa AnshoriARD.,M.T', 'Kepala', '', 'Jl. Ahmad Yani No.152 B Surabaya', 'https://dkp.jatimprov.go.id/', '@diskanlajatim', 'Diskanlajawatimur', '', '(031) 8281672', NULL, '1. Sekretariat (a. Subag Tata Usaha ; b. Subag Keuangan ; c. Subag Penyusunan Program dan Anggaran) ; 2. Bidang Perikanan Budidaya (a. Seksi Produksi dan Usaha Perikanan Budidaya ; b. Seksi Sarana dan Prasarana Perikanan Budidaya; c. Seksi Kesehatan Ikan dan Lingkungan Perikanan Budidaya) ; 3. Bidang Perikanan Tangkap (a. Seksi Pengelolaan Sumber Daya Ikan ; b. Seksi Kepelabukan Ikan ; c. Seksi Kenelayanan) ; 4. Bidang Kelautan, Pesisir dan Pengawasan (a. Seksi Pengelolaan Ruang Laut ; b. Seksi Pendayagunaan Pesisir dan Pulau-Pulau Kecil ; c. Seksi Pengawasan Sumber Daya Kelautan dan Perikanan) ; 5. Bidang Pengolahan dan Pemasaran Produk Kelautan dan Perikanan (a. Seksi Akses Pasar, Promosi dan Logistik ; b. Seksi Bina Mutu dan Diversifikasi Produk ; c. Seksi Usaha dan Investasi)', '13 UPT dan 4 Cabang Dinas', 'Rp. 372.089.478.000', 'PNS : 396 orang dan PTT : 180 orang', 'Dinas Kelautan dan Perikanan', '325000000010000', '149764'),
	(19, 'Dinas Kepemudaan Dan Olahraga', 'Dinas Kepemudaan Dan Olahraga', 'U019', 'opd', 1, NULL, 'Membantu Gubernur melaksanakan urusan\npemerintahan yang menjadi kewenangan Pemerintah\nProvinsi di bidang kepemudaan dan olahraga serta tugas\npembantuan.', '"Perumusan kebijakan urusan pemerintahan bidang\nkepemudaan dan olahraga;\n"\n"Pelaksanaan kebijakan urusan pemerintahan bidang\nkepemudaan dan olahraga;"\n"Pelaksanaan evaluasi dan pelaporan urusan\npemerintahan bidang kepemudaan dan olahraga;"\n"Pelaksanaan administrasi Dinas urusan pemerintahan\nbidang kepemudaan dan olahraga; dan"\n"Pelaksanaan fungsi lain yang diberikan oleh Gubernur\nterkait dengan tugas dan fungsinya.\n"\n"Pelaksanaan evaluasi dan pelaporan di bidang\nkelautan dan perikanan;"\n"Pelaksanaan administrasi Dinas di bidang kelautan\ndan perikanan; dan"\n"Pelaksanaan fungsi lain yang diberikan oleh Gubernur\nterkait dengan tugas dan fungsinya."', NULL, NULL, NULL, NULL, 'foto/HW.jpg', 'M. Hadi Wawan Guntoro, S.STP, M.Si', 'Kepala', '', 'Jl. Kayon No. 56, Surabaya', 'https://dispora.jatimprov.go.id/', '@dispora_jatim', '', '', '031 5345507 (081252339214', NULL, '1. Sekretariat (TU, Keuangan, Sungram) 2.Bidang Keolahragaan (Olahraga Pendidikan & Prestasi, Olahraga Rekreasi, Olahraga Khusus) 3. Bidang Kemitraan (Kerjasama, Pengembangan Kreatifitas, Sarana dan Prasarana) 4. Bidang Manajemen (Penguatan Tata Kelola Kelembagaan, Peningkatan Kualitas SDM, Standarisasi dan Sertifikasi) 5. Bidang Kepemudaan (Penyadaran Pemuda, Pengembangan Pemuda, Pemberdayaan Pemuda)', '0', 'Sebelum Perubahan (258.986.126.200), Setelah Perubahan (234.258.737.228)', '21 Pejabat', 'Dinas Kepemudaan dan Olahraga', '219000000010000', '834746'),
	(20, 'Dinas Kesehatan', 'Dinas Kesehatan', 'U020', 'opd', 1, NULL, 'Membantu Gubernur melaksanakan urusan\npemerintahan yang menjadi kewenangan Pemerintah\nProvinsi di bidang kesehatan serta tugas pembantuan.', 'Perumusan kebijakan di bidang kesehatan;\nPelaksanaan kebijakan di bidang kesehatan;\n"Pelaksanaan evaluasi dan pelaporan di bidang\nkesehatan;"\n"Pelaksanaan administrasi Dinas di bidang kesehatan;\ndan"\n"Pelaksanaan fungsi lain yang diberikan oleh Gubernur\nsesuai dengan tugas dan fungsinya."', NULL, NULL, NULL, NULL, '1', 'Dr. ERWIN ASTHA TRIYONO,dr, Sp.PD.KPTI\n', 'Kepala', NULL, 'Jl. Ahmad Yani No. 118 Surabaya\n', 'https://dinkes.jatimprov.go.id/', '@dinkesjatim', 'Dinas Kesehatan Provinsi Jawa Timur', '@dinkesjatim', '031-8280910', NULL, '5 Bidang (Sekretariat, Bidang Kesehatan Masyarakat, Bidang Pencegahan dan Pengendalian Penyakit, Bidang Pelayanan Kesehatan, Bidang Sumber Daya Kesehatan) dan 15 Subbagian/Seksi (Subbag Tata Usaha, Subbag Keuangan, Subbag Penyusunan Program dan Anggaran, Seksi Kesehatan Keluarga dan Gizi Masyarakat, Seksi Promosi Kesehatan dan Pemberdayaan  Masyarakat, Seksi Kesehatan Lingkungan, Kesehatan Kerja dan Olah raga, Seksi Surveilans dan Imunisasi, Seksi Pencegahan dan Pengendalian Penyakit Menular, Seksi Pencegahan dan Pengendalian Penyakit Tidak Menular & Kesehatan Jiwa, Seksi Pelayanan Kesehatan Primer, Seksi pelayanan Kesehatan Rujukan, Seksi Pelayanan Kesehatan Tradisional, Seksi Kefarmasian, Seksi Alat Kesehatan dan Perbekalan Rumah Tangga, Seksi sumber Daya Manusia Kesehatan)', '12', 'Rp. 893.530.465.685', 'PNS : 1589 orang, non PNS : 1304 orang', 'Dinas Kesehatan', '102000000010000', '255058'),
	(21, 'Dinas Komunikasi dan Informatika', 'Dinas Komunikasi dan Informatika', 'U021', 'opd', 1, NULL, 'Membantu Gubernur dalam melaksanakan urusan\npemerintahan yang menjadi kewenangan Pemerintah\nProvinsi di bidang komunikasi, informatika, statistik, dan\npersandian serta tugas pembantuan.', '"Perumusan kebijakan di bidang komunikasi,\ninformatika, statistik, dan persandian;"\n"Pelaksanaan kebijakan di bidang komunikasi,\ninformatika, statistik, dan persandian;"\n"Pelaksanaan evaluasi serta pelaporan di\nbidang komunikasi, informatika, statistik, dan\npersandian;"\n"Pelaksanaan administrasi Dinas di bidang\nkomunikasi, informatika, statistik, dan persandian;\ndan"\n"Pelaksanaan fungsi lain yang diberikan oleh\nGubernur terkait dengan tugas dan fungsinya."', NULL, NULL, NULL, NULL, 'foto/WhatsApp Image 2023-02-13 at 12.45.21.jpeg', 'Sherlita Ratna Dewi Agustin,S.Si,M.P', 'Kepala', '', 'Jl. Ahmad Yani No. 242 - 244 Surabaya', 'http://kominfo.jatimprov.go.id/', '@Kominfojatim', 'Kominfoprovjatim', '@Kominfojatim', '(031) 8294608', NULL, '1. Sekretariat : (Subbag Keuangan, Subbag Tata Usaha, Subbag Penyusunan Program & Anggaran) 2.  Bidang Informasi Publik : (Seksi Layanan Informasi Publik, Seksi Pengolahan Informasi Publik, Seksi Media publik) 3. Bidang Komunikasi Publik : (Seksi Pengelolaan Informasi Publik, Seksi Sumber Daya Komunikasi Publik, Seksi Kemitraan Komunikasi Publik) 4. Bidang Aplikasi Informatika : (Seksi Tata Kelola dan Pemberdayaan TIK, Seksi Pengembangan Aplikasi, Seksi Persandian dan Keamanan Informasi) 5. Bidang Infrastruktur TIK : (Seksi Jaringan Infrastruktur TIK, Seksi Pemeliharaan Infrastruktur TIK, Seksi Pengendalian Infrastruktur TIK) 6. Bidang Pengelolaan Data dan Statistik : (Seksi Pengelolaan Data, Seksi Statistik, Seksi Evaluasi dan Informasi)', '0', '70988230850', '172', 'Dinas Komunikasi dan Informatika', '216220221040000', '342789'),
	(22, 'Dinas Koperasi dan Usaha Kecil Menengah', 'Dinas Koperasi dan Usaha Kecil Menengah', 'U022', 'opd', 1, NULL, 'Membantu Gubernur melaksanakan urusan\npemerintahan yang menjadi kewenangan Pemerintah\nProvinsi di bidang koperasi, usaha kecil dan menengah.', '"Perumusan kebijakan di bidang koperasi, usaha kecil\ndan menengah;"\n"Pelaksanaan kebijakan di bidang koperasi, usaha kecil\ndan menengah;"\n"Pelaksanaan evaluasi dan pelaporan di bidang\nkoperasi, usaha kecil dan menengah;"\n"Pelaksanaan administrasi Dinas di bidang koperasi,\nusaha kecil dan menengah; dan"\n"Pelaksanaan fungsi lain yang diberikan oleh Gubernur\nsesuai dengan tugas dan fungsinya."', NULL, NULL, NULL, NULL, 'foto/Endy Alim new.jpg', 'Dr. ENDY ALIM ABDI NUSA., S.IP., M.M.', 'Kepala', '', 'Jl. Raya Bandara Juanda No. 22 Sidoarjo ', 'http://diskopukm.jatimprov.go.id/', '@diskopukm.jatim', 'Diskopukm.jatimprov', '', '031 - 8676645', NULL, 'Sekretariat :\r\n1.Sub Bagian Tata Usaha 2. Sub Bagian Penyusunan Program Dan Anggaran 3. Sub\r\nBagian Keuangan Bidang Kelembagaan Dan Pengawasan : 1. Seksi Organisasi Dan\r\nTatalaksana 2. Seksi Penyuluhan Advokasi Dan Hukum 3. Seksi Pengawasan Dan\r\nAkuntabilitas Bidang Produksi Dan Restrukturisasi Usaha : 1. Seksi Produksi 2.\r\nSeksi Pengembangan Usaha 3. Seksi Restrukturisasi Usaha Bidang Pemasaran : 1.\r\nSeksi Pengembangan Jaringan Dan Kerjasama Pemasaran 2. Seksi Fasilitasi\r\nPengembangan Informasi Dan Wirausaha 3. Seksi Promosi Bidang Pembiayaan : 1. Seksi\r\nUsaha Simpan Pinjam 2. Seksi Fasilitasi Permodalan 3. Seksi Pembiayaan Dan Jasa\r\nKeuangan Upt Pelatihan Koperasi, Usaha Kecil Dan Menengah : 1. Sub Bagian Tata\r\nUsaha 2. Seksi Pengembangan Pelatihan 3. Seksi Penyelenggara Pelatihan', '1', 'Anggaran Murni : Rp. 97.207.451.700', '181', 'Dinas Koperasi, Usaha Kecil dan Menengah', '217000000010000', '282564'),
