	(38, 'Dinas Tenaga Kerja dan Transmigrasi', 'Dinas Tenaga Kerja dan Transmigrasi', 'U038', 'opd', 1, NULL, 'Membantu Gubernur melaksanakan urusan\npemerintahan yang menjadi kewenangan Pemerintah\nProvinsi di bidang tenaga kerja dan transmigrasi serta\ntugas pembantuan.', '"Perumusan kebijakan di bidang tenaga kerja dan\ntransmigrasi;\n"\n"Pelaksanaan kebijakan di bidang tenaga kerja dan\ntransmigrasi;"\n"Pelaksanaan evaluasi dan pelaporan di bidang tenaga\nkerja dan transmigrasi;"\n"Pelaksanaan administrasi dinas di bidang tenaga\nkerja dantransmigrasi; dan"\n"Pelaksanaan fungsi lain yang diberikan oleh\nGubernur terkait dengan tugas dan fungsinya.\n"', NULL, NULL, NULL, NULL, 'foto/WhatsApp-Image-2024-01-16-at-1.53.29-PM-1536x1536.jpeg', 'SIGIT PRIYANTO, S.T., M.M.', 'Kepala', '', 'Jl. Dukuh Menanggal No. 124-126 Surabaya', 'https://disnakertrans.jatimprov.go.id/', '@naker_jatim', 'Disnakerprovjatim', '', ' (031) 8280254', NULL, '1 Sekretariat dan 5 Bidang ( Bidang Penempatan dan Perluasan Kesempatan Kerja, Bidang Pelatihan dan Produktivitas, Bidang Pengawasan dan Ketenagakerjaan dan Keselamatan Kerja, Bidang Hubungan Industrial dan Jaminan Sosial, Bidang Transmigrasi', '19 UPT', '328.815.405.000', 'PNS : 739, PTT : 97', 'Dinas Tenaga Kerja dan Transmigrasi', '207332000020000', '552843'),
	(39, 'Inspektorat', 'Inspektorat', 'U039', 'opd', 1, NULL, 'Membantu Gubernur membina dan mengawasi pelaksanaan urusan pemerintahan yang menjadi kewenangan pemerintah Provinsi dan tugas pembantuan oleh Perangkat Daerah serta melaksanakan pengawasan penyelenggaraan pemerintahan daerah Kabupaten/Kota.', 'Perumusan kebijakan teknis pengawasan dan fasilitasi pengawasan;\nPelaksanaan pengawasan internal terhadap kinerja dan keuangan melalui audit, reviu, evaluasi, pemantauan, dan kegiatan pengawasan lainnya; \nPelaksanaan pengawasan untuk tujuan tertentu atas penugasan dari Gubernur dan/atau Menteri; \nPenyusunan laporan hasil pengawasan;\nPelaksanaan koordinasi pencegahan tindak pidana korupsi; \nPengawasan pelaksanaan program reformasi birokrasi;\nPelaksanaan administrasi Inspektorat; dan \nPelaksanaan fungsi lain yang diberikan oleh Gubernur terkait dengan tugas dan fungsinya.', NULL, NULL, NULL, NULL, 'foto/WhatsApp Image 2024-04-17 at 12.19.18.jpeg', 'Ir. HENDRO GUNAWAN., M.A.', 'Inspektur', '', 'Jl. Raya Bandara Juanda No.8 Gedangan, Kabupaten Sidoarjo', 'https://inspektorat.jatimprov.go.id/', '', '', '', '031-99446457', NULL, 'Bagian Sekretariat (Sub Bagian Tata Usaha, Sub Bagian Program dan Pelaporan, Sub Bagian Keuangan), Bidang I, Bidang II, Bidang III, Bidang IV, dan Bidang Khusus', '0', '89.347.450.000', '129 (115 PNS dan 14 PTT-PK)', 'Inspektorat', '601000000010000', '230525'),
	(40, 'RS. Jiwa Menur ', 'RS. Jiwa Menur ', 'U040', 'uobk', 1, NULL, 'Melaksanakan upaya kesehatan secara berdaya guna dan berhasil guna dengan mengutamakan upaya penyembuhan (kuratif) dan pemulihan (rehabilitatif) yang dilaksanakan secara serasi dan terpadu dengan upaya promotif, pencegahan, dan pelayanan rujukan kesehatan serta penyelenggaraan pendidikan, pelatihan tenaga kesehatan, penelitian, dan pengembangan di bidang kesehatan', 'Pelayanan medik;\r\nPelayanan penunjang medik dan non medik;\r\nPelayanan dan asuhan keperawatan;\r\nPelayanan rujukan;\r\nUsaha pendidikan dan pelatihan;\r\nPelaksanaan fasilitasi penyelenggaraan pendidikan bagi calon dokter, dokter spesialis, subspesialis dan tenaga kesehatan lainnya;\r\nPenelitian dan pengembangan kesehatan;\r\nPenyelenggaraan kegiatan ketatusahaan;\r\nPelaksanaan program kesehatan nasional;\r\nPelaksanaan fungsi lain yang diberikan oleh Kepala Dinas;', NULL, NULL, NULL, NULL, 'foto/Foto drg vitria dewi (1).jpg', 'drg. Vitria Dewi,M.Si', 'Direktur', '', 'Jl. Menur No. 120 Surabaya', 'https://rsjmenur.jatimprov.go.id/', '@rs.jiwamenur', 'RsJiwa Menur', '', '(031) 5021635', NULL, '2 Wakil Direktur, 3 Bidang (6 Seksi), 3 Bagian (6 Subbagian). Wakil Direktur Pelayanan Medik dan Keperawatan, Wakil Direktur Umum dan Keuangan. Bidang Pelayanan Medik (Seksi Pelayanan Rawat Jalan dan Rawat Darurat, Seksi Pelayanan Rawat Inap, Bidang Penunjang Medik (Seksi Penunjang Medik, Seksi Rekam Medik), Bidang Keperawatan (Seksi Asuhan dan Mutu Keperawatan, Seksi Tenaga dan Sarana Keperawatan), Bagian Tata Usaha (Subbag Umum dan Kepegawaian, Subbag Perlengkapan), Bagian Keuangan (Subbag Verifikasi dan Akuntansi, Subbag Penerimaan Pendapatan dan Perbendaharaan), Bagian Program (Subbag Penyusunan Program dan Anggaran, Subbag Evaluasi dan Pelaporan)', '0', 'Rp181.890.479.000,00 (Murni)', '445', 'Rumah Sakit Jiwa Menur Surabaya', '102000000010005', '747028'),
	(41, 'RSUD dr. Saiful Anwar ', 'RSUD dr. Saiful Anwar ', 'U041', 'uobk', 1, NULL, 'Melaksanakan upaya kesehatan secara berdaya guna dan berhasil guna dengan mengutamakan upaya penyembuhan dan pemulihan yang dilaksanakan secara serasi dan terpadu dengan upaya peningkatan, pencegahan dan penyelenggaraan upaya rujukan serta penyelenggaraan pendidikan, pelatihan, penelitian dan pengembangan kesehatan.', 'Pelayanan asuhan pasien secara professional;\r\nPenyelenggaraan pendidikan dan penelitian dalam rangka pengembangan pelayanan kesehatan;\r\nPengelolaan manajemen sumber daya secara efektif dan efisien;\r\nPenyelenggaraan dukungan penanganan masalah kesehatan masyarakat;\r\nPelaksanaan program kesehatan nasional;\r\nPelaksanaan fungsi lain yang diberikan oleh Kepala Dinas;', NULL, NULL, NULL, NULL, 'foto/Direktur-scaled-removebg-preview.jpg', 'Dr. dr. Moch. Bachtiar Budianto,Sp.B,Subsp. Onk.(K),FINACS,FICS', 'Direktur', '', 'Jl Jaksa Agung Soeprapto No. 2 Malang', 'https://rsusaifulanwar.jatimprov.go.id/', '@rssaifulanwar', '', '', ' (0341) 362101', NULL, '33, 1 Bidang Pelayanan Medik, 2. Seksi Pelayanan Inap, Rawat Intensif dan Pembedahan, 3. Seksi Pelayanan Rawat Jalan dan Rawat Darurat, 4. Bidang Keperawatan, 5. Seksi Sarana dan Tenaga Keperawatan, 6. Seksi Pelayanan Keperawatan, 7. Bidang Penunjang Medik, 8. Seksi Penunjang Terapi, 9. Seksi Penunjang Diagnostik,10 Bidang Penunjang Non Medik,11 Seksi Penunjang Pelayanan Langsung, 12 Seksi Penunjang Umum, 13. Bidang Rekam Medik & Evaluasi Pelaporan, 14. Seksi Rekam Medik, 15. Seksi Evaluasi Pelaporan, 16. Bidang Pendidikan & Penelitian, 17. Seksi Pendidikan, 18. Seksi Penelitian, 19 Bidang Pengembangan Profesi, 20. Seksi Pengembangan Tenaga Medik & Keperawatan, 21. Seksi Pengembangan Tenaga Non Medik, 22. Bagian Umum, 23. Sub Bag Tata Usaha, 24. Sub Bag Kepegawaian, 25. Sub Bag Humas & Pemasaran, 26. Bagian Perencanaan & Anggaran, 27. Sub Bag Perencanaan, 28. Sub Bag Anggaran, 29. Sub Bag Perlengkapan & Asset, 30. Bag