	(42, 'RSUD. dr. Soedono ', 'RSUD. dr. Soedono ', 'U042', 'uobk', 1, NULL, 'Menyelenggarakan pelayanan kesehatan dengan upaya penyembuhan, pemulihan, peningkatan, pencegahan serta pelayanan rujukan dan menyelenggarakan pendidikan serta pelatihan, penelitian dan pengembangan serta pengabdian masyarakat', 'Penyelenggaraan pelayanan medik;\r\nPenyelenggaraan pelayanan penunjang medik dan non medik;\r\nPenyelenggaraan pelayanan dan asuhan keperawatan;\r\nPenyelenggaraan usaha pendidikan dan pelatihan;\r\nPenyediaan fasilitas dan bertanggung jawab terhadap penyelenggaraan pendidikan bagi calon dokter, dokter spesialis, dan tenaga kesehatan lainnya;\r\nPenyelenggaraan penelitian dan pengembangan kesehatan serta penapisan teknologi bidang kesehatan dalam rangka peningkatan pelayanan kesehatan;\r\nPenyelenggaraan kegiatan ketatausahaan;\r\nPelaksanaan program kesehatan nasional;\r\nPelaksanaan fungsi lain yang diberikan oleh Kepala Dinas;', NULL, NULL, NULL, NULL, 'foto/RS dr. Ananda Haris, Sp. BS.jpg', 'dr. TAUHID ISLAMY, Sp.OG., K-Fm', 'Direktur', '', 'Jl. dr. Sutomo No. 59, Kota Madiun', 'https://rssoedono.jatimprov.go.id/', '@rssoedono', 'Rssoedono', '', '(0351) 464325', NULL, '4 Bidang dengan 8 Sie, 3 Bagian dengan 8 Subbag. Bidang Pelayanan Medik (Sie Rawat Jalan, Sie Rawat Inap), Bidang Keperawatan (Sie Asuhan dan Mutu Keperawatan, Sie Pengembangan Monev Keperawatan), Bidang Penunjang Medik (Sie Pengembangan Fasilitas Medik, Sie Monev Fasilitas Medik), Bidang Pendidikan dan Pelatihan (Sie Pendidikan dan Pelatihan, Sie Penelitian dan Pengembangan), Bagian Tata Usaha (Subbag Umum, RT, Hukum, Humas dan Pemasaran, Subbag Kepegawaian, Subbag Perlengkapan), Bagian Keuangan dan Akuntansi (Subbag Penerimaan Pendapatan, Subbag Verifikasi dan Akuntansi, Subbag Perbendaharaan), Bagian Perencanaan Program dan Evaluasi (Subbag Penyusunan Program dan Anggaran, Subbag Evaluasi dan Pelaporan)', '0', 'Rp 367.817.928.000', '1035 orang (716 PNS dan 319 PTTPK)', 'Rumah Sakit Umum Dr. So