Sub Bag Perencanaan Program & Anggaran , Sub Bag Evaluasi & Pelaporan)         10.        Bagian Tata Usaha  (Sub Bag Umum & Rumah Tangga, Sub Bag Perlengkapan & Aset , Sub Bag Perundang-undangan & Ketertiban)    11.Bagian Keuangan (Sub Bag Perbendaharaan, Sub Bag Penerimaan , Sub Bag Verifikasi, Sub Bag Akuntansi)', '0', 'anggaran murni 2021 total Rp 1.430.675.288.000', 'PNS : 2256 pegawai            BLUD : 1744 pegawai  ', 'Rumah Sakit Umum Dr. Soetomo Surabaya', '102000000010001', '884966'),
	(44, 'RSUD. HAJI', 'RSUD. HAJI', 'U044', 'uobk', 1, NULL, 'Menyelenggarakan pelayanan kesehatan dengan upaya penyembuhan, pemulihan, peningkatan, pencegahan serta pelayanan rujukan, dan menyelenggarakan pendidikan serta pelatihan, penelitian, dan pengembangan serta pengabdian masyarakat.', 'Penyelenggaraan pelayanan medik;\r\nPenyelenggaraan pelayanan penunjang medik dan non medik;\r\nPenyelenggaraan pelayanan dan asuhan keperawatan;\r\nPenyelenggaraan usaha pendidikan dan pelatihan;\r\nPenyediaan fasilitas dan bertanggung jawab terhadap penyelenggaraan pendidikan bagi calon dokter, dokter spesialis, dan tenaga kesehatan lainnya;\r\nPenyelenggaraan penelitian dan pengembangan kesehatan;\r\nPenyelenggaraan kegiatan ketatausahaan;\r\nPelaksanaan program kesehatan nasional; \r\nPelaksanakan fungsi lain yang diberikan oleh Kepala Dinas;', NULL, NULL, NULL, NULL, 'foto/drtauhid.jpg', 'dr. TAUHID ISLAMY, Sp.OG.,Subsp. K.Fm', 'Direktur', '', 'Jl. Manyar Kertoadi Surabaya ', 'https://rsuhaji.jatimprov.go.id/', '@rsuhaji', 'RSUD. HAJI ', '', '(031) 5924000', NULL, 'BIdang/Bagian : 7  Sie/Subag  :  17', '0', 'Rp. 405.284.914.209,00', '1.193', 'Rumah Sakit Haji Surabaya', '102000000010004', '834156'),
	(45, 'Satuan Polisi Pamong Praja', 'Satuan Polisi Pamong Praja', 'U045', 'opd', 1, NULL, 'Membantu Gubernur melaksanakan\nurusan pemerintahan yang menjadi kewenangan\nPemerintah Provinsi di bidang ketertiban umum,\nketenteraman, dan pelindungan masyarakat sub urusan\nketenteraman dan ketertiban umum dan urusan\npemerintahan di bidang pemadam kebakaran dan\npenyelamatan', '"Penyusunan rencana strategis dan rencana kerja dan\nanggaran Satuan;"\n"Pelaksanaan rencana strategis dan dokumen\npelaksanaan anggaran Satuan;"\n"Pengoordinasian perumusan kebijakan teknis\nsub urusan ketenteraman dan ketertiban umum dan\nsub urusan pemerintahan di bidang pemadam\nkebakaran dan penyelamatan;"\n"Pengoordinasian penyelenggaraan urusan\npemerintahan dan pelayanan umum sub urusan\nketenteraman dan ketertiban umum dan sub urusan\npemerintahan di bidang pemadam kebakaran dan\npenyelamatan;\n"\n"Pengoordinasian pembinaan, pendidikan dan\npelatihan pelaksanaan tugas sub urusan\nketenteraman dan ketertiban umum dan sub urusan\npemerintahan di bidang pemadam kebakaran dan\npenyelamatan;"\n"Pengoordinasian pelaksanaan pengawasan,\npengendalian evaluasi, dan pelaporan sub urusan\nketenteraman dan ketertiban umum dan urusan\npemerintahan di bidang pemadam kebakaran dan\npenyelamatan;"\n"Pengoordinasian penegakan Peraturan Daerah dan\nPeraturan Gubernur, penyelenggaraan ketertiban\numum dan ketenteraman masyarakat dengan\nKepolisian Negara Republik Indonesia, Tentara\nNasional Indonesia, Penyidik Pegawai Negeri Sipil\ndan/atau Perangkat Daerah lainnya;"\n"Pengoordinasian pengelolaan kesekretariatan meliputi\nperencanaan, kerja sama, kepegawaian, keuangan,\nevaluasi dan pelaporan;"\n"Pengoordinasian pelaksanaan pembinaan\naparatur, pelatihan teknis dan Kelompok Jabatan\nFungsional;\n"\n"Pengoordinasian pengawasan, pengendalian evaluasi,\ndan pelaporan sub urusan ketenteraman dan\nketertiban umum dan urusan pemerintahan di bidang\npemadam kebakaran dan penyelamatan;"\n"Pengawasan terhadap masyarakat, aparatur, atau\nbadan hukum agar mematuhi dan menaati Peraturan\nDaerah dan Peraturan Gubernur; dan"\n"Pelaksanaan tugas lain yang diberikan oleh\nGubernur."', NULL, NULL, NULL, NULL, 'foto/Kasatpol PP.jpg', 'Dr. ANDIK FADJAR TJAHJONO, M.Si', 'Kepala', '', 'Jl. Jagir Wonokromo No. 352 Surabaya', 'http://satpolpp.jatimprov.go.id/', '@satpolpp_prov.jatim', 'Praja Wibawa', '', '(031) 8412159', NULL, '1 Sekretariat (Subbag TU/Subbag Program/Subbag Keuangan) dan 4 Bidang (Bidang SDA/Bidang Linmas/Bidang Trantibum/Bidang Gakda', '0', '107.793.977.620', '199', 'Satuan Polisi Pamong Praja', '105000000010000', '574658'),
	(46, 'Sekretariat DPRD', 'Sekretariat DPRD', 'U046', 'opd', 1, NULL, 'Menyelenggarakan administrasi\nkesekretariatan dan keuangan, mendukung\npelaksanaan tugas dan fungsi DPRD Provinsi, serta\nmenyediakan dan mengoordinasikan tenaga ahli yang\ndiperlukan oleh DPRD Provinsi dalam melaksanakan\nhak dan fungsinya sesuai dengan kebutuhan.', 'Penyelenggaraan administrasi kesekretariatan DPRD;\n"Penyelenggaraan administrasi keuangan DPRD\nProvinsi;"\nFasilitasi penyelenggaraan rapat DPRD Provinsi; dan\n"Penyediaan dan pengoordinasian tenaga ahli yang\ndiperlukanoleh DPRD Provinsi."', NULL, NULL, NULL, NULL, 'foto/Alkun.jpeg', 'MOH. ALI KUNCORO,S.STP,M.Si', 'Sekretaris', '', 'Jl. Indrapura No.1 Surabaya', 'https://dprd.jatimprov.go.id/', '', '', '', '031-3531126', NULL, 'Bagian Umum (Sub Bagian Tata Usaha & Kepegawaian, Sub Bagian Perlengkapan & Pemeliharaan, Sub Bagian Rumah Tangga & Protokol); Bagian Persidangan (Sub Bagian Rapat & Risalah, Sub Bagian Komisi & Panitia, Sub Bagian Layanan Aspirasi Masyarakat); Bagian Keuangan (Sub Bagian Penyusunan Program Dan Anggaran, Sub Bagian Perbendaharaan, Sub Bagian Verifikasi); Bagian Perundang-Undangan (Sub Bagian Produk Hukum, Sub Bagian Data & Perpustakaan, Sub Bagian Dokumentasi, Informasi & Publikasi); Jumlah Bagian = 4; Jumlah Sub Bagian = 12', '0', 'Rp. 420.785.086.129,-', '116', 'Sekretariat DPRD', '402000000010000', '993086'),
	(47, 'Biro Pemerintahan dan Otonomi Daerah', 'Biro Pemerintahan dan Otonomi Daerah', 'U048', 'opd', 1, NULL, 'Membantu Asisten Pemerintahan dan Kesejahteraan Rakyat dalam :\n"1. Menyiapkan perumusan kebijakan daerah; "\n"2. Mengoordinasikan pelaksanaan tugas Perangkat Daerah; "\n"3. Memantau dan evaluasi pelaksanaan kebijakan di bidang pemerintahan, otonomi daerah, dan kerja sama."', '"1. Penyiapan perumusan kebijakan daerah di bidang pemerintahan, otonomi daerah dan kerja sama; "\n"2. Penyiapan pengoordinasian pelaksanaan tugas Perangkat Daerah di bidang pemerintahan, otonomi daerah dan kerja sama; "\n"3. Penyiapan pemantauan dan evaluasi pelaksanaan kebijakan di bidang pemerintahan, otonomi daerah dan kerja sama; dan"\n"4. Pelaksanaan fungsi lain yang diberikan oleh Asisten Pemerintahan dan Kesejahteraan Rakyat."', NULL, NULL, NULL, NULL, 'foto/WhatsApp Image 2024-10-14 at 08.57.13 (1).jpeg', 'Dr. LILIK PUDJIASTUTI, S.H., M.H.', 'Kepala', '', 'Jl. Pahlawan No.110, Surabaya ', 'http://ropem.jatimprov.go.id/', '', '', '', '031-3524001', NULL, '3 bagian, dan 9 Subbag', '0', '28.956.014.000', '62 orang', 'Biro Pemerintahan dan Otonomi Daerah', '401000000010000', '223717'),
	(48, 'Biro Administrasi Pembangunan', 'Biro Administrasi Pembangunan', 'U049', 'opd', 1, NULL, 'Membantu Asisten Perekonomian dan Pembangunan dalam:\n1.        Melaksanakan penyiapan pengoordinasian perumusan kebijakan daerah; \n"2. Mengoordinasikan pelaksanaan tugas Perangkat Daerah;"\n"3. Melaksanakan pemantauan dan evaluasi pelaksanaan kebijakan daerah di bidang pengendalian administrasi pelaksanaan pembangunan daerah;"\n"4. Melaksanakan pengendalian administrasi pelaksanaan pembangunan wilayah; "\n"5. Melaksanakan tugas Simpul Kerja Sama Pemerintah dengan badan usaha dalam penyediaan infrastruktur; dan"\n"6. Melaporkan pelaksanaan pembangunan."', '"1. Penyiapan pengoordinasian perumusan kebijakan daerah di bidang pengendalian administrasi pelaksanaan pembangunan daerah, pengendalian administrasi pelaksanaan pembangunan wilayah, Simpul KPBU dalam penyediaan infrastruktur dan pelaporan pelaksanaan pembangunan; "\n"2. Penyiapan pengoordinasian pelaksanaan tugas Perangkat Daerah di bidang pengendalian administrasi pelaksanaan pembangunan daerah, pengendalian administrasi pelaksanaan pembangunan wilayah, Simpul KPBU dalam penyediaan infrastruktur, dan pelaporan pelaksanaan pembangunan;"\n"3. Penyiapan pemantauan dan evaluasi pelaksanaan kebijakan daerah terkait pencapaian tujuan kebijakan, dampak yang tidak diinginkan, dan faktor yang mempengaruhi pencapaian tujuan kebijakan di bidang pengendalian administrasi pelaksanaan pembangunan daerah, pengendalian administrasi pelaksanaan pembangunan wilayah, Simpul KPBU dalam penyediaan infrastruktur, dan pelaporan pelaksanaan pembangunan; dan "\n"4. Pelaksaaan fungsi lain yang diberikan oleh Asisten Perekonomian dan Pembangunan."', NULL, NULL, NULL, NULL, 'foto/WhatsApp Image 2024-09-10 at 11.04.32.jpeg', 'R. HENGGAR SULISTIARTO, S.H., M.M', 'Kepala', '', 'Gedung Sekretariat Daerah Provinsi Jawa Timur Lantai 2, Jalan Pahlawan No. 110, ', 'https://ro-admpembangunan.jatimprov.go.id/', '@biro.ap.jatim', '', '', '(031) 3524011', NULL, 'Biro Administrasi Pembangunan memiliki 3 Bagian dan masing-masing Bagian memiliki 3 Sub Bagian : A. Bagian Pengendalian Administrasi Pelaksanaan Pembangunan Daerah memiliki 3 Sub Bagian : (1) Sub Bagian Pengendalian Administrasi Pelaksanaan Pembangunan APBD, (2) Sub Bagian Pengendalian Administrasi Pelaksanaan Pembangunan APBN, (1) Sub Bagian Tata Usaha; B. Bagian Pengendalian Pelaksanaan Pembangunan Wilayah memiliki 3 Sub Bagian yaitu : (1) Sub Bagian Pengendalian Administrasi Pelaksanaan Pembangunan wilayah I; (2) Sub Bagian Pengendalian Administrasi Pelaksanaan Pembangunan Wilayah II; (3) Sub Bagian Pengendalian Administrasi Pelaksanaan Pembangunan wilayah III; C. Bagian Pelaporan Pelaksanaan Pembangunan memiliki 3 sub Bagian yaitu : (1) Sub Bagian Analisis Capaian Pelaksanaan Pembangunan; (2) Sub Bagian Pelaporan Pelaksanaan Pembangunan; (3) Sub Bagian Kebijakan Pembangunan Daerah', '0', '27.769.949.000 ( Setelah Refocusing)', '67 orang', 'Biro Administrasi Pembangunan', '401000000060000', '960020'),
	(49, 'Biro Perekonomian', 'Biro Perekonomian', 'U050', 'opd', 1, NULL, 'Membantu Asisten Perekonomian dan Pembangunan dalam:\n"1. Menyiapkan pengoordinasian perumusan kebijakan; "\n"2. Mengoordinasikan pelaksanaan tugas Perangkat Daerah; dan "\n"3. Melakukan pemantauan dan evaluasi pelaksanaan kebijakan di bidang kebijakan dan sarana perekonomian, sumber daya alam, Badan Usaha Milik Daerah, investasi daerah dan Badan Layanan Umum Daerah."', '"1. Penyiapan perumusan kebijakan di bidang perekonomian; "\n"2. Pelaksanaan koordinasi, pembinaan dan penyusunan program kegiatan serta petunjuk teknis pelaksanaan di bidang kebijakan dan sarana perekonomian, sumber daya alam, BUMD, investasi daerah dan BLUD; "\n"3. Pelaksanaan pembinaan administrasi pemerintahan dan pembangunan serta sumber daya aparatur di bidang perekonomian; "\n"4. Penyiapan pemantauan dan evaluasi pelaksanaan kebijakan terkait pencapaian tujuan kebijakan, dampak yang tidak diinginkan, dan faktor yang mempengaruhi pencapaian tujuan kebijakan di bidang kebijakan dan sarana perekonomian, sumber daya alam, dan BUMD, investasi daerah dan BLUD; dan "\n"5. Pelaksanaan fungsi lain yang diberikan oleh Asisten Perekonomian dan Pembangunan."', NULL, NULL, NULL, NULL, 'foto/WhatsApp Image 2024-07-11 at 10.42.14.jpeg', 'Dr. MHD. AFTABUDDIN RIJALUZZAMAN, S.Pt., M.Si.', 'Kepala', '', 'Jalan Pahlwanan No. 110 Surabaya', 'https://ro-ekonomi.jatimprov.go.id/', '', '', '', '(031) 3550958', NULL, '03-Sep', '0', '37.565.260.000,00', '51', 'Biro Perekonomian', '401000000040000', '532669'),
	(50, 'Biro Hukum', 'Biro Hukum', 'U051', 'opd', 1, NULL, 'Membantu Asisten Pemerintahan dan Kesejahteraan Rakyat dalam:\n"1. Menyiapkan perumusan kebijakan daerah;"\n"2. Mengoordinasikan pelaksanaan tugas Perangkat Daerah; "\n"3. Melaksanakan pemantauan dan evaluasi pelaksanaan kebijakan pembentukan produk hukum Provinsi, bantuan hukum dan Hak Asasi Manusia, penyuluhan, dokumentasi dan informasi hukum; dan "\n"4. Melaksanakan pembinaan dan pengawasan kebijakan Kabupaten/Kota"', '"1. Pelaksanaan perumusan pembentukan produk hukum Provinsi baik yang bersifat pengaturan (regeling) maupun penetapan (beschikking); "\n"2. Pelaksanaan harmonisasi, sinkronisasi dan penyelarasan terhadap produk hukum Provinsi baik yang bersifat pengaturan (regeling) maupun penetapan (beschikking);"\n"3. Pelaksanaan penyiapan bahan pertimbangan dan bantuan hukum kepada semua unsur di lingkungan Pemerintah Provinsi; "\n"4. Pelaksanaan pengelolaan dokumentasi dan informasi hukum; "\n"5. Pelaksanaan penyuluhan hukum; "\n"6. Pelaksanaan pembinaan dan pengawasan, monitoring dan evaluasi kebijakan Pemerintah Kabupaten/Kota; dan "', NULL, NULL, NULL, NULL, 'foto/WhatsApp Image 2024-10-15 at 09.00.35_495f955e.jpg', 'Dr. Lilik Pudjiastuti, S.H., M.H.', 'Kepala', '', 'Jalan Pahlwanan No. 110 Surabaya', 'http://dokumjdih.jatimprov.go.id/', '@birohukumjatim', '', '', '(031) 3520881', NULL, '1. Bagian Produk Hukum Provinsi: Sub Bagian Produk Hukum Provinsi I, Sub Bagian Produk Hukum Provinsi II, dan Sub Bagian Dokumentasi dan Informasi Hukum; 2. Bagian Pembinaan dan Pengawasan Kebijakan Kabupaten/Kota: Sub Bagian Pembinaan dan Pengawasan Kebijakan Kabupaten/Kota Wilayah I, Sub Bagian Pembinaan dan Pengawasan Kebijakan Kabupaten/Kota Wilayah II, dan Sub Bagian Pembinaan dan Pengawasan Kebijakan Kabupaten/Kota Wilayah III; 3. Bagian Bantuan Hukum dan Hak Asasi Manusia: Sub Bagian Litigasi, Sub Bagian Non Litigasi dan Hak Asasi Manusia, dan Sub Bagian Tata Usaha. ', '0', 'Rp. 21.131.589.000,00', '39 PNS Dan 4 PTT-PK', 'Biro Hukum', '401000000030000', '423312'),
	(51, 'Biro Kesejahteraan Rakyat', 'Biro Kesejahteraan Rakyat', 'U052', 'opd', 1, NULL, 'Membantu Asisten Pemerintahan dan Kesejahteraan Rakyat dalam:\n"1. Melaksanakan penyiapan pengoordinasian perumusan kebijakan; "\n"2. Mengoordinasikan pelaksanaan tugas Perangkat Daerah; dan "\n"3. Melakukan pemantauan dan evaluasi pelaksanaan kebijakan di bidang bina mental spiritual, kesejahteraan rakyat non pelayanan dasar, dan kesejahteraan rakyat pelayanan dasar."', '"1. Penyiapan pengoordinasian perumusan kebijakan di bidang bina mental spiritual, kesejahteraan rakyat non pelayanan dasar, dan kesejahteraan rakyat pelayanan dasar; "\n"2. Penyiapan pengoordinasian pelaksanaan tugas perangkat daerah di bidang bina mental spiritual, kesejahteraan rakyat non pelayanan dasar, dan kesejahteraan rakyat pelayanan dasar;"\n"3. Penyiapan pemantauan dan evaluasi pelaksanaan kebijakan terkait pencapaian tujuan kebijakan, dampak yang tidak diinginkan, dan faktor yang mempengaruhi pencapaian tujuan kebijakan di bidang bina mental spiritual, kesejahteraan rakyat non pelayanan dasar, dan kesejahteraan rakyat pelayanan dasar; dan"\n"4. Pelaksanaan fungsi lain yang diberikan oleh Asisten Pemerintahan dan Kesejahteraan Rakyat."', NULL, NULL, NULL, NULL, 'foto/14.jpg', 'Imam Hidayat,S.Sos.,M.M', 'Kepala', '', 'Jalan Pahlwanan No. 110 Surabaya', 'https://ro-kessos.jatimprov.go.id/', '@kessosjatim_official', '', '', '(031) 3524001', NULL, '3 Bagian dan 9 sub bagian : Bagian Bina Mental Spiritual. Sub Bagian Bina kehidupan spiritual, 2. Sub Bagian Sarana prasarana spiritual, 3. sub bag kelembagaan bina spiritual ; Bagian Kesejahteraan Rakyat Non Pelayanan Dasar: 1. Sub Bagian Non Pelayanan dasar 1, 2. SUb Bagian Non Pelayanan dasar II, 3. Sub Bag Tata Usaha ; Bagian Kesejahteraan Rakyat Pelayanan Dasar: 1. sub bagian keehatan, 2. sub bagian sosial, 3. sub bagian pendidikan', '0', '1.340.856.898.700', '136', 'Biro Kesejahteraan Rakyat', '401000000020000', '386623'),
	(52, 'Biro Pengadaan Barang/Jasa', 'Biro Pengadaan Barang/Jasa', 'U053', 'opd', 1, NULL, 'Membantu Asisten Perekonomian dan Pembangunan dalam:\n"1. Menyiapkan pengoordinasian perumusan kebijakan;"\n"2. Mengoordinasikan pelaksanaan tugas dan fungsi;"\n"3. Melaksanakan pembinaan teknis administrasi dan sumber daya; "\n"4. Melaksanakan pemantauan dan evaluasi program kegiatan; dan "\n"5. Menyelenggarakan dukungan pengadaan barang/jasa"', '"1. Pelaksanaan perumusan kebijakan pengadaan barang/jasa; "\n"2. Pelaksanaan koordinasi, penyusunan program kegiatan serta pelaksanaan tugas dan fungsi pengadaan barang/jasa; "\n"3. Pelaksanaan pengelolaan strategi pengadaan barang/jasa; "\n"4. Pelaksanaan pengelolaan pengadaan barang/jasa; "\n"5. Pelaksanaan pengelolaan Layanan Pengadaan Secara Elektronik (LPSE); "\n"6. Pelaksanaan pembinaan sumber daya manusia dan kelembagaan pengadaan barang/jasa;"\n"7. Pelaksanaan pendampingan, konsultasi, dan bimbingan teknis pengadaan barang/jasa;"\n"8. Pelaksanaan pemantauan, evaluasi, dan pelaporan pengadaan barang/jasa serta program kegiatan; dan Pelaksanaan fungsi lain yang diberikan oleh Asisten Perekonomian dan Pembangunan."', NULL, NULL, NULL, NULL, '1', 'ENDY ALIM ABDI NUSA,S.IP,MM', 'Kepala', '', 'Jalan Pahlawan No. 110 Surabaya', 'https://ropbj.jatimprov.go.id/', '@biro.pbjatim', '', '', '(031) 3557128', NULL, '9, Bagian Pengelolaan Pbj , Bagian Pengelolaan Lpse, Bagian Pembinaan Pbj. Sub Bagian Pengelolaan Strategi, Sub Bagian Pelaksanaan Pbj, Sub Bagian Pemantauan Dan Evaluasi. Sub Bagian Pengelolaan Spse, Sub Bagian Pengembangan Si, Sub Bagian Pengelolaan Informasi Pbj. Sub Bagian Pembinaan Sdm Dan Kelembagaan, Sub Bagian\r\nPendampingan, Konsultasi, Dan Bimbingan Teknis, Sub Bagian Tata Usaha', '0', '19.708.741.000,00', 'PNS : 44 PTT: 22', 'Biro Pengadaan Barang dan Jasa', '401000000100000', '259505'),
	(53, 'Biro Administrasi Pimpinan', 'Biro Administrasi Pimpinan', 'U054', 'opd', 1, NULL, 'membantu Asisten Administrasi Umum dalam :\n"1. Menyiapkan pelaksanaan kebijakan; dan "\n"2. Melaksanakan pemantauan dan evaluasi di bidang perencanaan dan kepegawaian Sekretariat Daerah, materi dan komunikasi pimpinan serta protokol."', '"Penyiapan pelaksanaan kebijakan di bidang perencanaan\ndan kepegawaian Sekretariat Daerah, materi dan\nkomunikasi pimpinan serta keprotokolan;"\n"Penyiapan pelaksanaan pemantauan dan evaluasi di\nbidang perencanaan dan kepegawaian Sekretariat\nDaerah, materi dan komunikasi pimpinan serta\nkeprotokolan; dan"\n"Pelaksanaan fungsi lain yang diberikan oleh Asisten\nAdministrasi Umum yang berkaitan dengan tugasnya."', NULL, NULL, NULL, NULL, 'foto/WhatsApp Image 2021-12-06 at 14.07.jpg', 'PULUNG CHAUSAR, S.STP,CM.M', 'Kepala', '', 'Jalan Pahlawan No. 110 Surabaya', 'http://birohumas.jatimprov.go.id', '', '', '', '(031) 3524001', NULL, '3 Bagian: Bagian Perencanaan dan Kepegawaian Setda (Subbagian Perencanaan dan Pelaporan Sekretariat Daerah, Subbagian Kepegawaian Sekretariat Daerah, Subbagian Tata Usaha), Bagian Materi Komunikasi Pimpinan (Subbagian Penyiapan Materi Pimpinan, Subbagian Komunikasi Pimpinan, Subbagian Dokumentasi Pimpinan), Bagian Protokol (Subbagian Protokol Acara, Subbagian Protokol Pelayanan Tamu, Subbagian Hubungan Keprotokoloan)', '0', '49.773.152.000', 'PNS: 57, PTT: 18, JFAK: 2', 'Biro Administrasi Pimpinan', '401000000090000', '318275'),
	(54, 'Biro Umum', 'Biro Umum', 'U055', 'opd', 1, NULL, 'Membantu Asisten Administrasi Umum dalam:\n"1. Menyiapkan pelaksanaan kebijakan; dan "\n"2. Melaksanakan pemantauan dan evaluasi di bidang rumah tangga, administrasi keuangan, aset, dan tata usaha."', '"1. Penyiapan pelaksanaan kebijakan di bidang rumah tangga, administrasi keuangan dan aset, serta tata usaha;"\n"2. Penyiapan pelaksanaan pemantauan dan evaluasi di bidang rumah tangga, administrasi keuangan dan aset, serta tata usaha; dan"\n"3. Pelaksanaan fungsi lain yang diberikan oleh Asisten Administrasi Umum."', NULL, NULL, NULL, NULL, '1', 'Yanuar Rachmadi, S.Sos, MM', 'Kepala', NULL, 'Jalan Pahlawan No. 110 Surabaya', 'https://ppid.ro-umum.jatimprov.go.id/', '@biroumumjatim', 'ASN Biro Umum', NULL, '(031) 3524001', NULL, '1. Bagian Rumah Tangga, 2. Bagian Administrasi Keuangan dan Aset, 3. Bagian Tata Usaha', '0', 'Rp.266.282.474.505,-', 'PNS : 111 orang PTT : 90 orang', 'Biro Umum', '401000000080000', '835554'),
	(55, 'Biro Organisasi', 'Biro Organisasi', 'U047', 'opd', 1, NULL, 'Membantu Asisten Administrasi Umum dalam:\nMenyiapkan perumusan kebijakan daerah;\nMengoordinasikan perumusan kebijakan daerah;\nMengoordinasikan pelaksanaan tugas Perangkat Daerah; dan\nMemantau dan mengevaluasi pelaksanaan kebijakan daerah di bidang kelembagaan dan analisis jabatan, reformasi birokrasi dan akuntabilitas kinerja dan tata laksana', '"1. Penyiapan perumusan kebijakan daerah di bidang kelembagaan dan analisis jabatan, reformasi birokrasi dan akuntabilitas kinerja dan tata laksana; "\n2. Penyiapan pengoordinasian perumusan kebijakan daerah di bidang kelembagaan dan analisis jabatan, reformasi birokrasi dan akuntabilitas kinerja dan tata laksana;\n"3. Penyiapan pengoordinasian pelaksanaan tugas Perangkat Daerah di bidang kelembagaan dan analisis jabatan, reformasi birokrasi dan akuntabilitas kinerja dan tata laksana; "\n"4. Penyiapan pemantauan dan evaluasi pelaksanaan kebijakan daerah di bidang kelembagaan dan analisis jabatan, reformasi birokrasi dan akuntabilitas kinerja dan tata laksana; dan "\n"5. Pelaksanaan fungsi lain yang diberikan oleh Asisten Administrasi Umum."', NULL, NULL, NULL, NULL, 'foto/Plt. Kabiro Organisasri.jpg', 'Budi Raharjo, SE., M.Si', 'Kepala', '', 'Gedung Sekretariat Daerah Provinsi Jawa Timur Lantai IV , Jalan Pahalawan No 110 Surabaya ', 'https://ro-organisasi.jatimprov.go.id/', '@ro.oragnisasi.jatim', '', '', '031 3533832', NULL, 'A. Bagian Tatalaksana terdiri dari 3 Sub Bagian yaitu (1) Sub Bagian Tata Usaha, (2) Sub bagian Tatalaksana Pemerintahan (3) Tatalaksana Pelayanan Publik. B. Bagian Kelembagaan dan Analisis Jabatan terdiri dari 3 Sub bagian yaitu (1) Sub bagian Pembinaan dan pengendalian Kelembagaan Kab/Kota (b) Sub Bagian  Analis dan Formasi Jabatan (c) Sub Bagian Kelembagaan Perangkat Daerah  C. Bagian Reformasi Birokrasi dan Akuntabilitas Kinerja terdiri 3 Sub Bagian yaitu (1) Sub Bagian Percepatan Reformasi Birokrasi (2) Sub Bagian Akuntabiltas Kinerja (3) Sub Bagian Budaya Kerja', '0', 'Rp 20.233.442.000', '43 Orang', 'Biro Organisasi', '401000000070000', '242729'),
	(57, 'Kabupaten Pacitan', 'Kabupaten Pacitan', NULL, 'kab', 1, NULL, 'Masyarakat Pacitan Sejahtera dan Bahagia', 'Mewujudkan percepatan pemerataan pembangunan infrastruktur dan pembangunan wilayah perbatasan dengan tetap memperhatikan kualitas lingkungan hidup;\r\nMewujudkan pembangunan dan peningkatan daya saing SDM yang kukuh berpijak pada nilai-nilai agama dan budaya bangsa;\r\nMeningkatkan pertumbuhan ekonomi melalui sektor agraris, sektor pariwisata serta sektor unggulan lainnya;\r\nMenciptakan birokrasi pemerintah yang inovatif, profesional, dan melayani;', NULL, NULL, NULL, NULL, 'foto/pacitan.jpg', 'Ir. BUDI SARWOTO, M.M.', 'Bupati', '', 'Jalan Jaksa Agung Suprapto No.8 Pacitan', 'pacitankab.go.id', '@pemkabpacitan', '', '', '0357-88288', NULL, '', '', '', '', 'Kabupaten Pacitan', NULL, '676188'),
	(58, 'Kabupaten Ponorogo', 'Kabupaten Ponorogo', NULL, 'kab', 1, NULL, 'Mewujudkan Kabupaten Ponorogo HEBAT (Harmonis, Elok, Bergas, Amanah, dan Taqwa)', 'Meningkatkan Perekonomian Daerah Berbasis Pertanian dan Pariwisata;\r\nMewujudkan Kesejahteraan Masyarakat Melalui Peningkatan Pelayanan Dasar, Pemberdayaan Masyarakat dan Pembangunan Budaya;\r\nMewujudkan Pembangunan Infrastruktur dan Lingkungan Hidup yang Berkualitas dan Berkelanjutan;\r\nMewujudkan Tata Kelola Pemerintahan yang Amanah, Tangkas dan Responsif;', NULL, NULL, NULL, NULL, 'foto/ponorogo-min.jpeg', 'Ir. JOKO IRIANTO, M.Si', 'Bupati', '', 'Gedung Graha Krida Praja, Lantai II, Jalan Aloon-Aloon Utara Nomor 9, Ponorogo', 'https://ponorogo.go.id/', '@ponorogokab', '', '', '(0352) 82917', NULL, '', '', '', '', 'Kabupaten Ponorogo', NULL, '531911'),
	(59, 'Kabupaten Trenggalek', 'Kabupaten Trenggalek', NULL, 'kab', 1, NULL, 'Terwujudnya Kabupaten Trenggalek yang Maju Melalui Ekonomi Inklusif, Sumber Daya Manusia Kreatif dan Pembangunan Berkelanjutan (Sutainable Development)”', 'Memastikan UMKM Naik Kelas serta Membangun Tata Niaga Sektor Pertanian dan Perikanan yang Inklusif, Mendorong Investasi, Menciptakan Lapangan Pekerjaan, Menciptakan Wirausahawan Baru yang Berorientasi Pada Langkah Pengentasan Kemiskinan dan Ekonomi Pesantren;\r\nMewujudkan Trenggalek sebagai Kota Pariwisata Berbasis Kolaborasi dan Berkelanjutan Dimulai dari Pemberdayaan Masyarakat Desa;\r\nMewujudkan Pemerintahan Kolaboratif dan Mengarusutamaan Gender dalam Rangka Memastikan Pelayanan yang Prima,  Khususnya Pelayanan Adminduk, Pendidikan dan Kesehatan Berbasis Big Data (Satu Data Besar);\r\nMewujudkan Infrastruktur yang Handal dan Berwawasan Lingkungan;', NULL, NULL, NULL, NULL, 'foto/dpmptsp-trenggalek_11zon (1).jpg', 'Dr. Ir. DYAH WAHYU ERMAWATI, M.A.', 'Bupati', '', 'Jl. Pemuda No.1, Krajan, Surodakan, Kec. Trenggalek, Kabupaten Trenggalek, Jawa Timur 66316', 'https://trenggalekkab.go.id/', '@kominfotrenggalek', '', '', '(0355) 791222', NULL, '', '', '', '', 'Kabupaten Trenggalek', NULL, '733047'),
	(60, 'Kabupaten Tulungagung ', 'Kabupaten Tulungagung ', NULL, 'kab', 1, 'Terwujudnya SDM unggul, berkualitas dan berkarakter;\r\nMeningkatnya pertumbuhan ekonomi yang berkelanjutan;\r\nTersedianya infrastruktur yang berkualitas;\r\nMeningkatnya kualitas lingkungan hidup dan ketahanan bencana;\r\nMeningkatnya pembangunan sosial masyarakat;\r\nMeningkatnya kualitas pemerintahan dan pelayanan publik;\r\nMeningkatnya taraf hidup dan kesejahteraan masyarakat;', 'Terwujudnya Masyarakat Tulungagung yang Sejahtera, Mandiri, Berdaya Saing dan Berakhlak Mulia', 'Mewujudkan keterjangkauan akses pembangunan sumber daya manusia yang berkualitas, inklusif, dan berdaya saing;\r\nMendorong penguatan ekonomi kerakyatan yang berbasis kearifan lokal dan potensi daerah;\r\nPengentasan kemiskinan dan perlindungan sosial dalam mewujudkan ketentraman, rasa aman, serta ketertiban masyarakat;\r\nMembangun infrastuktur wilayah pinggiran yang berkualitas dalam mewujudkan pemerataan pembangunan;\r\nMewujudkan pemerintahan yang akuntabel, profesional, dan transparan yang berorientasi pada kepuasan masyarakat;', NULL, NULL, NULL, NULL, 'foto/WhatsApp Image 2023-10-11 at 09.37.12-fotor-bg-remover-2023101193843.jpg', 'Dr. Ir. HERU SUSENO, M.T.', 'Bupati', 'pemerintahan@tulungagung.go.id', 'Jl. A. Yani Timur Nomor 37 Tulungagung Kode Pos 66217', 'tulungagung.go.id', '@pemkabtulungagung', '', '', '(0355) 321884', NULL, '', '', '', '', 'Kabupaten Tulungagung ', NULL, '758177'),
	(61, 'Kabupaten Blitar', 'Kabupaten Blitar', NULL, 'kab', 1, NULL, 'Terwujudnya Kabupaten Blitar yang Mandiri dan Sejahtera Berlandaskan Akhlak Mulia. Baldatun, Toyyibatun, Warobbun Ghofur', 'Meningkatkan kesejahteraan sosial masyarakat Blitar berlandaskan iman dan takwa dengan kearifan lokal budaya;\r\nMeningkatkan taraf hidup masyarakat Blitar yang memiliki mutu dan nilai kompetensi tinggi, dengan mengoptimalkan potensi generasi muda Kabupaten Blitar;\r\nPengoptimalan kinerja Pemerintah yang akuntabel, inovatif dan berintegritas;\r\nPercepatan dan pemerataan pembangunan yang adil dan merata melalui pengembangan potensi ekonomi daerah dengan mengedepankan pemberdayaan masyarakat dan kelestarian lingkungan;', NULL, NULL, NULL, NULL, 'foto/blitar.jpg', 'Dr. Ir. JUMADI, M.M.,', 'Bupati', '', 'Jln. KUSUMA BANGSA No. 60 Kanigoro Blitar', 'www.blitarkab.go.id', '@pemkab_blitar', '', '', ' (0342) 801201', NULL, '', '', '', '', 'Kabupaten Blitar', NULL, '323375'),
	(62, 'Kabupaten Kediri', 'Kabupaten Kediri', NULL, 'kab', 1, NULL, 'Terwujudnya Masyarakat Kabupaten Kediri yang Maju, Berkarakter Nasionalis-Religius, Serta Sejahtera Berdasarkan Ekonomi Kerakyatan yang Didukung Birokrasi yang Melayani', 'Pengembangan Sumber Daya Manusia yang Berkarakter Nasionalis-Religius;\r\nReformasi Birokrasi dan Pelayanan Publik;\r\nPengembangan ekonomi Kerakyatan dan Peningkatan Investasi Daerah;\r\nRevitalisasi pertanian untuk ketahanan dan swasembada pangan;\r\nPeningkatan infrastruktur dan konektivitas antar wilayah;\r\nOptimalisasi kepariwisataan berbasis kearifan lokal;\r\nOptimalisasi tata kelola lingkungan hidup, sumber daya alam, dan mitigasi bencana;\r\nPengembangan seni budaya, olahraga dan kreatifitas pemuda;\r\nMewujudkan kemandirian desa untuk kesejahteraan masyarakat;', NULL, NULL, NULL, NULL, 'foto/Bakorwil Madiun-Kediri.jpg', 'R. HERU WAHONO SANTOSO, S.Sos., M.M.', 'Bupati', '', 'Jl. Soekarno Hatta No.1, Doko, Kec. Ngasem, Kabupaten Kediri, Jawa Timur 64182', 'https://kedirikab.go.id/', '@pemkab.kediri', '', '', '(0354) 689901', NULL, '', '', '', '', 'Kabupaten Kediri', NULL, '349308'),
	(63, 'Kabupaten Malang ', 'Kabupaten Malang ', NULL, 'kab', 1, NULL, 'Terwujudnya Kabupaten Malang yang MADEP MANTEB MANETEP', 'Memantapkan kesadaran dan partisipasi masyarakat dalam pembangunan guna menunjang percepatan revolusi mental yang berbasis nilai keagamaan yang toleran, budaya lokal, dan supremasi hukum;\r\nMemperluas inovasi dan reformasi birokrasi demi tata kelola pemerintahan yang bersih, efektif, akuntabel dan demokratis berbasisteknologi informasi;\r\nMelakukan percepatan pembangunan di bidang pendidikan, kesehatan, dan ekonomi guna meningkatkan Indeks PembangunanManusia;\r\nMengembangkan ekonomi masyarakat berbasis pertanian, pariwisata, dan industri kreatif;\r\nMelakukan percepatan pembangunan desa melalui penguatan kelembagaan, peningkatan kualitas SDM, dan pengembangan produk unggulan desa;\r\nMeningkatkan ketersediaan infrastruktur jalan, transportasi,telematika, sumber daya air, permukiman dan prasarana lingkunganyang menunjang aktivitas sosial ekonomi kemasyarakatan;\r\nMemperkokoh kesadaran dan perilaku masyarakat dalam menjaga kelestarian lingkungan hidup;', NULL, NULL, NULL, NULL, 'foto/26.Drs. H. M. SANUSI, M.M..jpg', 'Drs. H. M. SANUSI, M.M.', 'Bupati', '', 'Jl. KH. Agus Salim No. 07 Malang', 'www.malangkab.go.id', '@pemkabmalang', '', '', '(0341) 3061361', NULL, '', '', '', '', 'Kabupaten Malang ', NULL, '184737'),
	(64, 'Kabupaten Lumajang', 'Kabupaten Lumajang', NULL, 'kab', 1, 'Terciptanya ekonomi wilayah yang inklusif;\r\nTerciptanya kualitas Sumber Daya Manusia yang berkarakter dan kompetitif;\r\nTerwujudnya ruang wilayah yang nyaman dan berkelanjutan;\r\nTerwujudnya tata kelola pemerintahan yang baik dan inovatif;', '“Terwujudnya Masyarakat Lumajang yang Berdaya Saing, Makmur dan Bermartabat”', 'Mewujudkan perekonomian daerah berkelanjutan berbasis pada pertanian, usaha mikro, dan pariwisata;\r\nPemenuhan kebutuhan dasar untuk mewujudkan masyarakat yang lebih sejahtera dan mandiri;\r\nReformasi birokrasi yang efektif, profesional, akuntabel, dan transparan untuk mewujudkan pemerintahan yang baik, benar, dan bersih (good and clean governance) yang berbasih teknologi informasi;', NULL, NULL, NULL, NULL, 'foto/WhatsApp Image 2023-10-11 at 09.41.12-fotor-bg-remover-2023101194156.jpg', 'INDAH WAHYUNI, S.H, M.Si.', 'Bupati', '', 'JALAN ALUN-ALUN UTARA NO. 7 KELURAHAN ROGOTRUNAN KECAMATAN LUMAJANG', 'https://www.lumajangkab.go.id/', '@humas_lumajang', '', '', ' (0334) 881146', NULL, '', '', '', '', 'Kabupaten Lumajang', NULL, '454128'),
	(65, 'Kabupaten Jember', 'Kabupaten Jember', NULL, 'kab', 1, NULL, 'Terwujudnya Masyarakat Jember yang Kreatif, Sejahtera, Agamis, dan Bermartabat', 'Mewujudkan peningkatan aksesibilitas pelayanan pendidikan dan kesehatan yang berkualitas dan terjangkau;\r\nMengedepankan partisipasi dan menumbuhkembangkan kreatifitas masyarakat yang agamis dalam pembangunan;\r\nMewujudkan pertumbuhan ekonomi yang mengarah pada peningkatan kualitas hidup masyarakat;', NULL, NULL, NULL, NULL, 'foto/Kesra-Jember.jpg', 'IMAM HIDAYAT, S.Sos., M.M.', 'Bupati', '', 'Jalan sudarman nomor 1 kabupten jember', 'https://www.jemberkab.go.id', '@pemkabjember', '', '', '0331 428824', NULL, '', '', '', '', 'Kabupaten Jember', NULL, '285031'),
	(66, 'Kabupaten Banyuwangi', 'Kabupaten Banyuwangi', NULL, 'kab', 1, NULL, 'Terwujudnya Banyuwangi yang Semakin Maju, Sejahtera, dan Berkah', 'Meningkatkan Pertumbuhan dan Ketahanan Ekonomi Lokal Berbasis Pertanian, Perikanan, UMKM, dan Pariwisata Fokus pada Keberdayaan Keluarga untuk Membuka Lapangan Kerja dan Mengurangi Kemiskinan;\r\nMembangun SDM Unggul, Sehat Jasmani-Rohani, Produktif dan Berkarakter melalui Peningkatan Akses serta Kualitas Pelayanan Pendidikan, Kesehatan, dan Kebutuhan Dasar Lainnya;\r\nMewujudkan Masyarakat Berkarakter yang Memegang Teguh Nilainilai Keagamaan, Menjaga Keluhuran Adat Istiadat, serta Menguatkan Gotong Royong dan Kerukunan dalam Harmoni Kebhinekaan;\r\nMempercepat Pembangunan Infrastruktur Ekonomi dan Sosial yang Semakin Merata dengan Memperhatikan Daya Dukung Lingkungan;\r\nMemantapkan Tata Kelola Pemerintahan yang Tangkas dan Dinamis melalui Transformasi Digital untuk Mewujudkan Birokrasi Produktif dan Kemudahan Berusaha;', NULL, NULL, NULL, NULL, 'foto/29. IPUK FIESTIANDANI AZWAR ANAS.jpg', 'IPUK FIESTIANDANI AZWAR ANAS', 'Bupati', '', 'Jalan Jendral A. Yani No. 100 Banyuwangi ', 'https://banyuwangikab.go.id/', '@banyuwangi_kab', '', '', '0333 425001  ', NULL, '', '', '', '', 'Kabupaten Banyuwangi', NULL, '312537'),
	(67, 'Kabupaten Bondowoso', 'Kabupaten Bondowoso', NULL, 'kab', 1, NULL, 'Mewujudkan Kabupaten Bondowoso Sebagai Kawasan Agribisnis yang Maju, Religius, Adil, dan Makmur', 'Mewujudkan tata kelola lingkungan hidup secara seimbang dan berkelanjutan;\r\nMeningkatkan pemanfaat potensi sumber daya ekonomi berbasis agribisnis yang berdaya saing dan mandiri secara berkelanjutan;\r\nMewujudkan pemberdayaan ekonomi secara lebih merata dan berkeadilan;\r\nMenciptakan Sumber Daya Manusia yang handal dan berakhlak mulia;\r\nMewujudkan pemenuhan kebutuhan dasar masyarakat untuk meningkatkan kualitas hidup;\r\nMeningkatkan ketersediaan infrastruktur yang handal, mandiri, inovatif, berdaya saing dan berwawasan lingkungan;\r\nMengembangkan tata kelola pemerintahan yang berbudaya kerja transparan, partisipatif, bersih, akuntabel, profesional, dan unggul;', NULL, NULL, NULL, NULL, 'foto/WhatsApp Image 2024-07-31 at 14.53.20.jpeg', 'Muhammad Hadi Wawan Guntoro S.STP., M.Si', 'Bupati', 'bondowosotourism1@gmail.com', 'Jl. Letnan Amir Kusman No.2, Bondowoso', 'bondowosokab.go.id', '@pemkabbondowoso', '', '', '(0332) 421475', NULL, '', '', '', '', 'Kabupaten Bondowoso', NULL, '414654'),
	(68, 'Kabupaten Situbondo', 'Kabupaten Situbondo', NULL, 'kab', 1, NULL, '“Mewujudkan Masyarakat Situbondo yang Berakhlak, Sejahtera, Adil, dan Berdaya”', 'Membangun Masyarakat Situbondo Beriman Dalam Keberagaman;\r\nMembangun Masyarakat Situbondo Sehat, Cerdas dan Meningkatkan Peran Perempuan;\r\nMembangun Infrastruktur, Ekonomi Berkeadilan dan Berdaya Saing;\r\nMembangun Pemerintahan yang Profesional, Bersih dan Tangguh;', NULL, NULL, NULL, NULL, 'foto/Biro Perekonomian-Situbondo.jpeg', 'Dr. MHD. AFTABUDDIN RIJAL UZZAMAN, S.Pt., M.Si', 'Bupati', 'pemkab@situbondo.go.id', 'JLN. PB. SUDIRMAN NO 1 KABUPATEN SITUBONDO', 'http://situbondokab.go.id/', '@situbondokab', '', '', ' (0338) 674096', NULL, '', '', '', '', 'Kabupaten Situbondo', NULL, '274320'),
	(69, 'Kabupaten Probolinggo', 'Kabupaten Probolinggo', NULL, 'kab', 1, NULL, 'Terwujudnya Kabupaten Probolinggo yang Sejahtera, Berkeadilan, Mandiri, Berwawasan lingkungan, dan Berakhlak Mulia', 'Mewujudkan Kesejahteraan Masyarakat Melalui Peningkatan Daya Saing;\r\nDaerah, Pertumbuhan Ekonomi Berbasis Kerakyatan, dan Optimalisasi;\r\nPengelolaan Sumber Daya Yang Berkelanjutan;\r\nMewujudkan Masyarakat Yang Berakhlak Mulia Melalui Peningkatan;\r\nKualitas Pelaksanaan Otonomi Daerah Dalam Penyelenggaraan;\r\nKepemerintahan Yang Baik dan Bersih;', NULL, NULL, NULL, NULL, 'foto/WhatsApp Image 2023-10-11 at 10.12.45-fotor-bg-remover-20231011101333.jpg', 'UGAS IRWANTO, S.Sos., M.Si', 'Bupati', '', 'Jl Raya Panglima Sudirman no.134', 'https://probolinggokab.go.id', '@humas_kab_prob', '', '', '(0335) 846665', NULL, '', '', '', '', 'Kabupaten Probolinggo', NULL, '732095'),
	(70, 'Kabupaten Pasuruan', 'Kabupaten Pasuruan', NULL, 'kab', 1, 'Meningkatnya pertumbuhan dan pemeretaan ekonomi daerah;\r\nMeningkatnya kesejahteraan dan kualitas hidup masyarakat;\r\nMeningkatnya tata kelola pemerintahan yang dinamis dan pelayanan prima berbasis teknologi informasi;', 'Menuju Kabupaten Pasuruan yang , Sejahtera,Maslahat dan Berdaya Saing', 'Memantapkan kesadaran dan partisipasi masyarakat dalam pembangunan guna menunjang percepatan revolusi mental yang berbasis nilai keagamaan yang toleran, budaya lokal, dan supremasi hukum;\r\nMemperluas inovasi dan reformasi birokrasi demi tata kelola pemerintahan yang bersih, efektif, akuntabel dan demokratis berbasisteknologi informasi;\r\nMelakukan percepatan pembangunan di bidang pendidikan, kesehatan, dan ekonomi guna meningkatkan Indeks PembangunanManusia;\r\nMengembangkan ekonomi masyarakat berbasis pertanian, pariwisata, dan industri kreatif;\r\nMelakukan percepatan pembangunan desa melalui penguatan kelembagaan, peningkatan kualitas SDM, dan pengembangan produk unggulan desa;\r\nMeningkatkan ketersediaan infrastruktur jalan, transportasi,telematika, sumber daya air, permukiman dan prasarana lingkunganyang menunjang aktivitas sosial ekonomi kemasyarakatan;\r\nMemperkokoh kesadaran dan perilaku masyarakat dalam menjaga kelestarian lingkungan hidup;', NULL, NULL, NULL, NULL, 'foto/WhatsApp Image 2023-10-11 at 09.24.13-fotor-bg-remover-2023101192733.jpg', 'Dr. ANDRIYANTO, S.H., M.Kes', 'Bupati', '', 'Jl. Hayam Wuruk No. 14 Pasuruan', 'pasuruankab.go.id', '@pemkabpasuruan', '', '', '(0343) 429064', NULL, '', '', '', '', 'Kabupaten Pasuruan', NULL, '332181'),
	(71, 'Kabupaten Sidoarjo', 'Kabupaten Sidoarjo', NULL, 'kab', 1, NULL, 'Terwujudnya Kabupaten Sidoarjo yang Sejahtera, Maju, Berkarakter, dan Berkelanjutan', 'Mewujudkan tata kelola pemerintahan yang bersih, transparan, dan tangkas melalui digitalisasi untuk meningkatkan kualitas pelayanan publik dan kemudahan berusaha;\r\nMembangkitkan pertumbuhan ekonomi dengan fokus pada kemandirian lokal berbasis UMKM, koperasi, pertanian, perikanan sektor jasa, dan industri untuk membuka lapangan pekerjaan dan mengurangi kemiskinan;\r\nMembangun infrastruktur ekonomi dan sosial yang modern dan berkadilan dengan memperhatikan keberlanjutan lingkungan;\r\nMembangun SDM ungguk dan berkarakter melalui peningkatan akses pelayanan bidang pendidikan, kesehatan, serta kebutuhan dasar lainnya;\r\nMewujudkan masyarakat religius yang berpegang teguh pada nilai-nilai keagamaan, serta mampu menjaga kerukunan sosial antar warga;', NULL, NULL, NULL, NULL, 'foto/sidoarjo.jpg', 'Dr. Ir. MUHAMMAD ISA ANSHORI, A.TD., M.T', 'Bupati', '', 'Jl. Gubernur Suryo No. 1 Sidoarjo', 'www.sidoarjokab.go.id', '@pemkabsidoarjo', '', '', '(031) 8921946', NULL, '', '', '', '', 'Kabupaten Sidoarjo', NULL, '708881'),
	(72, 'Kabupaten Mojokerto', 'Kabupaten Mojokerto', NULL, 'kab', 1, NULL, 'Terwujudnya Kabupaten Mojokerto yang Maju, Adil, dan Makmur Melalui Penguatan Infrastruktur dan Peningkatan Kualitas Sumber Daya Manusia', 'Mewujudkan Sumber Daya Manusia yang Sehat,Cerdas,Terampil dan Produktif yang Dilandasi Nilai-nilai Keimanan dan Ketakwaan;\r\nMembangun Kemandirian Ekonomi yang Berdimensi Kerakyatan;\r\nMewujudkan Tata Kelola Pemerintahan Yang Berintegritas, Akuntabel, Bersih,Transparan;\r\nPemerataan & perluasan pembangunan infrastruktur disemua sektor untuk mendorong pertumbuhan ekonomi, sosial, budaya dan pelestarian lingkungan;', NULL, NULL, NULL, NULL, 'foto/PJs Kab. Mojokerto.jpg', 'Dr. H. AKH. JAZULI, S.H., M.Si.', 'Bupati', 'diskominfo@mojokertokab.go.id', 'Jl. Ahmad Yani No.16, Mergelo, Purwotengah, Kec. Magersari, Kota Mojokerto, Jawa Timur 61311', 'https://mojokertokab.go.id/', '@humaskabmojokerto', '', '', '(0321) 323246', NULL, '', '', '', '', 'Kabupaten Mojokerto', NULL, '528674'),
	(73, 'Kabupaten Jombang', 'Kabupaten Jombang', NULL, 'kab', 1, 'Meningkatnya tata kelola pemerintahan yang profesional, akuntabel, inovatif, transparan dan efektif serta penyelenggaraan digitalisasi layanan publik;\r\nMeningkatkan kualitas Sumber Daya Manusia (SDM) yang unggul dan berdaya saing;\r\nMeningkatkan kehidupan masyarakat jombang yang religius dan berbudaya;\r\nMeningkatkan daya saing dan pemerataan ekonomi melalui pemantapan kualitas infrastruktur berkelanjutan yang mendorong pengembangan agrobisnis dan sektor unggul lainnya;', 'Bersama Mewujudkan Jombang yang Berkarakter dan Berdaya Saing', 'Mewujudkan tata kelola pemerintahan yang bersih dan profesional;\r\nMewujudkan masyarakat jombang yang berkualitas, religius, dan berbudaya;\r\nMeningkatkan daya saing perekonomian daerah berbasis kerakyatan potensi unggulan lokal dan industri;', NULL, NULL, NULL, NULL, 'foto/Bapak Dr. Drs. Teguh Narutomo, MM, CRGP, CGCAE, CFrA (1).jpg', 'Dr.Drs. Teguh Narutomo, MM, CRGP, CGCAE, CFrA', 'Bupati', 'diskominfo@jombangkab.go.id', 'JL. KH. WAHIB HASYIM 137 JOMBANG', 'www.jombangkab.go.id', '@jombang_kab', '', '', '(0321) 861292', NULL, '', '', '', '', 'Kabupaten Jombang', NULL, '510015'),
	(74, 'Kabupaten Nganjuk', 'Kabupaten Nganjuk', NULL, 'kab', 1, 'Meningkatnya pertumbuhan ekonomi daerah yang inklusif dan penanggulangan kemiskinan melalui pemerataan pembangunan yang berwawasan lingkungan hidup;\r\nMeningkatnya kualitas pembangunan manusia yang unggul dan berdaya saing;\r\nMeningkatnya tata kelola pemerintahan daerah yang baik;\r\nMeningkatnya kondisi sosial masyarakat yang harmonis dan berbudaya', 'Terwujudnya Kabupaten Nganjuk yang Maju dan Bermartabat (Nganjuk Nyawiji Mbangun Deso Noto Kutho', 'Mewujudkan tatanan kehidupan masyarakat yang dinamis dan harmonis, berdasarkan Ketuhanan Yang Maha Esa, serta dapat memelihara kerukunan, ketentraman dan ketertiban;\r\nMeningkatkan kinerja birokrasi yang bersih, profesional dan akuntabel (accountable) demi masyarakat Kabupaten Nganjuk yang efektif dan efisien melalui penyelenggaraan Pemerintahan yang aspiratif partisipatif dan transparan;\r\nMeningkatkan kualitas pelayanan, mutu pendidikan dan kesehatan untuk menghasilkan sumber daya manusia yang berkualitas;\r\nMeningkatkan keberpihakan pemerintah dalam peningkatan ekonomi kerakyatan berbasis pertanian dan potensi lokal serta sektor produktif lain berbasis teknologi tepat guna;\r\nMeningkatkan kebanggaan terhadap kesenian, kebudayaan dan kearifan lokal yang mampu mendorong pembangunan sektor pariwisata;\r\nInfrastruktur publik yang memadai dan berkualitas sebagai penunjang pertumbuhan ekonomi dengan memperhatikan kelestarian lingkungan dan perlindungan dari bencana;', NULL, NULL, NULL, NULL, 'foto/WhatsApp_Image_2023-10-11_at_10.56.01__2_-removebg-preview.jpg', 'SRI HANDOKO TARUNA, S.STP., M.Si.', 'Bupati', 'admin@nganjukkab.go.id', 'Jl. BASUKI RAHMAD NO 1 NGANJUK', 'www.nganjukkab.go.id', '@humaskabupatennganjuk', '', '', '(0358) 321746', NULL, '', '', '', '', 'Kabupaten Nganjuk', NULL, '535237'),
	(75, 'Kabupaten Madiun', 'Kabupaten Madiun', NULL, 'kab', 1, 'Meningkatnya pertumbuhan ekonomi dengan mengembangkan sektor potensial dan mendorong masuknya investasi;\r\nMenurunkan kemiskinan melalui pemberdayaan masyarakat dan pemenuhan kebutuhan dasar masyarakat;\r\nMeningkatkan daya saing Sumber Daya Manusia;\r\nMewujudkan tata kelola pemerintahan yang baik, bersih, profesional dan akuntabel;', 'Terwujudnya Kabupaten Madiun yang Aman, Mandiri, Sejahtera, dan Berakhlak', 'Mewujudkan rasa aman bagi seluruh masyarakat dan aparatur Pemerintah Kabupaten Madiun;\r\nMewujudkan Aparatur Pemerintah yang Profesional untuk meningkatkan Pelayanan Publik;\r\nMeningkatkan Pembangunan Ekonomi yang Mandiri Berbasis Agrobisnis, Agroindustri, dan Pariwisata yang Berkelanjutan;\r\nMeningkatkan Kesejahteraan yang Berkeadilan;\r\nMewujudkan Masyarakat Berakhlak Mulia dengan Meningkatkan Kehidupatan Beragama, Menguatkan Budaya, dan Mengedepankan Kearifan Lokal;', NULL, NULL, NULL, NULL, 'foto/WhatsApp_Image_2023-10-11_at_10.56.01-removebg-preview.jpg', 'Ir. TRONTO PAHLAWANTO  ', 'Bupati', 'diskominfo@madiunkab.go.id', 'JL. ALUN-ALUN UTARA NO.1-3 CARUBAN KABUPATEN MADIUN', 'https://madiunkab.go.id/', '@pemkabmadiun', '', '', '0351-462927', NULL, '', '', '', '', 'Kabupaten Madiun', NULL, '366296'),
	(76, 'Kabupaten Magetan', 'Kabupaten Magetan', NULL, 'kab', 1, 'Meningkatkan pertumbuhan ekonomi melalui sistem ekonomi kerakyatan;\r\nMewujudkan Sumber Daya Manusia dan berdaya saing;\r\nMeningkatkan kesejahteraan masyarakat;\r\nMewujudkan pembangunan yang berasaskan lingkungan;\r\nMeningkatkan tata kelola pemerintahan yang baik dan bersih;', '“MASYARAKAT MAGETAN YANG SMART SEMAKIN MANTAB DAN LEBIH SEJAHTERA”', 'Meningkatkan percepatan dan perluasan pembentukan sumber daya manusia yang Smart (sehat, maju, agamis, ramah, dan terampil);\r\nMeningkatkan perekonomian daerah melalui keberpihakan dan pemberdayaan koperasi dan usaha mikro sebagai pilar ekonomi kerakyatan serta pemberdayaan masyarakat desa sebagai basis sekaligus ujung tombak pembangunan daerah; \r\nMengoptimalkan pengelolaan dan pedayagunaan sumber daya alam yang berwawasan lingkungan dan berkelanjutan;\r\nMemantapkan ketercukupan kuantitas dan kualitas sarana dan prasarana dan fasilitas bagi kegiatan pelayanan masyarakat;\r\nMengembangkan penyelenggaraan tata pemerintahan yang baik dan manajemen pemerintahan yang bersih, profesioanal, dan adil;', NULL, NULL, NULL, NULL, 'foto/WhatsApp_Image_2023-10-11_at_10.56.01__1_-removebg-preview.jpg', 'Ir. HERGUNADI, M.T.', 'Bupati', '', 'JL. BASUKI RAHMAT TIMUR NO. 1 MAGETAN', 'magetan.go.id', '@diskominfomagetan', '', '', '(0351) 8197913', NULL, '', '', '', '', 'Kabupaten Magetan', NULL, '916255'),
	(77, 'Kabupaten Ngawi', 'Kabupaten Ngawi', NULL, 'kab', 1, NULL, 'Terwujudnya Masyarakat Kabupaten Ngawi yang Mandiri, Berakhlak, Makmur dan Berdaya Saing Berbasis Agropolitan Dengan Semangat Gotong Royong Dalam Bingkai NKRI', 'Meningkatkan SDM yang berkualitas dan berdaya saing melalui kemudahan terhadap akses pelayanan kepada masyarakat;\r\nMengembangkan perekonomian kerakyatan melalui kemudahan investasi, pariwisata berbasis potensi lokal dan pertanian ramah lingkungan berkelanjutan didukung riset dan teknologi;\r\nMeningkatkan etos kerja dan integritas aparatur pemerintahan guna memberikan pelayanan prima;\r\nMeningkatkan kualitas infrastruktur guna percepatan pembangunan yang berkesinambungan;\r\nMeningkatkan kondusifitas daerah melalui pengembangan budaya lokal yang berlandaskan keagamaan dan gotong royong;', NULL, NULL, NULL, NULL, 'foto/Dinas Perpus-Ngawi (1).jpg', 'Ir. TIAT SURTIATI SUWARDI, M.Si', 'Bupati', '', 'JALAN TEUKU UMAR NO. 12, NGAWI', 'https://ngawikab.go.id', '@ngawikab', '', '', '(0351) 4477121', NULL, '', '', '', '', 'Kabupaten Ngawi', NULL, '675134'),
	(78, 'Kabupaten Bojonegoro', 'Kabupaten Bojonegoro', NULL, 'kab', 1, 'Mewujudkan kehidupan masyarakat yang aman, nyaman dan tertib;\r\nMewujudujab tata kelola pemerintahan yang bersih, transparan, bertanggung jawab dan inovatif;\r\nMewujudkan peningkatan dan pemerataan kesejahteraan masyarakat dan penguatan ketahanan pangan;\r\nMeningkatkan pertumbuhan ekonomi sektor migas dan non migas;\r\nMewujdukan percepatan dan pemerataan pembangunan infrastruktur dan ekonomi antar wilayah berbasis risiko dan pembangunan berkelanjutan;', 'Menjadikan Bojonegoro Sebagai Sumber Ekonomi Kerakyatan dan Sosial Budaya Lokal Untuk Terwujudnya Masyarakat yang Beriman, Sejahtera, dan Berdaya Saing', 'Mewujudkan tata kehidupan sosial yang berlandaskan nilai-nilai religius dan kearifan lokal;\r\nMewujudkan tata kelola pemerintahan yang bersih, transparan dan bertanggung jawab;\r\nMewujudkan peningkatan kualitas sumber daya manusia yang berkelanjutan;\r\nMewujudkan rasa aman dan keberpihakan bagi perempuan, anak, penyandang disabilitas, serta kaum dhuafa;\r\nMewujudkan peningkatan kesejahteraan berbasis ekonomi kerakyatan dan ekonomi kreatif;\r\nMewujudkan daya saing ekonomi daerah berbasis potensi lokal;\r\nMewujudkan pembangunan infrastruktur yang merata dan ramah lingkungan;', NULL, NULL, NULL, NULL, 'foto/Pj-Bupati-Bojonegoro-Adriyanto.jpg', 'ADRIYANTO, SE.,MM.,Ma.,Ph.D.', 'Bupati', '', 'Jl. P. Mas Tumapel No 1 Bojonegoro', 'https://bojonegorokab.go.id/', '', '', '', '(0353) 881826', NULL, '', '', '', '', 'Kabupaten Bojonegoro', NULL, '878880'),
	(79, 'Kabupaten Tuban', 'Kabupaten Tuban', NULL, 'kab', 1, NULL, 'Membangun Serta Mewujudkan Tuban Sejahtera, Berkeadilan, Berbudaya, Berdaya Saing dan Berbasis Lingkungan Melalui ‘Mbangun Deso Noto Kutho’', 'Membangun dan Mewujudkan Infrastruktur Desa dan Utilitas Kota yang Terpadu, Partisipatif, Efektif, Berwawasan Lingkungan serta Selaras dengan Pertumbuhan dan Pemerataan Sosial, Ekonomi dan Budaya, serta Bertumpu pada Nilai-nilai Agama, Budaya, dan Kearifan Lokal;\r\nMeningkatkan Pengelolaan dan Nilai Tambah Sektor Pertanian secara Meluas (Pertanian, Perikanan, Peternakan, Perkebunan), Pariwisata, Perindustrian, Perdagangan, yang Berbasis Pemberdayaan dan Ekonomi Kerakyatan, serta menciptakan seluas-luasnya kesempatan berusaha, membangun dan memampatkan sinergitas daya saing usaha ekonomi lokal dan pengembangan ekonomi kreatif;\r\nMewujudkan Sumber Daya Manusia Berkualiatas dan Terlatih;\r\nMemantapkan Tata Kelola Pemerintah Daerah yang Baik, Profesional, Transparan, Akuntabel dan Sistem Pengawasan yang Efektif;', NULL, NULL, NULL, NULL, 'foto/tuban.jpg', 'Dr. AGUNG SUBAGYO, S.STP., M.Si.', 'Bupati', '', 'Jl. Kartini no. 2 Tuban', 'tubankab.go.id', '@kabupatentuban', '', '', '(0356) 321020', NULL, '', '', '', '', 'Kabupaten Tuban', NULL, '293707'),
	(80, 'Kabupaten Gresik', 'Kabupaten Gresik', NULL, 'kab', 1, NULL, 'Mewujudkan Gresik Baru Mandiri, Sejahtera, Berdaya Saing dan Berkemajuan Berlandaskan Akhlakul Karimah', 'Menciptakan tata kelola pemerintahan yang bersih, akuntable serta mewujudkan kepemimpinan yang inovatif dan kolaboratif;\r\nMembangun infrastruktur yang berdaya saing memakmurkan desa dan menata kota;\r\nMewujudkan kemandirian ekonomi yang seimbang antar sektor dan antar wilayah;\r\nMembangun insan Gresik yang unggul yang cerdas, mandiri, sehat, dan berakhlakul karimah;\r\nMeningkatkan kesejahteraan sosial dengan menciptakan lapangan kerja, dan menjamin pemenuhan kebutuhan dasar masyarakat Gresik;', NULL, NULL, NULL, NULL, 'foto/5. FANDI AKHMAD YANI, SE.jpg', 'FANDI AKHMAD YANI, SE', 'Bupati', '', 'Jl. Dr. Wahidin sh no 245 gresik', 'Gresikkab.go.id', '@pemkabgresik', '', '', '(031) 39928780', NULL, '', '', '', '', 'Kabupaten Gresik', NULL, '753144'),
	(81, 'Kabupaten Lamongan', 'Kabupaten Lamongan', NULL, 'kab', 1, NULL, 'Terwujudnya Kejayaan Lamongan yang Berkeadilan', 'Mewujudkan kemandirian ekonomi daerah melalui optimalisasi potensi unggulan daerah;\r\nMewujudkan SDM unggul, berdaya saing, dan berakhlak yang responsif terhadap perubahan zaman;\r\nMembangun infrastruktur handal dan berkeadilan yang berwawasan lingkungan;\r\nMewujudkan kehidupan bermasyarakat yang sejahtera, religius-berbudaya, aktif dalam pembangunan serta lingkungan yang aman dan tentram;\r\nMenghadirkan tata kelola pemerintahan yang dinamis serta memberikan pelayanan publik yang berkualitas sebagai upaya optimalisasi reformasi birokrasi;', NULL, NULL, NULL, NULL, 'foto/6. Dr. YUHRONUR EFENDI, MBA.jpg', 'Dr. YUHRONUR EFENDI, MBA.', 'Bupati', '', 'Jl. KH. Ahmad Dahlan No. 1 Lamongan', 'lamongankab.go.id', '@pemkab_lamongan', '', '', '(0322) 321012', NULL, '', '', '', '', 'Kabupaten Lamongan', NULL, '832201'),
	(82, 'Kabupaten Bangkalan', 'Kabupaten Bangkalan', NULL, 'kab', 1, 'Meningkatkan kualitas Sumber Daya Manusia;\r\nMenurunkan angka kemiskinan;\r\nMeningkatkan pertumbuhan ekonomi inklusif yang didukung oleh peningkatan infrastruktur berwawasan lingkungan;\r\nMewujudkan tata kelola pemerintahan yang baik;', 'Terwujudnya Masyarakat Kabupaten Bangkalan yang Religius dan Sejahtera Berbasis Potensi Lokal', 'Mewujudkan Kehidupan Beragama Berkualitas;\r\nMenyelenggarakan Birokrasi yang Profesional dan Berintegritas Tinggi;\r\nMenyelenggarakan Pelayanan Dasar Berkualitas dan Tata Kelola Pemanfaatan Potensi Ekonomi, Sosial dan Budaya Lokal untuk Meningkatkan Daya Saing Daerah;\r\nMewujudkan Rasa Aman dan Adil Pada Masyarakat;\r\nAkselerasi Pembangunan Infrastruktur yang Berbasis pada Pemerataan Wilayah dan Berwawasan Lingkungan dalam Mendorong Iklim Investasi;', NULL, NULL, NULL, NULL, 'foto/IMG_20230927_095144_81b0fxPv1n.jpeg', 'Dr. ARIEF M EDIE, M.Si    ', 'Bupati', '', 'JL SOEKARNO HATTA 35 BANGKALAN', 'bangkalankab.go.id', '@pemkabbangkalanprokopim', '', '', '031-3061179 ', NULL, '', '', '', '', 'Kabupaten Bangkalan', NULL, '917899'),
	(83, 'Kabupaten Sampang', 'Kabupaten Sampang', NULL, 'kab', 1, 'Terwujudnya SDM berkualitas, berdaya saing, unggul dan berbudaya;\r\nMeningkatnya pembangunan ekonomi inklusif dan pemerataan infrastruktur berkelanjutan;\r\nTransformasi tata kelola dan peningkatan inovasi daerah untuk mewujudkan pelayanan;', 'Sampang Hebat Bermartabat', 'Mewujudkan Sumber Daya Manusia yang Berkualitas dan Berdaya Saing;\r\nMewujudkan Kemandirian Ekonomi Daerah dan Perdesaan melalui Pengembangan Agribisnis, Pariwisata dan Ekonomi Kreatif;\r\nMeningkatkan Pembangunan Infrastruktur yang Berkualitas dan Berkelanjutan;\r\nMemperkuat Tata Kelola Pemerintahan dan Desa yang Transparan, Akuntabel dan Berorientasi pada Pelayanan Publik;\r\nMewujudkan Harmonisasi Kehidupan Masyarakat yang Waspada, Tanggap Tertib, Damai dan Bersatu;', NULL, NULL, NULL, NULL, 'foto/8. H. SLAMET JUNAIDI.jpg', 'H. SLAMET JUNAIDI', 'Bupati', '', 'Jl. Jamaluddin No. 1A Sampang', 'https://sampangkab.go.id/', '@kabupaten.sampang', '', '', '(0323) 321500', NULL, '', '', '', '', 'Kabupaten Sampang', NULL, '897652'),
	(84, 'Kabupaten Pamekasan', 'Kabupaten Pamekasan', NULL, 'kab', 1, 'Meningkatkan pertumbuhan ekonomi inklusif berbasis potensi lokal, pengentasan kemiskinan dan peningkatan kesejahteraan masyarakat;\r\nMewujudkan SUmber Data Manusia berkualitas;\r\nMenjamin terpenuhinya infrastruktur dasar dan kualitas lingkungan hidup yang merata bagi masyarakat;\r\nMeningkatkan harmoni sosial melalui internalisasi nilai-nilai keagamaan, sosial budaya dan kesetaraan;\r\nPenyelenggaraan tata kelola pemerintahan dan pelayan publik yang efektif serta akuntabel;', 'Pamekasan Sejahtera melalui pembangunan dari Bawah, Merata, dan Berkelanjutan Berdasarkan Nilai-Nilai Agama', 'Penguatan kualitas sumber daya manusia;\r\nPerekonomian inklusif yang bertumpu pada sektor pertanian dan didukung percepatan pembangunan sektor industri, perdagangan dan sektor potensial lainnya di kota dan di desa;\r\nPeningkatan tata kelola pemerintahan dan pelayanan publik;\r\nPemenuhan kualitas infrastruktur dasar yang merata dan berkelanjutan;\r\nPengelolaan potensi sosial, nilai-nilai budaya, keagamaan, kepemudaan dan perempuan untuk mewujudkan masyarakat yang harmonis serta sejahtera;', NULL, NULL, NULL, NULL, 'foto/masrukin.jpg', 'MASRUKIN, S.SOS., M.Si.', 'Bupati', '', 'JL. KABUPATEN NO.107 PAMEKASAN', 'http://pamekasankab.go.id/', '@pemkabpamekasan', '', '', '(0324) 322115', NULL, '', '', '', '', 'Kabupaten Pamekasan', NULL, '770089'),
	(85, 'Kabupaten Sumenep', 'Kabupaten Sumenep', NULL, 'kab', 1, NULL, 'Sumenep Unggul, Mandiri, dan Sejahtera', 'Membangun Sumber Daya Manusia (SDM) berdaya saing di bidang pendidikan, kesehatan, dan ketenaga kerjaan;\r\nMeningkatkan kesejahteraan masyarakat melalui penguatan ekonomi berbasis kawasan dari hulu ke hilir;\r\nMewujudkan tata kelola pemerintahan yang transparan, inovatif dan responsif dalam melayani masyarakat;\r\nMelaksanakan pembangunan Berazas gotong royong dan berkearifan lokal;\r\nMemperkuat pembangunan infrastruktur berbasis lingkungan hidup yang seimbang antara daratan dan kepulauan;', NULL, NULL, NULL, NULL, 'foto/10. ACHMAD FAUZI, S.H., M.H.jpg', 'ACHMAD FAUZI, S.H., M.H', 'Bupati', '', 'JL Dr. CIPTO NO. 33 SUMENEP ', 'www:sumenepkab.go.id', '@kominfosumenep', '', '', '(0328) 662 635', NULL, '', '', '', '', 'Kabupaten Sumenep', NULL, '683798'),
	(86, 'Kota Surabaya', 'Kota Surabaya', NULL, 'kab', 1, NULL, 'Gotong Royong Menuju Kota Dunia yang Maju, Humanis, dan Berkelanjutan', 'Mewujudkan perekonomian inklusif untuk meningkatkan kesejahteraan rakyat dan pembukaan lapangan kerja baru melalui penguatan kemandirian ekonomi lokal, kondusifitas iklim investasi, penguatan daya saing surabaya sebagai pusat penghubung perdagangan dan jasa antar pulau serta internasional;\r\nMembangun sumber daya manusia (SDM) unggul, sehat jasmani dan rohani, produktif serta berkarakter melalui peningkatan akses dan kualitas pelayanan kesehatan, pendidikan dan kebutuhan dasar lainnya;\r\nMemantapkan penataan ruang kota yang terintegrasi melalui ketersediaan infrastruktur dan utilitas kota yang modern berkelas dunia serta berkelanjutan;\r\nMemantapkan transformasi birokrasi yang bersih, dinamis dan tangkas berbasi digital untuk meningkatkan kualitas pelayanan publik;\r\nMenciptakan ketertiban, keamanan, kerukunan sosial dan kepastian hukum yang berkeadilan;', NULL, NULL, NULL, NULL, 'foto/surabaya.jpg', 'Dra. RESTU NOVI WIDIANI, M.M.,', 'Walikota', 'walikota@surabaya.go.id', 'Jl. Jimerto No.25-27, Ketabang, Kec. Genteng, Kota SBY', 'https://www.surabaya.go.id', '', '', '', '031 7523207', NULL, '', '', '', '', 'Kota Surabaya', NULL, '783237'),
	(87, 'Kota Kediri', 'Kota Kediri', NULL, 'kab', 1, 'Terwujudnya tata kelola pemerintahan yang berorientasi pada pelayanan publik dan inovasi daerah;\r\nMeningkatnya kualitas Sumber Daya Manusia;\r\nMeningkatnya pertumbuhan ekonomi yang merata dan berkelanjutan;\r\nPengentasan kemiskinan dan perluasan kesempatan kerja;\r\nTerwujudnya kehidupan masyarakat yang harmonis;\r\nTerwujudnya infrastruktur yang berkualitas dan berkelanjutan;', 'Mewujudkan Kota Kediri Unggul dan Makmur dalam Harmoni', 'Mewujudkan tata kelola pemerintahan yang bersih, transparan dan berintegritas berorientasi pada pelayanan prima dan teknologi informasi;\r\nMewujudkan SDM yang berkualitas dan berdaya saing berbasis nilai agama dan budaya;\r\nMemperkuat perekonomian daerah berbasis potensi unggulan daerah dan pengembangan ekonomi kreatif yang berkeadilan;\r\nMewujudkan Kota Kediri yang aman, nyaman, dan berwawasan lingkungan yang berkelanjutan;', NULL, NULL, NULL, NULL, 'foto/12. Abdullah Abu Bakar.jpg', 'ABDULLAH ABU BAKAR', 'Walikota', '', 'Jl. Jendral Basuki Rahmad No. 15 Kediri', 'kedirikota.go.id', '@pemkotkediri', '', '', '(0354) 689901', NULL, '', '', '', '', 'Kota Kediri', NULL, '226645'),
	(88, 'Kota Blitar', 'Kota Blitar', NULL, 'kab', 1, NULL, 'Kota Blitar Keren, Unggul, Makmur, dan Bermartabat', 'Mewujudkan Tata Kehidupan yang Religius, Nasionalis, Setara Gender dan Berkepribadian dalam Kebudayaan;\r\nMewujudkan Sumber Daya Manusia yang Keren, Berdaya Saing, Sehat Jasmani-Rohani, Cerdas dan Berkarakter;\r\nMewujudkan Berdikari secara ekonomi yang Berorientasi pada Ekonomi Kreatif, Pariwisata dan Perdagangan Berbasis Digital;\r\nMewujudkan Tata Ruang yang Berwawasan Lingkungan Hidup dan Berkeadilan;\r\nMewujudkan Tata Pemerintahan yang Baik dan Bersih Berbasis Teknologi Informasi;', NULL, NULL, NULL, NULL, 'foto/13. Drs. SANTOSO, M.Pd.jpg', 'Drs. SANTOSO, M.Pd', 'Walikota', '', 'Jalan Merdeka No. 105 Kota Blitar', 'blitarkota.go.id', '@pemkotblitar', '', '', '(0342) 801171', NULL, '', '', '', '', 'Kota Blitar', NULL, '313709'),
	(89, 'Kota Malang', 'Kota Malang', NULL, 'kab', 1, 'Terwujudnya Sumber Daya Manusia yang berkualitas dan berdaya saing;\r\nMeningkatnya pertumbuhan ekonomi yang merata dan berkelanjutan;\r\nTerwujudnya kesejahteraan dan kerukunan sosial yang berasaskan keberagaman;\r\nTerwujudnya transformasi pelayanan publik yang tertib hukum, profesional dan akuntabel;', 'Kota Malang Bermartabat', 'Meningkatkan akses dan kualitas pendidikan, kesehatan dan layanan dasar lainnya bagi semua warga;\r\nMewujudkan kota produktif dan berdaya saing berbasis ekonomi kreatif, keberlanjutan dan keterpaduan;\r\nMewujudkan kota yang rukun dan toleran berazaskan keberagaman dan keberpihakan terhadap masyarakat rentan dan gender;\r\nMemastikan kepuasan masyarakat atas layanan pemerintah yang tertib hukum, profesional dan akuntabel;', NULL, NULL, NULL, NULL, 'foto/WhatsApp_Image_2023-10-11_at_10.56.00-removebg-preview.jpg', 'Dr. Ir. WAHYU HIDAYAT', 'Walikota', '', 'JL. TUGU NOMOR 1 KOTA MALANG', 'malangkota.go.id', '@kotamalang', '', '', '(0341) 364450', NULL, '', '', '', '', 'Kota Malang', NULL, '929239'),
	(90, 'Kota Probolinggo', 'Kota Probolinggo', NULL, 'kab', 1, 'Meningkatkan pembangunan ekonomi melalui optimalisasi potensi unggulan daerah;\r\nMeningkatkan kualitas dan daya saing Sumber Daya Manusia;\r\nMenurunkan kemiskinan dan ketimpangan;\r\nMeningkatkan kualitas infrastruktur dan lingkungan hidup;\r\nMewujudkan pemerintah yang adaptif serta pelayanan publik prima berbasis digital;', 'Membangun Bersama Rakyat untuk Kota Probolinggo yang Lebih Baik, Berkeadilan, Sejahtera, Transparan, Aman, dan Berkelanjutan', 'Pembangunan ekonomi yang berdaya saing berbasis sektor potensial;\r\nSumberdaya manusia dan kesejahteraan sosial yang berkualitas;\r\nInfrastruktur dan lingkungan hidup yang berkelanjutan;\r\nTatakelola pemerintahan dan pelayanan publik yang baik;', NULL, NULL, NULL, NULL, 'foto/15. HADI ZAINAL ABIDIN, S.Pd, M.M, M.HP.jpg', 'HADI ZAINAL ABIDIN, S.Pd, M.M, M.HP', 'Walikota', '', 'JL. P. SUDIRMAN NO. 19 KOTA PROBOLINGGO', 'probolinggokota.go.id', '@probolinggoimpressive', '', '', ' 0335 - 422135', NULL, '', '', '', '', 'Kota Probolinggo', NULL, '124549'),
	(91, 'Kota Pasuruan', 'Kota Pasuruan', NULL, 'kab', 1, NULL, 'Mewujudkan Kota Pasuruan sebagai Kota yang Maju Ekonominya, Indah Kotanya, dan Harmoni Warganya (Madinah)', 'Mempercepat Pertumbuhan Dan Ketahanan Ekonomi Berbasis Potensi Lokal Untuk Membuka Lapangan Kerja Dan Pengurangan Kemiskinan;\r\nMembangun Kota Yang Indah Dan Nyaman Melalui Konektivitas Infrastruktur Ekonomi Dan Sosial Berkelanjutan;\r\nMemantabkan Kehidupan Masyarakat Multikultural Yang Harmonis Dengan Modal Sosial Yang Tangguh Serta Jaminan Akses Pendidikan Dan Kesehatan Yang Merata;\r\nTransformasi Layanan Publik Yang Mudah Dan Cepat Melalui Digitalisasi Manajemen Dan Birokrasi Yang Adaptif;', NULL, NULL, NULL, NULL, 'foto/pasuruan.jpg', 'Dr. LILIK PUDJIASTUTI, S.H., M.H.,', 'Walikota', '', 'JALAN PAHLAWAN NO 28 KOTA PASURUAN', 'pasuruankota.go.id', '@pemkotpasuruan', '', '', '(0343) 426604', NULL, '', '', '', '', 'Kota Pasuruan', NULL, '139499'),
	(92, 'Kota Mojokerto', 'Kota Mojokerto', NULL, 'kab', 1, 'Meningkatkan kesejahteraan masyarakat menuju taraf hidup yang lebih baik;\r\nMewujudkan Sumber Daya Manusia yang unggul, bermartabat dan berdaya saing;\r\nMeningkatkan penguatan ekonomi berbasis potensi daerah dan investasi;\r\nMeningkatkan kualitas tata kelola pemerintahan yang dinamis dan akuntabel;\r\nMeningkatkan kualitas lingkungan hidup yang layak;', 'Terwujudnya Kota Mojokerto yang Berdaya Saing, Mandiri, Demokratis, Adil Makmur, Sejahtera, dan Bermartabat', 'Mewujudkan SDM Berkualitas Melalui Peningkatan Akses dan Kualitas Pendidikan dan Pelayanan Kesehatan;\r\nMewujudkan Ketertiban, Supremasi Hukum dan HAM;\r\nMewujudkan Pemerintah Daerah Yang Efektif, Demokratis, Bersih, Professional dan Adil Dalam Melayani Masyarakat;\r\nMewujudkan Ekonomi Daerah Yang Mandiri, Berdaya Saing, Berkeadilan dan Berbasis Pada Ekonomi Kerakyatan Melalui Peningkatan Fasilitas Pemangunan Infrastruktur Daerah;\r\nMewujudkan Ketahanan Sosial Budaya Dalam Kerangka Integrasi Nasional, Pada Tatanan Masyarakat Yang Bermartabat, Berakhlak Mulia, Beretika dan Berbudaya Luhur Berlandaskan Pancasila;\r\nMewujudkan Partisipasi Masyarakat Melalui Pemberian Akses dan Kesempatan Dalam Pembangunan;\r\nMewujudkan Anggaran Pendapatan dan Belanja Yang Lebih Mengutamakan Kesejahteraan Masyarakat;', NULL, NULL, NULL, NULL, 'foto/17. HJ. IKA PUSPITASARI, SE.jpg', 'HJ. IKA PUSPITASARI, SE', 'Walikota', '', 'JL. GAJAH MADA NO.145 KOTA MOJOKERTO', 'www.mojokertokota.go.id', '@humaskotamojokerto', '', '', '(0321) 321747', NULL, '', '', '', '', 'Kota Mojokerto', NULL, '983450'),
	(93, 'Kota Madiun', 'Kota Madiun', NULL, 'kab', 1, 'Meningkatkan inklusifitas ekonomi melalui pengembangan sektor potensial, ekonomi kreatif dan digital;\r\nAkselerasi kualitas pembangunan Sumber Data Manusia;\r\nMeningkatkan kualitas pelayanan publik berbasis smart city dan percepatan reformasi birokrasi;', 'Terwujudnya Pemerintahan Bersih Berwibawa Menuju Masyarakat Sejahtera', 'Meningkatkan Kualitas Hidup Masyarakat Kota Madiun Madiun Kota Pintar;\r\nMewujudkan Pemerintahan yang Baik (Good Governance) Melalui Peningkatan Kualitas Pelayanan Kepada Masyarakat;\r\nMeningkatkan Pembangunan Berbasis Pada Partisipasi Masyarakat Kota Madiun Dalam Perencanaan, Pelaksanaan dan Pengawasan Pembangunan;\r\nMewujudkan Kemandirian Ekonomi dan Meratakan Tingkat Kesejahteraan Masyarakat Kota Madiun;\r\nMewujudkan Keterbukaan Informasi Publik Sebagai Kontrol Kinerja dan Akuntabilitas Terhadap Pemerintah Madiun Kota Terbuka;', NULL, NULL, NULL, NULL, 'foto/18. Drs. H. MAIDI, SH, MM, M.Pd.jpg', 'Drs. H. MAIDI, SH, MM, M.Pd', 'Walikota', '', 'Jalan Pahlawan Nomor 37 Kota Madiun', 'https://madiunkota.go.id', '@pemkotmadiun_', '', '', '(0351) 462756', NULL, '', '', '', '', 'Kota Madiun', NULL, '920206'),
	(94, 'Kota Batu', 'Kota Batu', NULL, 'kab', 1, 'Meningkatkan kualitas dan daya saing Sumber Daya Manusia;\r\nMeningkatkan pembangunan ekonomi daerah yang inklusif dan berkelanjutan;\r\nMeningkatkan pembangunan infrastruktur dan ruang kota yang berkelanjutan;\r\nMeningkatkan ketahanan sosial dan pembangunan kebudayaan;\r\nMeningkatnya pelayanan publi dan tata kelola pemerintahan yang kapabel dan akuntabel;', 'Desa Berdaya Kota Berjaya Terwujudnya Kota Batu Sebagai Sentra Agro Wisata Internasional yang Berkarakter, Berdaya Saing dan Sejahtera', 'Meningkatkan kualitas kehidupan sosial masyarakat yang berlandaskan nilai-nilai keagamaan dan kearifan budaya lokal;\r\nMeningkatkan pembangunan kualitas dan kesejahteraan sumber daya manusia;\r\nMewujudkan daya saing perekonomian daerah yang progresif, mandiri berbasis agrowisata;\r\nMewujudkan daya saing perekonomian daerah yang progresif, mandiri berbasis agrowisata;\r\nMeningkatkan pembangunan infrastruktur dan kawasan perdesaan yang berkualitas dan berwawasan lingkungan;\r\nMeningkatkan tata kelola pemerintahan yang baik, bersih dan akuntabel berorientasi pada pelayanan publik yang profesional;', NULL, NULL, NULL, NULL, 'foto/3.jpg', 'ARIES AGUNG PAEWAI,S.STP.,M.M', 'Walikota', '', 'Jl, Panglima Sudirman 507 Pesanggrahan Batu 65313', 'http://batukota.go.id/', '@pemkotbatu_official', '', '', '(0341) 591097', NULL, '', '', '', '', 'Kota Batu', NULL, '299436'),
	(95, 'RSUD. Karsa Husada', 'RSUD. Karsa Husada', 'U095', 'uobk', 1, NULL, 'Menyelenggarakan pelayanan kesehatan dengan upaya penyembuhan, pemulihan, peningkatan, pencegahan, pelayanan rujukan, penyelenggaraan pendidikan, pelatihan, penelitian serta melaksanakan kegiatan teknis operasional dan/atau kegiatan teknis penunjang tertentu di bidang pelayanan kesehatan', 'Penyusunan, perencanaan, pelaksanaan, monitoring dan evaluasi pengelolaan, tata laksana dan tata kelola organisasi Rumah Sakit;\r\nPenyusunan rencana dan program kegiatan Rumah Sakit;\r\nPenyelenggaraan pelayanan medik;\r\nPenyelenggaraan pelayanan penunjang medik dan non medik;\r\nPenyelenggaraan pelayanan dan asuhan keperawatan;\r\npelaksanaan pelayanan kesehatan umum masyarakat;\r\nPenyelenggaraan pendidikan, pelatihan, penelitian serta pengembangan;\r\nPenyelenggaraan pelayanan rujukan pasien, spesimen, ilmu pengetahuan dan teknologi serta program;\r\nPeningkatan mutu dan keselamatan pasien;\r\nPelaksanaan program kesehatan nasional;\r\nPenyelenggaraan kegiatan ketatausahaan;\r\nPelaksanaan dukungan pembinaan wilayah di bidang teknis;\r\nPenyusunan, perencanaan dan pelaksanaan program pengembangan bisnis Rumah Sakit;\r\nPelaksanaan dukungan pelayanan kesehatan masyarakat (promotif, preventif, kuratif dan rehabilitatif) baik Upaya Kesehatan Perorangan (UKP) maupun Upaya Kesehatan Masyarakat (UKM) di dalam gedung maupun di luar gedung di wilayah binaannya;"\r\nPenyelenggaraan koordinasi dan kemitraan kegiatan Rumah Sakit;\r\nPengawasan dan pengendalian operasional Rumah Sakit;\r\nPelaksanaan fungsi lain yang diberikan Kepala Dinas;', NULL, NULL, NULL, NULL, 'foto/dr__muhammad_rizal,_mm,_m__kes.jpg', 'dr. MUHAMMAD RIZAL, M.M, M. Kes', 'Direktur', '', 'Jl. Ahmad Yani No.11-13, Ngaglik, Kec. Batu, Kota Batu, Jawa Timur', 'https://rsukarsahusadabatu.jatimprov.go.id/', '@rsudkarsahusada', '', '', '(0341) 596898', NULL, '', '', '', '', NULL, '102000000010006', '216993');
